: [user:name]\r\nwachtwoord: Uw wachtwoord\r\n\r\n--  [site:name] team\";s:7:\"subject\";s:55:\"Accountgegevens voor [user:display-name] op [site:name]\";}s:25:\"register_pending_approval\";a:2:{s:4:\"body\";s:294:\"[user:display-name],\r\n\r\nThank you for registering at [site:name]. Your application for an account is currently pending approval. Once it has been approved, you will receive another email containing information about how to log in, set your password, and other details.\r\n\r\n\r\n--  [site:name] team\";s:7:\"subject\";s:101:\"Accountgegevens voor [user:display-name] op [site:name] (wachtend op de goedkeuring van de beheerder)\";}s:31:\"register_pending_approval_admin\";a:2:{s:4:\"body\";s:69:\"[user:display-name] heeft een account aangevraagd.\r\n\r\n[user:edit-url]\";s:7:\"subject\";s:101:\"Accountgegevens voor [user:display-name] op [site:name] (wachtend op de goedkeuring van de beheerder)\";}s:16:\"status_activated\";a:2:{s:4:\"body\";s:487:\"[user:display-name],\r\n\r\nUw account op [site:name] is geactiveerd.\r\n\r\nU kunt nu inloggen door op de onderstaande link te klikken of deze in uw browser te kopiëren:\r\n\r\n[user:one-time-login-url]\r\n\r\nDit is een eenmalige login en u wordt doorgestuurd naar een pagina waar u uw wachtwoord kunt instellen.\r\n\r\nNadat u uw wachtwoord heeft gewijzigd, kunt u in de toekomst inloggen op [site:login-url] met:\r\n\r\ngebruikersnaam: [user:account-name]\r\nwachtwoord: Uw wachtwoord\r\n\r\n--  [site:name] team\";s:7:\"subject\";s:69:\"Accountgegevens voor [user:display-name] op [site:name] (goedgekeurd)\";}s:14:\"status_blocked\";a:2:{s:4:\"body\";s:89:\"[user:display-name],\r\n\r\nUw account op [site:name] is geblokkeerd.\r\n\r\n--  [site:name] team\";s:7:\"subject\";s:69:\"Accountgegevens voor [user:display-name] op [site:name] (geblokkeerd)\";}s:15:\"status_canceled\";a:2:{s:4:\"body\";s:89:\"[user:display-name],\r\n\r\nUw account op [site:name] is geannuleerd.\r\n\r\n--  [site:name] team\";s:7:\"subject\"