ould have article and page content types within the main site content entity type, and tag and category vocabularies within the taxonomy term entity type); other entity types, such as user accounts, do not have sub-types. Programmers use the term <em>bundle</em> for entity sub-types.','','none'),(6616,'Fields and field types','','none'),(6617,'Content entity types and sub-types store most of their text, file, and other information in <em>fields</em>. Fields are grouped by <em>field type</em>; field types define what type of data can be stored in that field, such as text, images, or taxonomy term references.','','none'),(6618,'Formatters and view modes','','none'),(6619,'Content entity types and sub-types can have one or more <em>view modes</em>, used for displaying the entity items. For instance, a content item could be viewed in full content mode on its own page, teaser mode in a list, or RSS mode in a feed. In each view mode, each field can be hidden or displayed, and if it is displayed, you can choose and configure the <em>formatter</em> that is used to display the field. For instance, a long text field can be displayed trimmed or full-length, and taxonomy term reference fields can be displayed in plain text or linked to the taxonomy term page.','','none'),(6620,'Widgets and form modes','','none'),(6621,'Content entity types and sub-types can have one or more <em>form modes</em>, used for editing. For instance, a content item could be edited in a compact format with only some fields editable, or a full format that allows all fields to be edited. In each form mode, each field can be hidden or displayed, and if it is displayed, you can choose and configure the <em>widget</em> that is used to edit the field. For instance, a taxonomy term reference field can be edited using a select list, radio buttons, or an autocomplete widget.','','none'),(6622,'Enabling field types, widgets, and formatters','','none'),(6623,'Views entity field handler','','none'),(6624,'Creating a field','','none'),(6625,'On the <em>Manage fields</em> page for your entity type or sub-type, you can add, configure, and delete fields for that entity type or sub-type. Each field has a <em>machine name</em>, which is used internally to identify the field and must be unique across an entity type; once a field is created, you cannot change the machine name. Most fields have two types of settings. The field-level settings depend on the field type, and affect how the data in the field is stored. Once they are set, they can no longer be changed; examples include how many data values are allowed for the field and where files are stored. The sub-type-level settings are specific to each entity sub-type the field is used on, and they can be changed later; examples include the field label, help text, default value, and whether the field is required or not. You can return to these settings by choosing the <em>Edit</em> link for the field from the <em>Manage fields</em> page.','','none'),(6626,'Re-using fields','','none'),(6627,'Once you have created a field, you can use it again in other sub-types of the same entity type. For instance, if you create a field for the article content type, you can also use it for the page content type, but you cannot use it for custom blocks or taxonomy terms. If there are fields available for re-use, after clicking <em>Add field</em> from the <em>Manage fields</em> page, you will see a list of available fields for re-use. After selecting a field for re-use, you can configure the sub-type-level settings.','','none'),(6628,'Configuring field editing','','none'),(6629,'On the <em>Manage form display</em> page of your entity type or sub-type, you can configure how the field data is edited by default and in each form mode. If your entity type has multiple form modes (on most sites, most entities do not), you can toggle between the form modes at the top of the page, and you can toggle whether each form mode uses the default settings or custom settings in the <em>Custom display settings</em> section. For each field in each form mode, you can select the widget to use for editing; some widgets have additional configuration options, such as the size for a text field, and these can be edited using the Edit button (which looks like a wheel). You can also change the order of the fields on the form. You can exclude a field from a form by choosing <em>Hidden</em> from the widget drop-down list, or by dragging it into the <em>Disabled</em> section.','','none'),(6630,'Configuring field display','','none'),(6631,'On the <em>Manage display</em> page of your entity type or sub-type, you can configure how each field is displayed by default and in each view mode. If your entity type has multiple view modes, you can toggle between the view modes at the top of the page, and you can toggle whether each view mode uses the default settings or custom settings in the <em>Custom display settings</em> section. For each field in each view mode, you can choose whether and how to display the label of the field from the <em>Label</em> drop-down list. You can also select the formatter to use for display; some formatters have configuration options, which you can edit using the Edit button (which looks like a wheel). You can also change the display order of fields. You can exclude a field from a specific view mode by choosing <em>Hidden</em> from the formatter drop-down list, or by dragging it into the <em>Disabled</em> section.','','none'),(6632,'Configuring view and form modes','','none'),(6633,'Listing fields','','none'),(6634,'Images must be exactly <strong>@size</strong> pixels.','','none'),(6635,'Images must be larger than <strong>@min</strong> pixels. Images larger than <strong>@max</strong> pixels will be resized.','','none'),(6636,'Images must be larger than <strong>@min</strong> pixels.','','none'),(6637,'Images larger than <strong>@max</strong> pixels will be resized.','','9.1.3'),(6638,'Define how text is handled by combining filters into text formats.','','none'),(6639,'Forum leaf','Validation','none'),(6640,'The menu link language code.','','none'),(6641,'Node authored by (uid)','','none'),(6642,'Revision authored by (uid)','','none'),(6643,'Role requires permission <em>view revisions</em> and <em>edit rights</em> for nodes in question or <em>administer nodes</em>.','','none'),(6644,'Role requires permission to <em>view revisions</em> and <em>delete rights</em> for nodes in question or <em>administer nodes</em>.','','none'),(6645,'The location this shortcut points to.','','none'),(6646,'Change site name, email address, slogan, default front page, and error pages.','','9.1.3'),(6647,'This is only used when the site is configured to use a separate administration theme on the Appearance page.','','none'),(6648,'Link to any page','','none'),(6649,'This allows to bypass access checking when linking to internal paths.','','none'),(6650,'No access to execute %action on the @entity_type_label %entity_label.','','none'),(6651,'narrow','','none'),(6652,'The reference view %view_name cannot be found.','','none'),(6653,'Enabled','Plural','none'),(6654,'Active menu trail','','none'),(6655,'Configuration updates','','none'),(6656,'The listed configuration will be updated.','','none'),(6657,'An entity field containing a password value.','','none'),(6658,'An autocomplete text field with tagging support.','','none'),(6659,'The feed %label has been deleted.','','none'),(6660,'Block Content revision is a history of changes to block content.','','none'),(6661,'Get the actual block content from a block content revision.','','none'),(6662,'The Color module saves a modified copy of the theme\'s specified stylesheets in the files directory. If you make any manual changes to your theme\'s stylesheet, <em>you must save your color settings again, even if you haven\'t changed the colors</em>. This step is required because the module stylesheets in the files directory need to be recreated to reflect your changes.','','none'),(6663,'Responsive image style %label saved.','','none'),(6664,'Field, widget, and formatter information','','none'),(6665,'Provided by modules','','none'),(6666,'Here is a list of the currently enabled field, formatter, and widget modules:','','none'),(6667,'Provided by Drupal core','','none'),(6668,'As mentioned previously, some field types, widgets, and formatters are provided by Drupal core. Here are some notes on how to use some of these:','','none'),(6669,'<strong>Number fields</strong>: When you add a number field you can choose from three types: <em>decimal</em>, <em>float</em>, and <em>integer</em>. The <em>decimal</em> number field type allows users to enter exact decimal values, with fixed numbers of decimal places. The <em>float</em> number field type allows users to enter approximate decimal values. The <em>integer</em> number field type allows users to enter whole numbers, such as years (for example, 2012) or values (for example, 1, 2, 5, 305). It does not allow decimals.','','none'),(6670,'Defining image styles','','none'),(6671,'Naming image styles','','none'),(6672,'When you define an image style, you will need to choose a displayed name and a machine name. The displayed name is shown in administrative pages, and the machine name is used to generate the URL for accessing an image processed in that style. There are two common approaches to naming image styles: either based on the effects being applied (for example, <em>Square 85x85</em>), or based on where you plan to use it (for example, <em>Profile picture</em>).','','none'),(6673,'Configuring image fields','','none'),(6674,'A few of the settings for image fields are defined once when you create the field and cannot be changed later; these include the choice of public or private file storage and the number of images that can be stored in the field. The rest of the settings can be edited later; these settings include the field label, help text, allowed file extensions, image resolution restrictions, and the subdirectory in the public or private file storage where the images will be stored. The editable settings can also have different values for different entity sub-types; for instance, if your image field is used on both Page and Article content types, you can store the files in a different subdirectory for the two content types.','','none'),(6675,'The maximum file size that can be uploaded is limited by PHP settings of the server, but you can restrict it further by configuring a <em>Maximum upload size</em> in the field settings (this setting can be changed later). The maximum file size, either from PHP server settings or field configuration, is automatically displayed to users in the help text of the image field.','','none'),(6676,'You can also configure a default image that will be used if no image is uploaded in an image field. This default can be defined for all instances of the field in the field storage settings when you create a field, and the setting can be overridden for each entity sub-type that uses the field.','','none'),(6677,'Configuring displays and form displays','','none'),(6678,'On the <em>Manage display</em> page, you can choose the image formatter, which determines the image style used to display the image in each display mode and whether or not to display the image as a link. On the <em>Manage form display</em> page, you can configure the image upload widget, including setting the preview image style shown on the entity edit form.','','none'),(6679,'Selected language configuration','','none'),(6680,'Selected default language no longer exists.','','none'),(6681,'Language detection configuration saved.','','none'),(6682,'Language codes or other custom text to use as a path prefix for URL language detection. For the selected fallback language, this value may be left blank. <strong>Modifying this value may break existing URLs. Use with caution in a production environment.</strong> Example: Specifying \"deutsch\" as the path prefix 