','none'),(7060,'Please continue to <a href=\":error_url\">the error page</a>','','none'),(7061,'The installer requires that you create a translations directory as part of the installation process. Create the directory %translations_directory . More details about installing Drupal are available in <a href=\":install_txt\">INSTALL.txt</a>.','','none'),(7062,'The installer requires read permissions to %translations_directory at all times. The <a href=\":handbook_url\">webhosting issues</a> documentation section offers help on this and other topics.','','none'),(7063,'The installer requires write permissions to %translations_directory during the installation process. The <a href=\":handbook_url\">webhosting issues</a> documentation section offers help on this and other topics.','','none'),(7064,'The installer requires to contact the translation server to download a translation file. Check your internet connection and verify that your website can reach the translation server at <a href=\":server_url\">@server_url</a>.','','none'),(7065,'The %language translation file is not available at the translation server. <a href=\":url\">Choose a different language</a> or select English and translate your website later.','','none'),(7066,'The %language translation file could not be downloaded. <a href=\":url\">Choose a different language</a> or select English and translate your website later.','','none'),(7067,'The @drupal installer requires that you create a %file as part of the installation process. Copy the %default_file file to %file. More details about installing Drupal are available in <a href=\":install_txt\">INSTALL.txt</a>.','','none'),(7068,'@drupal requires read permissions to %file at all times. The <a href=\":handbook_url\">webhosting issues</a> documentation section offers help on this and other topics.','','none'),(7069,'The @drupal installer requires write permissions to %file during the installation process. The <a href=\":handbook_url\">webhosting issues</a> documentation section offers help on this and other topics.','','none'),(7070,'The @drupal installer failed to create a %file file with proper file ownership. Log on to your web server, remove the existing %file file, and create a new one by copying the %default_file file to %file. More details about installing Drupal are available in <a href=\":install_txt\">INSTALL.txt</a>. The <a href=\":handbook_url\">webhosting issues</a> documentation section offers help on this and other topics.','','none'),(7071,'Check the messages and <a href=\":retry\">retry</a>, or you may choose to <a href=\":cont\">continue anyway</a>.','','none'),(7072,'Check the messages and <a href=\":url\">try again</a>.','','none'),(7073,'The directory %directory could not be created or could not be made writable. To proceed with the installation, either create the directory and modify its permissions manually or ensure that the installer has the permissions to create it automatically. For more information, see the <a href=\":handbook_url\">online handbook</a>.','','none'),(7074,'The following modules are required but were not found. Move them into the appropriate modules subdirectory, such as <em>/modules</em>. Missing modules: @modules','','none'),(7075,'Updating @module','','none'),(7076,'Post updating @module','','none'),(7077,'Entity type mismatch on rename. @old_type not equal to @new_type for existing configuration @old_name and staged configuration @new_name.','','none'),(7078,'Rename operation for simple configuration. Existing configuration @old_name and staged configuration @new_name.','','none'),(7079,'Your MySQL server and PHP MySQL driver must support utf8mb4 character encoding. Make sure to use a database system that supports this (such as MySQL/MariaDB/Percona 5.5.3 and up), and that the utf8mb4 character set is compiled in. See the <a href=\":documentation\" target=\"_blank\">MySQL documentation</a> for more information.','','none'),(7080,'The %driver database must use %encoding encoding to work with Drupal. Recreate the database with %encoding encoding. See <a href=\"INSTALL.pgsql.txt\">INSTALL.pgsql.txt</a> for more details.','','none'),(7081,'The %setting setting is currently set to \'%current_value\', but needs to be \'%needed_value\'. Change this by running the following query: <code>@query</code>','','none'),(7082,'Date (e.g. @format)','','none'),(7083,'Time (e.g. @format)','','none'),(7084,'@uri','','none'),(7085,'Operating in maintenance mode. <a href=\":url\">Go online.</a>','','none'),(7086,'Textfield size: @size','','none'),(7087,'Number of rows: @rows','','none'),(7088,'URI field size: @size','','none'),(7089,'WARNING: You are not using an encrypted connection, so your password will be sent in plain text. <a href=\":https-link\">Learn more</a>.','','none'),(7090,'Failed to connect to the server. The server reports the following message: <p class=\"error\">@message</p> For more help installing or updating code on your server, see the <a href=\":handbook_url\">handbook</a>.','','none'),(7091,'The form has become outdated. Copy any unsaved work in the form below and then <a href=\":link\">reload this page</a>.','','none'),(7092,'@name cannot be longer than %max characters but is currently %length characters long.','','none'),(7093,'<ul>\n<li>To start over, you must empty your existing database and copy <em>default.settings.php</em> over <em>settings.php</em>.</li>\n<li>To upgrade an existing installation, proceed to the <a href=\":update-url\">update script</a>.</li>\n<li>View your <a href=\":base-url\">existing site</a>.</li>\n</ul>','','none'),(7094,'All necessary changes to %dir and %file have been made, so you should remove write permissions to them now in order to avoid security risks. If you are unsure how to do so, consult the <a href=\":handbook_url\">online handbook</a>.','','9.1.3'),(7095,'The system will notify you when updates and important security releases are available for installed components. Anonymous information about your site is sent to <a href=\":drupal\">Drupal.org</a>.','','none'),(7096,'File Transfer failed, reason: @reason','','none'),(7097,'Unique field constraint','Validation','none'),(7098,'A @entity_type with @field_name %value already exists.','','none'),(7099,'The Actions module provides tasks that can be executed by the site such as unpublishing content, sending email messages, or blocking a user. Other modules can trigger these actions when specific system events happen; for example, when new content is posted or when a user logs in. Modules can also provide additional actions. For more information, see the <a href=\":documentation\">online documentation for the Actions module</a>.','','none'),(7100,'<em>Simple actions</em> do not require configuration and are listed automatically as available on the <a href=\":actions\">Actions page</a>.','','none'),(7101,'<em>Advanced actions</em> are user-created and have to be configured individually. Create an advanced action on the <a href=\":actions\">Actions page</a> by selecting an action type from the drop-down list. Then configure your action, for example by specifying the recipient of an automated email message.','','none'),(7102,'The message that should be sent. You may include placeholders like [node:title], [user:account-name], [user:display-name] and [comment:body] to represent data that will be different each time message is sent. Not all placeholders will be available in all contexts.','','none'),(7103,'The message to be displayed to the current user. You may include placeholders like [node:title], [user:account-name], [user:display-name] and [comment:body] to represent data that will be different each time message is sent. Not all placeholders will be available in all contexts.','','none'),(7104,'The Aggregator module is an on-site syndicator and news reader that gathers and displays fresh content from RSS-, RDF-, and Atom-based feeds made available across the web. Thousands of sites (particularly news sites and blogs) publish their latest headlines in feeds, using a number of standardized XML-based formats. For more information, see the <a href=\":aggregator-module\">online documentation for the Aggregator module</a>.','','none'),(7105,'Users view feed content in the <a href=\":aggregator\">main aggregator display</a>, or by <a href=\":aggregator-sources\">their source</a> (usually via an RSS feed reader). The most recent content in a feed can be displayed as a block through the <a href=\":admin-block\">Blocks administration page</a>.','','none'),(7106,'Administrators can add, edit, and delete feeds, and choose how often to check each feed for newly updated items on the <a href=\":feededit\">Feed aggregator page</a>.','','none'),(7107,'Configuring the display of feed items','','none'),(7108,'Administrators can choose how many items are displayed in the listing pages, which HTML tags are allowed in the content of feed items, and whether they should be trimmed to a maximum number of characters on the <a href=\":settings\">Feed aggregator settings page</a>.','','none'),(7109,'Discarding old feed items','','none'),(7110,'Administrators can choose whether to discard feed items that are older than a specified period of time on the <a href=\":settings\">Feed aggregator settings page</a>. This requires a correctly configured cron maintenance task (see below).','','none'),(7111,'A <a href=\":aggregator-opml\">machine-readable OPML file</a> of all feeds is available. OPML is an XML-based file format used to share outline-structured information such as a list of RSS feeds. Feeds can also be <a href=\":import-opml\">imported via an OPML file</a>.','','none'),(7112,'A working <a href=\":cron\">cron maintenance task</a> is required to update feeds automatically.','','none'),(7113,'Current feeds are listed below, and <a href=\":addfeed\">new feeds may be added</a>. For each feed, the <em>latest items</em> block may be enabled at the <a href=\":block\">blocks administration page</a>.','','none'),(7114,'Feed aggregator settings','','none'),(7115,'@title feed','','none'),(7116,'No feeds available. <a href=\":link\">Add feed</a>.','','none'),(7117,'The parent website\'s description that comes from the @description element in the feed.','','none'),(7118,'The length of time between feed updates. Requires a correctly configured <a href=\":cron\">cron maintenance task</a>.','','none'),(7119,'Requires a correctly configured <a href=\":cron\">cron maintenance task</a>.','','none'),(7120,'The Ban module allows administrators to ban visits to their site from individual IP addresses. For more information, see the <a href=\":url\">online documentation for the Ban module</a>.','','none'),(7121,'Administrators can enter IP addresses to ban on the <a href=\":bans\">IP address bans</a> page.','','none'),(7122,'The HTTP Basic Authentication module supplies an <a href=\"http://en.wikipedia.org/wiki/Basic_access_authentication\">HTTP Basic authentication</a> provider for web service requests. This authentication provider authenticates requests using the HTTP Basic Authentication username and password, as an alternative to using Drupal\'s standard cookie-based authentication system. It is only useful if your site provides web services configured to use this type of authentication (for instance, the <a href=\":rest_help\">RESTful Web Services module</a>). For more information, see the <a href=\":hba_do\">online documentation for the HTTP Basic Authentication module</a>.','','none'),(7123,'The Block module allows you to place blocks in regions of your installed themes, and configure block settings. For more information, see the <a href=\":blocks-documentation\">online documentation for the Block module</a>.','','none'),(7124,'You can see where the regions are for the current theme by clicking the <em>Demonstrate block regions</em> link on the <a href=\":blocks\">Block layout page</a>. Regions are specific to each theme.','','none'),(7125,'To change the settings of an individual block click on the <em>Configure</em> link on the <a href=\":blocks\">Block layout page</a>. The available options vary depending on the module that provides the block. For all blocks you can change the block title and toggle whether to display it.','','none'),(7126,'You can add custom blocks, if the <em>Custom Block</em> module is installed. For more information, see the <a href=\":blockcontent-help\">Custom Block help page</a>.','','none'),(7127,'Block settings updated.','','none'),(7128,'Edit %label custom block type','','none'),(7129,'You have not created any block types yet. Go to the <a href=\":url\">block type creation page</a> to add a new block type.','','none'),(7130,'Block with uuid %uuid does not exist. <a href=\":url\">Add custom block</a>.','','none'),(7131,'Add a <a href=\":url\">custom block</a>.','','none'),(7132,'The Book module is used for creating structured, multi-page content, such as site resource guides, manuals, and wikis. It allows you to create content that has chapters, sections, subsections, or any similarly-tiered structure. Enabling the module creates a new content type <em>Book page</em>. For more information, see the <a href=\":book\">online documentation for the Book module</a>.','','none'),(7133,'You can assign separate permissions for <em>creating new books</em> as well as <em>creating</em>, <em>editing</em> and <em>deleting</em> book content. Users with the <em>Administer book outlines</em> permission can add <em>any</em> type of content to a book by selecting the appropriate book outline while editing the content. They can also view a list of all books, and edit and rearrange section titles on the <a href=\":admin-book\">Book list page</a>.','','none'),(7134,'The <em>Book page</em> content type is the initial content type enabled for book outlines. On the <a href=\":admin-settings\">Book settings page</a> you can configure content types that can used in book outlines.','','none'),(7135,'Users with the <em>Add content and child pages to books</em> permission will see a link to <em>Add child page</em> when viewing a content item that is part of a book outline. This link will allow users to create a new content item of the content type you select on the <a href=\":admin-settings\">Book settings page</a>. By default this is the <em>Book page</em> content type.','','none'),(7136,'Book pages have a default book-specific navigation block. This navigation block contains links that lead to the previous and next pages in the book, and to the level above the current page in the book\'s structure. This block can be enabled on the <a href=\':admin-block\'>Blocks layout page</a>. For book pages to show up in the book navigation, they must be added to a book outline.','','none'),(7137,'The outline feature allows you to include pages in the <a href=\":book\">Book hierarchy</a>, as well as move them within the hierarchy or to <a href=\":book-admin\">reorder an entire book</a>.','','none'),(7138,'The parent page in the book. The maximum depth for a book and all child pages is @maxdepth. Some pages in the selected book may not be available as parents if selecting them would exceed this limit.','','none'),(7139,'The Breakpoint module keeps track of the height, width, and resolution breakpoints where a responsive design needs to change in order to respond to different devices being used to view the site. This module does not have a user interface. For more information, see the <a href=\":docs\">online documentation for the Breakpoint module</a>.','','none'),(7140,'<a href=\":w3\">Media  queries</a> are a formal way to encode breakpoints. For instance, a width breakpoint at 40em would be written as the media query \"(min-width: 40em)\". Breakpoints are really just media queries with some additional meta-data, such as a name and multiplier information.','','none'),(7141,'The CKEditor module provides a highly-accessible, highly-usable visual text editor and adds a toolbar to text fields. Users can use buttons to format content and to create semantically correct and valid HTML. The CKEditor module uses the framework provided by the <a href=\":text_editor\">Text Editor module</a>. It requires JavaScript to be enabled in the browser. For more information, see the <a href=\":doc_url\">online documentation for the CKEditor module</a> and the <a href=\":cke_url\">CKEditor website</a>.','','none'),(7142,'CKEditor has to be enabled and configured separately for individual text formats from the <a href=\":formats\">Text formats and editors page</a> because the filter settings for each text format can be different. For more information, see the <a href=\":text_editor\">Text Editor help page</a> and <a href=\":filter\">Filter help page</a>.','','none'),(7143,'CKEditor only allow users to format content in accordance with the filter configuration of the specific text format. If a text format excludes certain HTML tags, the corresponding toolbar buttons are not displayed to users when they edit a text field in this format. For more information see the <a href=\":filter\">Filter help page</a>.','','none'),(7144,'The built in WYSIWYG editor (CKEditor) comes with a number of <a href=\":features\">accessibility features</a>. CKEditor comes with built in <a href=\":shortcuts\">keyboard shortcuts</a>, which can be beneficial for both power users and keyboard only users.','','none'),(7145,'The Color module allows users with the <em>Administer site configuration</em> permission to change the color scheme (color of links, backgrounds, text, and other theme elements) of compatible themes. For more information, see the <a href=\":color_do\">online documentation for the Color module</a>.','','none'),(7146,'To change the color settings, select the <em>Settings</em> link for your theme on the <a href=\":appearance\">Appearance</a> page. If the color picker does not appear then the theme is not compatible with the Color module.','','none'),(7147,'The Comment module allows users to comment on site content, set commenting defaults and permissions, and moderate comments. For more information, see the <a href=\":comment\">online documentation for the Comment module</a>.','','none'),(7148,'Enabling commenting','','none'),(7149,'Comment functionality can be enabled for any entity sub-type (for example, a <a href=\":content-type\">content type</a>) by adding a <em>Comments</em> field on its <em>Manage fields page</em>. Adding or removing commenting for an entity through the user interface requires the <a href=\":field_ui\">Field UI</a> module to be enabled, even though the commenting functionality works without it. For more information on fields and entities, see the <a href=\":field\">Field module help page</a>.','','none'),(7150,'Configuring commenting settings','','none'),(7151,'Commenting settings can be configured by editing the <em>Comments</em> field on the <em>Manage fields page</em> of an entity type if the <em>Field UI module</em> is enabled. Configuration includes the label of the comments field, the number of comments to be displayed, and whether they are shown in threaded list. Commenting can be be configured as: <em>Open</em> to allow new comments, <em>Closed</em> to view existing comments, but prevent new comments, or <em>Hidden</em> to hide existing comments and prevent new comments. Changing this configuration for an entity type will not change existing entity items.','','none'),(7152,'Users with the appropriate permissions can override the default commenting settings of an entity type when they create an item of that type.','','none'),(7153,'Comments from users who have the <em>Skip comment approval</em> permission are published immediately. All other comments are placed in the <a href=\":comment-approval\">Unapproved comments</a> queue, until a user who has permission to <em>Administer comments and comment settings</em> publishes or deletes them. Published comments can be bulk managed on the <a href=\":admin-comment\">Published comments</a> administration page. When a comment has no replies, it remains editable by its author, as long as the author has <em>Edit own comments</em> permission.','','none'),(7154,'In reply to @parent_title by @parent_username','','none'),(7155,'Name for @anonymous','','none'),(7156,'<a href=\":login\">Log in</a> or <a href=\":register\">register</a> to post comments','','none'),(7157,'<a href=\":login\">Log in</a> to post comments','','none'),(7158,'Select the Comment type to use for this comment field. Manage the comment types from the <a href=\":url\">administration overview page</a>.','','none'),(7159,'The Configuration Manager module provides a user interface for importing and exporting configuration changes between installations of your website in different environments. Configuration is stored in YAML format. For more information, see the <a href=\":url\">online documentation for the Configuration Manager module</a>.','','none'),(7160,'You can create and download an archive consisting of all your site\'s configuration exported as <em>*.yml</em> files on the <a href=\":url\">Export</a> page.','','none'),(7161,'You can upload a full site configuration from an archive file on the <a href=\":url\">Import</a> page. When importing data from a different environment, the site and import files must have matching configuration values for UUID in the <em>system.site</em> configuration item. That means that your other environments should initially be set up as clones of the target site. Migrations are not supported.','','none'),(7162,'You can review differences between the active configuration and an imported configuration archive on the <a href=\":synchronize\">Synchronize</a> page to ensure that the changes are as expected, before finalizing the import. The Synchronize page also shows configuration items that would be added or removed.','','none'),(7163,'You can export a single configuration item by selecting a <em>Configuration type</em> and <em>Configuration name</em> on the <a href=\":single-export\">Single export</a> page. The configuration and its corresponding <em>*.yml file name</em> are then displayed on the page for you to copy.','','none'),(7164,'You can import a single configuration item by pasting it in YAML format into the form on the <a href=\":single-import\">Single import</a> page.','','none'),(7165,'Export and download the full configuration of this site as a gzipped tar file.','','none'),(7166,'Choose a configuration item to display its YAML structure.','','none'),(7167,'Import a single configuration item by pasting its YAML structure into the text field.','','none'),(7168,'Full archive','','none'),(7169,'Single item','','none'),(7170,'Staged','','none'),(7171,'The following items in your active configuration have changes since the last import that may be lost on the next import.','','none'),(7172,'@collection configuration collection','','none'),(7173,'@source_name to @target_name','','none'),(7174,'The Configuration Translation module allows you to translate configuration text; for example, the site name, vocabularies, menus, or date formats. Together with the modules <a href=\":language\">Language</a>, <a href=\":content-translation\">Content Translation</a>, and <a href=\":locale\">Interface Translation</a>, it allows you to build multilingual websites. For more information, see the <a href=\":doc_url\">online documentation for the Configuration Translation module</a>.','','none'),(7175,'In order to translate configuration, the website must have at least two <a href=\":url\">languages</a>.','','none'),(7176,'Users with the <em>Translate user edited configuration</em> permission can access the configuration translation overview, and manage translations for specific languages. The <a href=\":translation-page\">Configuration translation</a> page shows a list of all configuration text that can be translated, either as individual items or as lists. After you click on <em>Translate</em>, you are provided with a list of all languages. You can <em>add</em> or <em>edit</em> a translation for a specific language. Users with specific configuration permissions can also <em>edit</em> the text for the site\'s default language. For some configuration text items (for example for the site information), the specific translation pages can also be accessed directly from their configuration pages.','','none'),(7177,'You can choose to translate date formats on the <a href=\":translation-page\">Configuration translation</a> page. This allows you not only to translate the label text, but also to set a language-specific <em>PHP date format</em>.','','none'),(7178,'@label <span class=\"visually-hidden\">(@source_language)</span>','','none'),(7179,'The Contact module allows visitors to contact registered users on your site, using the personal contact form, and also allows you to set up site-wide contact forms. For more information, see the <a href=\":contact\">online documentation for the Contact module</a>.','','none'),(7180,'On the <a href=\":contact_admin\">Contact forms page</a>, you can configure the fields and display of the personal contact form, and you can set up one or more site-wide contact forms. Each site-wide contact form has a machine name, a label, and one or more defined recipients; when a site visitor submits the form, the field values are sent to those recipients.','','none'),(7181,'One site-wide contact form can be designated as the default contact form. If you choose to designate a default form, the <em>Contact</em> menu link in the <em>Footer</em> menu will link to it. You can modify this link from the <a href=\":menu-settings\">Menus page</a> if you have the Menu UI module installed. You can also create links to other contact forms; the URL for each form you have set up has format <em>contact/machine_name_of_form</em>.','','none'),(7182,'From the <a href=\":contact_admin\">Contact forms page</a>, you can configure the fields to be shown on contact forms, including their labels and help text. If you would like other content (such as text or images) to appear on a contact form, use a block. You can create and edit blocks on the <a href=\":blocks\">Block layout page</a>, if the Block module is installed.','','none'),(7183,'[@form] @subject','','none'),(7184,'@sender-name (@sender-url) sent a message using the contact form at @form-url.','','none'),(7185,'[@site-name] @subject','','none'),(7186,'Hello @recipient-name,','','none'),(7187,'@sender-name (@sender-url) has sent you a message via your contact form at @site-name.','','none'),(7188,'If you don\'t want to receive such emails, you can change your settings at @recipient-edit-url.','','none'),(7189,'@name (not verified)','','none'),(7190,'The contact form has not been configured. <a href=\":add\">Add one or more forms</a> .','','none'),(7191,'The Content Translation module allows you to translate content, comments, custom blocks, taxonomy terms, users and other <a href=\":field_help\" title=\"Field module help, with background on content entities\">content entities</a>. Together with the modules <a href=\":language\">Language</a>, <a href=\":config-trans\">Configuration Translation</a>, and <a href=\":locale\">Interface Translation</a>, it allows you to build multilingual websites. For more information, see the <a href=\":translation-entity\">online documentation for the Content Translation module</a>.','','none'),(7192,'In order to translate content, the website must have at least two <a href=\":url\">languages</a>. When that is the case, you can enable translation for the desired content entities on the <a href=\":translation-entity\">Content language</a> page. When enabling translation you can choose the default language for content and decide whether to show the language selection field on the content editing forms.','','none'),(7193,'Before you can translate content, there must be at least two languages added on the <a href=\":url\">languages administration</a> page.','','none'),(7194,'To configure translation for this field, <a href=\":language-settings-url\">enable language support</a> for this type.','','none'),(7195,'<a href=\":settings_url\">Enable translation</a> for <em>content types</em>, <em>taxonomy vocabularies</em>, <em>accounts</em>, or any other element you wish to translate.','','none'),(7196,'The Contextual links module gives users with the <em>Use contextual links</em> permission quick access to tasks associated with certain areas of pages on your site. For example, a menu displayed as a block has links to edit the menu and configure the block. For more information, see the <a href=\":contextual\">online documentation for the Contextual Links module</a>.','','none'),(7197,'Hovering over the area of interest will temporarily make the contextual links button visible (which looks like a pencil in most themes, and is normally displayed in the upper right corner of the area). The icon typically looks like this: @picture','','none'),(7198,'If you have the <a href=\":toolbar\">Toolbar module</a> enabled, clicking the contextual links button in the toolbar (which looks like a pencil) will make all contextual links buttons on the page visible. Clicking this button again will toggle them to invisible.','','none'),(7199,'The Datetime module provides a Date field that stores dates and times. It also provides the Form API elements <em>datetime</em> and <em>datelist</em> for use in programming modules. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI module help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":datetime_do\">online documentation for the Datetime module</a>.','','none'),(7200,'The <em>settings</em> and the <em>display</em> of the Date field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(7201,'Dates can be displayed using the <em>Plain</em> or the <em>Default</em> formatter. The <em>Plain</em> formatter displays the date in the <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601</a> format. If you choose the <em>Default</em> formatter, you can choose a format from a predefined list that can be managed on the <a href=\":date_format_list\">Date and time formats</a> page.','','none'),(7202,'Date part order: @order','','none'),(7203,'Time type: @time_type','','none'),(7204,'Time increments: @increment','','none'),(7205,'The Database Logging module logs system events in the Drupal database. For more information, see the <a href=\":dblog\">online documentation for the Database Logging module</a>.','','none'),(7206,'The Database Logging module allows you to view an event log on the <a href=\":dblog\">Recent log messages</a> page. The log is a chronological list of recorded events containing usage data, performance data, errors, warnings and operational information. Administrators should check the log on a regular basis to ensure their site is working properly.','','none'),(7207,'In case of errors or problems with the site, the <a href=\":dblog\">Recent log messages</a> page can be useful for debugging, since it shows the sequence of events. The log messages include usage information, warnings, and errors.','','none'),(7208,'The maximum number of messages to keep in the database log. Requires a <a href=\":cron\">cron maintenance task</a>.','','none'),(7209,'Pages which are suitable for caching are cached the first time they are requested, then the cached version is served for all later requests. Dynamic content is handled automatically so that both cache correctness and hit ratio is maintained.','','none'),(7210,'Internal Dynamic Page Cache','','none'),(7211,'Caches pages for any user, handling dynamic content correctly.','','none'),(7212,'The Text Editor module provides a framework that other modules (such as <a href=\":ckeditor\">CKEditor module</a>) can use to provide toolbars and other functionality that allow users to format text more easily than typing HTML tags directly. For more information, see the <a href=\":documentation\">online documentation for the Text Editor module</a>.','','none'),(7213,'The Text Editor module provides a framework for managing editors. To use it, you also need to enable a text editor. This can either be the core <a href=\":ckeditor\">CKEditor module</a>, which can be enabled on the <a href=\":extend\">Extend page</a>, or a contributed module for any other text editor. When installing a contributed text editor module, be sure to check the installation instructions, because you will most likely need to download and install an external library as well as the Drupal module.','','none'),(7214,'The <em>settings</em> and the <em>display</em> of the entity reference field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(7215,'No eligible views were found. <a href=\":create\">Create a view</a> with an <em>Entity Reference</em> display, or add such a display to an <a href=\":existing\">existing view</a>.','','none'),(7216,'The Field module allows custom data fields to be defined for <em>entity</em> types (see below). The Field module takes care of storing, loading, editing, and rendering field data. Most users will not interact with the Field module directly, but will instead use the <a href=\":field-ui-help\">Field UI module</a> user interface. Module developers can use the Field API to make new entity types \"fieldable\" and thus allow fields to be attached to them. For more information, see the <a href=\":field\">online documentation for the Field module</a>.','','none'),(7217,'The Field module provides the infrastructure for fields; the field types, formatters, and widgets are provided by Drupal core or additional modules. Some of the modules are required; the optional modules can be enabled from the <a href=\":modules\">Extend administration page</a>. Additional fields, formatters, and widgets may be provided by contributed modules, which you can find in the <a href=\":contrib\">contributed module section of Drupal.org</a>.','','none'),(7218,'The Field UI module provides an administrative user interface (UI) for managing and displaying fields. Fields can be attached to most content entity sub-types. Different field types, widgets, and formatters are provided by the modules enabled on your site, and managed by the Field module. For background information and terminology related to fields and entities, see the <a href=\":field\">Field module help page</a>. For more information about the Field UI, see the <a href=\":field_ui_docs\">online documentation for the Field UI module</a>.','','none'),(7219,'You can add, edit, and delete view modes for entities on the <a href=\":view_modes\">View modes page</a>, and you can add, edit, and delete form modes for entities on the <a href=\":form_modes\">Form modes page</a>. Once you have defined a view mode or form mode for an entity type, it will be available on the Manage display or Manage form display page for each sub-type of that entity.','','none'),(7220,'There are two reports available that list the fields defined on your site. The <a href=\":entity-list\" title=\"Entities field list report\">Entities</a> report lists all your fields, showing the field machine names, types, and the entity types or sub-types they are used on (each sub-type links to the Manage fields page). If the <a href=\":views\">Views</a> and <a href=\":views-ui\">Views UI</a> modules are enabled, the <a href=\":views-list\" title=\"Used in views field list report\">Used in views</a> report lists each field that is used in a view, with a link to edit that view.','','none'),(7221,'There are no fields yet added. You can add new fields on the <a href=\":link\">Manage fields</a> page.','','none'),(7222,'The %display_mode mode now uses custom display settings. You might want to <a href=\":url\">configure them</a>.','','none'),(7223,'@size limit.','','9.1.3'),(7224,'file from @field_name','','none'),(7225,'The File module allows you to create fields that contain files. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":file_documentation\">online documentation for the File module</a>.','','none'),(7226,'The <em>settings</em> and the <em>display</em> of the file field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(7227,'Uploaded files can either be stored as <em>public</em> or <em>private</em>, depending on the <a href=\":file-system\">File system settings</a>. For more information, see the <a href=\":system-help\">System module help page</a>.','','none'),(7228,'Files in the @name field were unable to be uploaded.','','none'),(7229,'The file used in the @name field may not be referenced.','','none'),(7230,'The file referenced by the @name field does not exist.','','none'),(7231,'You can create and edit text formats on the <a href=\":formats\">Text formats page</a> (if the Text Editor module is enabled, this page is named Text formats and editors). One text format is included by default: Plain text (which removes all HTML tags). Additional text formats may be created during installation. You can create a text format by clicking \"<a href=\":add_format\">Add text format</a>\".','','none'),(7232,'Use the <a href=\":url\">@label</a> text format','','none'),(7233,'For more information see W3C\'s <a href=\":html-specifications\">HTML Specifications</a> or use your favorite search engine to find other sites that explain HTML.','','none'),(7234,'If you do encounter problems, try using HTML character entities. A common example looks like &amp;amp; for an ampersand &amp; character. For a full list of entities see HTML\'s <a href=\":html-entities\">entities</a> page. Some of the available characters include:','','none'),(7235,'Limit allowed HTML tags and correct faulty HTML','','none'),(7236,'The Forum module adds and uses a content type called <em>Forum topic</em>. For background information on content types, see the <a href=\":node_help\">Node module help page</a>.','','none'),(7237,'For more information, see the <a href=\":forum\">online documentation for the Forum module</a>.','','none'),(7238,'Visit the <a href=\":forums\">Forums page</a> to set up containers and forums to hold your discussion topics.','','none'),(7239,'The <a href=\":create-topic\">Forum topic</a> link on the <a href=\":content-add\">Add content</a> page creates the first post of a new threaded discussion, or thread.','','none'),(7240,'Enabling the Forum module provides a default <em>Forums</em> menu item in the Tools menu that links to the <a href=\":forums\">Forums page</a>.','','none'),(7241,'Adjust the display of your forum topics. Organize the forums on the <a href=\":forum-structure\">forum structure page</a>.','','none'),(7242,'To uninstall Forum, first delete all <a href=\":url\">%vocabulary</a> terms','','none'),(7243,'No containers or forums available. <a href=\":container\">Add container</a> or <a href=\":forum\">Add forum</a>.','','none'),(7244,'<a href=\":hal_spec\">Hypertext Application Language (HAL)</a> is a format that supports the linking required for hypermedia APIs.','','none'),(7245,'This module adds support for serializing entities (such as content items, taxonomy terms, etc.) to the JSON version of HAL. For more information, see the <a href=\":hal_do\">online documentation for the HAL module</a>.','','none'),(7246,'<strong>Configure your website</strong> Once logged in, visit the <a href=\":admin\">Administration page</a>, where you may <a href=\":config\">customize and configure</a> all aspects of your website.','','none'),(7247,'<strong>Enable additional functionality</strong> Next, visit the <a href=\":modules\">Extend page</a> and enable modules that suit your specific needs. You can find additional modules at the <a href=\":download_modules\">Drupal.org modules page</a>.','','none'),(7248,'<strong>Customize your website design</strong> To change the \"look and feel\" of your website, visit the <a href=\":themes\">Appearance page</a>. You may choose from one of the included themes or download additional themes from the <a href=\":download_themes\">Drupal.org themes page</a>.','','none'),(7249,'<strong>Start posting content</strong> Finally, you may <a href=\":content\">add new content</a> to your website.','','none'),(7250,'The Help module generates <a href=\":help-page\">Help reference pages</a> to guide you through the use and configuration of modules, and provides a Help block with page-level help. The reference pages are a starting point for <a href=\":handbook\">Drupal.org online documentation</a> pages that contain more extensive and up-to-date information, are annotated with user-contributed comments, and serve as the definitive reference point for all Drupal documentation. For more information, see the <a href=\":help\">online documentation for the Help module</a>.','','none'),(7251,'The Help module displays explanations for using each module listed on the main <a href=\":help\">Help reference page</a>.','','none'),(7252,'Page-specific help text provided by modules is displayed in the Help block. This block can be placed and configured on the <a href=\":blocks\">Block layout page</a>.','','none'),(7253,'The History module keeps track of which content a user has read. It marks content as <em>new</em> or <em>updated</em> depending on the last time the user viewed it. History records that are older than one month are removed during cron, which means that content older than one month is always considered <em>read</em>. The History module does not have a user interface but it provides a filter to <a href=\":views-help\">Views</a> to show new or updated content. For more information, see the <a href=\":url\">online documentation for the History module</a>.','','none'),(7254,'image from @field_name','','none'),(7255,'The Image module allows you to create fields that contain image files and to configure <a href=\":image_styles\">Image styles</a> that can be used to manipulate the display of images. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for terminology and general information on entities, fields, and how to create and manage fields. For more information, see the <a href=\":image_documentation\">online documentation for the Image module</a>.','','none'),(7256,'The concept of image styles is that you can upload a single image but display it in several ways; each display variation, or <em>image style</em>, is the result of applying one or more <em>effects</em> to the original image. As an example, you might upload a high-resolution image with a 4:3 aspect ratio, and display it scaled down, square cropped, or black-and-white (or any combination of these effects). The Image module provides a way to do this efficiently: you configure an image style with the desired effects on the <a href=\":image\">Image styles page</a>, and the first time a particular image is requested in that style, the effects are applied. The resulting image is saved, and the next time that same style is requested, the saved image is retrieved without the need to recalculate the effects. Drupal core provides several effects that you can use to define styles; others may be provided by contributed modules.','','none'),(7257,'When you create an image field, you will need to choose whether the uploaded images will be stored in the public or private file directory defined in your settings.php file and shown on the <a href=\":file-system\">File system page</a>. This choice cannot be changed later. You can also configure your field to store files in a subdirectory of the public or private directory; this setting can be changed later and can be different for each entity sub-type using the field. For more information on file storage, see the <a href=\":system-help\">System module help page</a>.','','none'),(7258,'There are currently no styles. <a href=\":url\">Add a new one</a>.','','none'),(7259,'Both a height and width value must be specified in the @name field.','','none'),(7260,'The primary identifier for an image style.','','none'),(7261,'The style machine name.','','none'),(7262,'The style administrative name.','','none'),(7263,'You can add languages on the <a href=\":language_list\">Languages</a> page by selecting <em>Add language</em> and choosing a language from the drop-down menu. This language is then displayed in the languages list, where it can be configured further. If the <a href=\":interface\">Interface translation module</a> is enabled, and the <em>translation server</em> is set as a translation source, then the interface translation for this language is automatically downloaded as well.','','none'),(7264,'By default, content is created in the site\'s default language and no language selector is displayed on content creation pages. On the <a href=\":content_language\">Content language</a> page you can customize the language configuration for any supported content entity on your site (for example for content types or menu links). After choosing an entity, you are provided with a drop-down menu to set the default language and a check-box to display language selectors.','','none'),(7265,'If the Block module is enabled, then you can add a language switcher block on the <a href=\":blocks\">Block layout</a> page to allow users to switch between languages.','','none'),(7266,'If the Block module is enabled, then the Language module allows you to set the visibility of a block based on selected languages on the <a href=\":blocks\">Block layout</a> page.','','none'),(7267,'The <a href=\":detection\">Detection and selection</a> page provides several methods for deciding which language is used for displaying interface text. When a method detects and selects an interface language, then the following methods in the list are not applied. You can order them by importance, with your preferred method at the top of the list, followed by one or several fall-back methods.','','none'),(7268,'<em>Browser</em> sets the interface language based on the browser\'s language settings. Since browsers use different language codes to refer to the same languages, you can add and edit languages codes to map the browser language codes to the <a href=\":language_list\">language codes</a> used on your site.','','none'),(7269,'Reorder the configured languages to set their order in the language switcher block and, when editing content, in the list of selectable languages. This ordering does not impact <a href=\":detection\">detection and selection</a>.','','none'),(7270,'The site default language can also be set. It is not recommended to change the default language on a working site. <a href=\":language-detection\">Configure the Selected language</a> setting on the detection and selection page to change the fallback language for language selection.','','none'),(7271,'Define how to decide which language is used to display page elements (primarily text provided by modules, such as field labels and help text). This decision is made by evaluating a series of detection methods for languages; the first detection method that gets a result will determine which language is used for that type of text. Be aware that some language detection methods are unreliable under certain conditions, such as browser detection when page-caching is enabled and a user is not currently logged in. Define the order of evaluation of language detection methods on this page. The default language can be changed in the <a href=\":admin-change-language\">list of languages</a>.','','none'),(7272,'Browsers use different language codes to refer to the same languages. Internally, a best effort is made to determine the correct language based on the code that the browser sends. You can add and edit additional mappings from browser language codes to <a href=\":configure-languages\">site languages</a>.','','none'),(7273,'Changing the selected language here (and leaving this option as the last among the detection and selection options) is the easiest way to change the fallback language for the website, if you need to change how your site works by default (e.g., when using an empty path prefix or using the default domain). <a href=\":admin-change-language\">Changing the site\'s default language</a> itself might have other undesired side effects.','','none'),(7274,'Explanation of the language options is found on the <a href=\":languages_list_page\">languages list page</a>.','','none'),(7275,'Site\'s default language (@language)','','none'),(7276,'Use one of the language switcher blocks to allow site visitors to switch between languages. You can enable these blocks on the <a href=\":block-admin\">block administration page</a>.','','none'),(7277,'Use language codes as <a href=\":w3ctags\">defined by the W3C</a> for interoperability. <em>Examples: \"en\", \"en-gb\" and \"zh-hant\".</em>','','none'),(7278,'%field must be a valid language tag as <a href=\":url\">defined by the W3C</a>.','','none'),(7279,'The prefix may only be left blank for the <a href=\":url\">selected detection fallback language.</a>','','none'),(7280,'The Link module allows you to create fields that contain internal or external URLs and optional link text. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":link_documentation\">online documentation for the Link module</a>.','','none'),(7281,'The <em>settings</em> and the <em>display</em> of the link field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(7282,'One translation file could not be checked. <a href=\":url\">See the log</a> for details.@count translation files could not be checked. <a href=\":url\">See the log</a> for details.','','none'),(7283,'@message (@percent%).','','none'),(7284,'One translation file could not be imported. <a href=\":url\">See the log</a> for details.@count translation files could not be imported. <a href=\":url\">See the log</a> for details.','','none'),(7285,'One translation string was skipped because of disallowed or malformed HTML. <a href=\":url\">See the log</a> for details.@count translation strings were skipped because of disallowed or malformed HTML. <a href=\":url\">See the log</a> for details.','','none'),(7286,'The Interface Translation module allows you to translate interface text (<em>strings</em>) into different languages, and to switch between them for the display of interface text. It uses the functionality provided by the <a href=\":language\">Language module</a>. For more information, see the <a href=\":doc-url\">online documentation for the Interface Translation module</a>.','','none'),(7287,'Translation files with translated interface text are imported automatically when languages are added on the <a href=\":languages\">Languages</a> page, or when modules or themes are enabled. On the <a href=\":locale-settings\">Interface translation settings</a> page, the <em>Translation source</em> can be restricted to local files only, or to include the <a href=\":server\">Drupal translation server</a>. Although modules and themes may not be fully translated in all languages, new translations become available frequently. You can specify whether and how often to check for translation file updates and whether to overwrite existing translations on the <a href=\":locale-settings\">Interface translation settings</a> page. You can also manually import a translation file on the <a href=\":import\">Interface translation import</a> page.','','none'),(7288,'You can check how much of the interface on your site is translated into which language on the <a href=\":languages\">Languages</a> page. On the <a href=\":translation-updates\">Available translation updates</a> page, you can check whether interface translation updates are available on the <a href=\":server\">Drupal translation server</a>.','','none'),(7289,'You can translate individual strings directly on the <a href=\":translate\">User interface translation</a> page, or download the currently-used translation file for a specific language on the <a href=\":export\">Interface translation export</a> page. Once you have edited the translation file, you can then import it again on the <a href=\":import\">Interface translation import</a> page.','','none'),(7290,'Interface translations are automatically imported when a language is added, or when new modules or themes are enabled. The report <a href=\":update\">Available translation updates</a> shows the status. Interface text can be customized in the <a href=\":translate\">user interface translation</a> page.','','none'),(7291,'This page allows a translator to search for specific translated and untranslated strings, and is used when creating or editing translations. (Note: Because translation tasks involve many strings, it may be more convenient to <a title=\"User interface translation export\" href=\":export\">export</a> strings for offline editing in a desktop Gettext translation editor.) Searches may be limited to strings in a specific language.','','none'),(7292,'Translation files are automatically downloaded and imported when <a title=\"Languages\" href=\":language\">languages</a> are added, or when modules or themes are enabled.','','none'),(7293,'This page allows translators to manually import translated strings contained in a Gettext Portable Object (.po) file. Manual import may be used for customized translations or for the translation of custom modules and themes. To customize translations you can download a translation file from the <a href=\":url\">Drupal translation server</a> or <a title=\"User interface translation export\" href=\":export\">export</a> translations from the site, customize the translations using a Gettext translation editor, and import the result using this page.','','none'),(7294,'Updates available for: @languages. See the <a href=\":updates\">Available translation updates</a> page for more information.','','none'),(7295,'Missing translations for: @languages. See the <a href=\":updates\">Available translation updates</a> page for more information.','','none'),(7296,'No translation status is available. See the <a href=\":updates\">Available translation updates</a> page for more information.','','none'),(7297,'Interface translation settings','','none'),(7298,'Interface translation import','','none'),(7299,'Interface translation export','','none'),(7300,'Select how frequently you want to check for new interface translations for your currently installed modules and themes. <a href=\":url\">Check updates now</a>.','','none'),(7301,'Translation files are stored locally in the  %path directory. You can change this directory on the <a href=\":url\">File system</a> configuration page.','','none'),(7302,'Translation files will not be stored locally. Change the Interface translation directory on the <a href=\":url\">File system configuration</a> page.','','none'),(7303,'You have selected local translation source, but no <a href=\":url\">Interface translation directory</a> was configured.','','none'),(7304,'No translatable languages available. <a href=\":add_language\">Add a language</a> first.','','none'),(7305,'No translation status available. <a href=\":check\">Check manually</a>.','','none'),(7306,'It is required by the Menu UI module, which provides an interface for managing menus and menu links. For more information, see the <a href=\":menu-help\">Menu UI module help page</a> and the <a href=\":drupal-org-help\">online documentation for the Custom Menu Links module</a>.','','none'),(7307,'For more information, see the <a href=\":drupal-org-help\">online documentation for the Custom Menu Links module</a>. If you enable the Menu UI module, it provides an interface for managing menus and menu links.','','none'),(7308,'The Menu UI module provides an interface for managing menus. A menu is a hierarchical collection of links, which can be within or external to the site, generally used for navigation. For more information, see the <a href=\":menu\">online documentation for the Menu UI module</a>.','','none'),(7309,'Users with the <em>Administer menus and menu items</em> permission can add, edit, and delete custom menus on the <a href=\":menu\">Menus page</a>. Custom menus can be special site menus, menus of external links, or any combination of internal and external links. You may create an unlimited number of additional menus, each of which will automatically have an associated block (if you have the <a href=\":block_help\">Block module</a> installed). By selecting <em>Edit menu</em>, you can add, edit, or delete links for a given menu. The links listing page provides a drag-and-drop interface for controlling the order of links, and creating a hierarchy within the menu.','','none'),(7310,'If you have the Block module enabled, then each menu that you create is rendered in a block that you enable and position on the <a href=\":blocks\">Block layout page</a>. In some <a href=\":themes\">themes</a>, the main menu and possibly the secondary menu will be output automatically; you may be able to disable this behavior on the <a href=\":themes\">theme\'s settings page</a>.','','none'),(7311,'You can enable the newly-created block for this menu on the <a href=\":blocks\">Block layout page</a>.','','none'),(7312,'Each menu has a corresponding block that is managed on the <a href=\":blocks\">Block layout page</a>.','','none'),(7313,'There are no menu links yet. <a href=\":url\">Add link</a>.','','none'),(7314,'The Migrate module provides a framework for migrating data, usually from an external source into your site. It does not provide a user interface. For more information, see the <a href=\":migrate\">online documentation for the Migrate module</a>.','','none'),(7315,'Invalid PHP memory_limit @limit, setting to unlimited.','','none'),(7316,'Migration failed with source plugin exception: @e','','none'),(7317,'Memory usage is @usage (@pct% of limit @limit), reclaiming memory.','','none'),(7318,'Memory usage is now @usage (@pct% of limit @limit), not enough reclaimed, starting new batch','','none'),(7319,'Memory usage is now @usage (@pct% of limit @limit), reclaimed enough, continuing','','none'),(7320,'The Migrate Drupal module provides a framework based on the <a href=\":migrate\">Migrate module</a> to facilitate migration from a Drupal (6, 7, or 8) site to your website. It does not provide a user interface. For more information, see the <a href=\":migrate_drupal\">online documentation for the Migrate Drupal module</a>.','','none'),(7321,'The content access permissions need to be rebuilt. <a href=\":node_access_rebuild\">Rebuild permissions</a>.','','none'),(7322,'The Node module manages the creation, editing, deletion, settings, and display of the main site content. Content items managed by the Node module are typically displayed as pages on your site, and include a title, some meta-data (author, creation time, content type, etc.), and optional fields containing text or other data (fields are managed by the <a href=\":field\">Field module</a>). For more information, see the <a href=\":node\">online documentation for the Node module</a>.','','none'),(7323,'When new content is created, the Node module records basic information about the content, including the author, date of creation, and the <a href=\":content-type\">Content type</a>. It also manages the <em>publishing options</em>, which define whether or not the content is published, promoted to the front page of the site, and/or sticky at the top of content lists. Default settings can be configured for each <a href=\":content-type\">type of content</a> on your site.','','none'),(7324,'The Node module gives users with the <em>Administer content types</em> permission the ability to <a href=\":content-new\">create new content types</a> in addition to the default ones already configured. Creating custom content types gives you the flexibility to add <a href=\":field\">fields</a> and configure default settings that suit the differing needs of various site content.','','none'),(7325,'The <a href=\":content\">Content</a> page lists your content, allowing you add new content, filter, edit or delete existing content, or perform bulk operations on existing content.','','none'),(7326,'The Node module makes a number of permissions available for each content type, which can be set by role on the <a href=\":permissions\">permissions page</a>.','','none'),(7327,'If the site is experiencing problems with permissions to content, you may have to rebuild the permissions cache. Rebuilding will remove all privileges to content and replace them with permissions based on the current modules and settings. Rebuilding may take some time if there is a lot of content or complex permission settings. After rebuilding has completed, content will automatically use the new permissions. <a href=\":rebuild\">Rebuild permissions</a>','','none'),(7328,'Maintain the types of content available and the fields that are associated with those types.','','none'),(7329,'This text will be displayed on the <em>Add new content</em> page.','','none'),(7330,'No content types available. <a href=\":link\">Add content type</a>.','','none'),(7331,'Node from URL','','none'),(7332,'The Options module allows you to create fields where data values are selected from a fixed list of options. Usually these items are entered through a select list, checkboxes, or radio buttons. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":options_do\">online documentation for the Options module</a>.','','none'),(7333,'The <em>settings</em> and the <em>display</em> of the list fields can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(7334,'The Internal Page Cache module caches pages for anonymous users in the database. For more information, see the <a href=\":pagecache-documentation\">online documentation for the Internal Page Cache module</a>.','','none'),(7335,'Pages are usually identical for all anonymous users, while they can be personalized for each authenticated user. This is why entire pages can be cached for anonymous users, whereas they will have to be rebuilt for every authenticated user.','','none'),(7336,'To speed up your site for authenticated users, see the <a href=\":dynamic_page_cache-help\">Dynamic Page Cache module</a>.','','none'),(7337,'On the <a href=\":cache-settings\">Performance page</a>, you can configure how long browsers and proxies may cache pages; that setting is also respected by the Internal Page Cache module. There is no other configuration.','','none'),(7338,'Caches pages for anonymous users. Use when an external page cache is not available.','','none'),(7339,'The Path module allows you to specify an alias, or custom URL, for any existing internal system path. Aliases should not be confused with URL redirects, which allow you to forward a changed or inactive URL to a new URL. In addition to making URLs more readable, aliases also help search engines index content more effectively. Multiple aliases may be used for a single internal system path. To automate the aliasing of paths, you can install the contributed module <a href=\":pathauto\">Pathauto</a>. For more information, see the <a href=\":path\">online documentation for the Path module</a>.','','none'),(7340,'If you create or edit a taxonomy term you can add an alias (for example <em>music/jazz</em>) in the field \"URL alias\". When creating or editing content you can add an alias (for example <em>about-us/team</em>) under the section \"URL path settings\" in the field \"URL alias\". Aliases for any other path can be added through the page <a href=\":aliases\">URL aliases</a>. To add aliases a user needs the permission <a href=\":permissions\">Create and edit URL aliases</a>.','','none'),(7341,'The Path module provides a way to search and view a <a href=\":aliases\">list of all aliases</a> that are in use on your website. Aliases can be added, edited and deleted through this list.','','none'),(7342,'No URL aliases available. <a href=\":link\">Add URL alias</a>.','','none'),(7343,'The internal system path.','','none'),(7344,'The path alias.','','none'),(7345,'The Quick Edit module allows users with the <a href=\":quickedit_permission\">Access in-place editing</a> and <a href=\":contextual_permission\">Use contextual links</a> permissions to edit field content without visiting a separate page. For more information, see the <a href=\":handbook_url\">online documentation for the Quick Edit module</a>.','','none'),(7346,'To edit content in place, you need to activate quick edit mode for a content item. Activate quick edit mode by choosing Quick edit from the contextual links for an area displaying the content (see the <a href=\":contextual\">Contextual Links module help</a> for more information about how to use contextual links).','','none'),(7347,'By creating responsive image styles you define which options the browser has in selecting which image file to display. In most cases this means providing different image sizes based on the viewport size. On the <a href=\":responsive_image_style\">Responsive image styles</a> page, click <em>Add responsive image style</em> to create a new style. First choose a label, a fallback image style and a breakpoint group and click Save.','','none'),(7348,'Below the Sizes field you can choose multiple image styles so the browser can choose the best image file size to fill the space defined in the Sizes field. Typically you will want to use image styles that resize your image to have options that range from the smallest px width possible for the space the image will appear in to the largest px width possible, with a variety of widths in between. You may want to provide image styles with widths that are 1.5x to 2x the space available in the layout to account for high resolution screens. Image styles can be defined on the <a href=\":image_styles\">Image styles page</a> that is provided by the <a href=\":image_help\">Image module</a>.','','none'),(7349,'After defining responsive image styles, you can use them in the display settings for your Image fields, so that the site displays responsive images using the HTML5 picture tag. Open the Manage display page for the entity type (content type, taxonomy vocabulary, etc.) that the Image field is attached to. Choose the format <em>Responsive image</em>, click the Edit icon, and select one of the responsive image styles that you have created. For general information on how to manage fields and their display see the <a href=\":field_ui\">Field UI module help page</a>. For background information about entities and fields see the <a href=\":field_help\">Field module help page</a>.','','none'),(7350,'Configure Responsive Image Styles','','none'),(7351,'The RESTful Web Services module provides a framework for exposing REST resources on your site. It provides support for content entities (see the <a href=\":field\">Field module help page</a> for more information about entities) such as content, users, taxonomy terms, etc.; REST support for content items of the Node module is enabled by default, and support for other types of content entities can be enabled. Other modules may add support for other types of REST resources. For more information, see the <a href=\":rest\">online documentation for the RESTful Web Services module</a>.','','none'),(7352,'In order to use REST on a web site, you need to install modules that provide serialization and authentication services. You can use the Core module <a href=\":hal\">HAL</a> for serialization and <a href=\":basic_auth\">HTTP Basic Authentication</a> for authentication, or install a contributed or custom module.','','none'),(7353,'REST support for content items of the Node module is enabled by default, and support for other types of content entities can be enabled. To enable support, you can use a <a href=\":config\">process based on configuration editing</a> or the contributed <a href=\":restui\">Rest UI module</a>.','','none'),(7354,'The Search module provides the ability to set up search pages based on plugins provided by other modules. In Drupal core, there are two page-type plugins: the Content page type provides keyword searching for content managed by the Node module, and the Users page type provides keyword searching for registered users. Contributed modules may provide other page-type plugins. For more information, see the <a href=\":search-module\">online documentation for the Search module</a>.','','none'),(7355,'To configure search pages, visit the <a href=\":search-settings\">Search pages page</a>. In the Search pages section, you can add a new search page, edit the configuration of existing search pages, enable and disable search pages, and choose the default search page. Each enabled search page has a URL path starting with <em>search</em>, and each will appear as a tab or local task link on the <a href=\":search-url\">search page</a>; you can configure the text that is shown in the tab. In addition, some search page plugins have additional settings that you can configure for each search page.','','none'),(7356,'Some search page plugins, such as the core Content search page, index searchable text using the Drupal core search index, and will not work unless content is indexed. Indexing is done during <em>cron</em> runs, so it requires a <a href=\":cron\">cron maintenance task</a> to be set up. There are also several settings affecting indexing that can be configured on the <a href=\":search-settings\">Search pages page</a>: the number of items to index per cron run, the minimum word length to index, and how to handle Chinese, Japanese, and Korean characters.','','none'),(7357,'… @excerpt … @excerpt …','','none'),(7358,'This module does not have a user interface. It is used by other modules which need to serialize data, such as <a href=\":rest\">REST</a>.','','none'),(7359,'The Shortcut module allows users to create sets of <em>shortcut</em> links to commonly-visited pages of the site. Shortcuts are contained within <em>sets</em>. Each user with <em>Select any shortcut set</em> permission can select a shortcut set created by anyone at the site. For more information, see the <a href=\":shortcut\">online documentation for the Shortcut module</a>.','','none'),(7360,'Users with the <em>Administer shortcuts</em> permission can manage shortcut sets and edit the shortcuts within sets from the <a href=\":shortcuts\">Shortcuts administration page</a>.','','none'),(7361,'Define which shortcut set you are using on the <a href=\":shortcut-link\">Shortcuts tab</a> of your account page.','','none'),(7362,'No shortcuts available. <a href=\":link\">Add a shortcut</a>','','none'),(7363,'The link for this shortcut.','','none'),(7364,'The title for this shortcut.','','none'),(7365,'The weight for this shortcut','','none'),(7366,'The title of the set.','','none'),(7367,'The users.uid for this set.','','none'),(7368,'The module includes a <em>Popular content</em> block that displays the most viewed pages today and for all time, and the last content viewed. To use the block, enable <em>Count content views</em> on the <a href=\":statistics-settings\">Statistics page</a>, and then you can enable and configure the block on the <a href=\":blocks\">Block layout page</a>.','','none'),(7369,'The Statistics module includes a counter for each page that increases whenever the page is viewed. To use the counter, enable <em>Count content views</em> on the <a href=\":statistics-settings\">Statistics page</a>, and set the necessary <a href=\":permissions\">permissions</a> (<em>View content hits</em>) so that the counter is visible to the users.','','none'),(7370,'Version: @module-version','','none'),(7371,'Requires: @module-list','','none'),(7372,'Required by: @module-list','','none'),(7373,'This theme requires PHP version @php_required and is incompatible with PHP version @php_version.','','none'),(7374,'Set and configure the default theme for your website.  Alternative <a href=\":themes\">themes</a> are available.','','none'),(7375,'You can place blocks for each theme on the <a href=\":blocks\">block layout</a> page.','','none'),(7376,'Download additional <a href=\":modules\">contributed modules</a> to extend your site\'s functionality.','','none'),(7377,'Configure your <a href=\":user-edit\">account time zone setting</a>.','','none'),(7378,'The minimum version of Apache needed to run Drupal without mod_rewrite enabled is 2.2.16. See the <a href=\":link\">enabling clean URLs</a> page for more information on mod_rewrite.','','none'),(7379,'Your server is capable of using clean URLs, but it is not enabled. Using clean URLs gives an improved user experience and is recommended. <a href=\":link\">Enable clean URLs</a>','','none'),(7380,'@phpversion (<a href=\":url\">more information</a>)','','none'),(7381,'Drupal requires you to enable the PHP extensions in the following list (see the <a href=\":system_requirements\">system requirements page</a> for more information):','','none'),(7382,'PHP OPcode caching','','none'),(7383,'For more information, see the online handbook entry for <a href=\":memory-limit\">increasing the PHP memory limit</a>.','','none'),(7384,'See <a href=\":url\">@url</a> for information about the recommended .htaccess file which should be added to the %directory directory to help protect against arbitrary code execution.','','none'),(7385,'Last run @time ago','','none'),(7386,'For more information, see the online handbook entry for <a href=\":cron-handbook\">configuring cron jobs</a>.','','none'),(7387,'You can <a href=\":cron\">run cron manually</a>.','','none'),(7388,'To run cron from outside the site, go to <a href=\":url\">@cron</a>','','none'),(7389,'You may need to set the correct directory at the <a href=\":admin-file-system\">file system settings page</a> or change the current directory\'s permissions so that it is writable.','','none'),(7390,'Some modules have database schema updates to install. You should run the <a href=\":update\">database update script</a> immediately.','','none'),(7391,'Update notifications are not enabled. It is <strong>highly recommended</strong> that you enable the Update Manager module from the <a href=\":module\">module administration page</a> in order to stay up-to-date on new releases. For more information, <a href=\":update\">Update status handbook page</a>.','','none'),(7392,'Block module is not enabled so site branding elements, which have been converted to a block, are not visible anymore.','','none'),(7393,'Because your site has custom theme(s) installed, we had to set the branding block into the content region. Please manually review the block configuration and remove the site name, slogan, and logo variables from your templates.','','none'),(7394,'Block module is not enabled. The page title has been converted to a block, but default page title markup will still display at the top of the main content area.','','none'),(7395,'Because your site has custom theme(s) installed, we have placed the page title block in the content region. Please manually review the block configuration and remove the page title variables from your page templates.','','none'),(7396,'Put your site into <a href=\":url\">maintenance mode</a>.','','none'),(7397,'All errors have been <a href=\":url\">logged</a>.','','none'),(7398,'Screenshot for @theme theme','','none'),(7399,'Settings for @theme theme','','none'),(7400,'Uninstall @theme theme','','none'),(7401,'Set @theme as default theme','','none'),(7402,'Install @theme theme','','none'),(7403,'Install @theme as default theme','','none'),(7404,'To run cron from outside the site, go to <a href=\":cron\">@cron</a>','','none'),(7405,'This version is not compatible with Drupal @core_version and should be replaced.','','none'),(7406,'This module requires PHP version @php_required and is incompatible with PHP version @php_version.','','none'),(7407,'Defined on the <a href=\":appearance\">Appearance Settings</a> or <a href=\":theme\">Theme Settings</a> page.','','none'),(7408,'Defined on the <a href=\":information\">Site Information</a> page.','','none'),(7409,'Powered by <a href=\":poweredby\">Drupal</a>','','none'),(7410,'Installation tasks','','none'),(7411,'The Taxonomy module allows users who have permission to create and edit content to categorize (tag) content of that type. Users who have the <em>Administer vocabularies and terms</em> <a href=\":permissions\" title=\"Taxonomy module permissions\">permission</a> can add <em>vocabularies</em> that contain a set of related <em>terms</em>. The terms in a vocabulary can either be pre-set by an administrator or built gradually as content is added and edited. Terms may be organized hierarchically if desired.','','none'),(7412,'For more information, see the <a href=\":taxonomy\">online documentation for the Taxonomy module</a>.','','none'),(7413,'No vocabularies available. <a href=\":link\">Add vocabulary</a>.','','none'),(7414,'Format of the term description.','','none'),(7415,'Module responsible for the vocabulary.','','none'),(7416,'The Telephone module allows you to create fields that contain telephone numbers. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":telephone_documentation\">online documentation for the Telephone module</a>.','','none'),(7417,'The <em>settings</em> and the <em>display</em> of the telephone field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(7418,'If you choose <em>Text (plain)</em> or <em>Text (plain, long)</em> you restrict the input to <em>Plain text</em> only. If you choose <em>Text (formatted)</em>, <em>Text (formatted, long)</em>, or <em>Text (formatted, long with summary)</em> you allow users to write formatted text. Which options are available to individual users depends on the settings on the <a href=\":formats\">Text formats and editors page</a>.','','none'),(7419,'Number of summary rows: @rows','','none'),(7420,'The Toolbar module provides a toolbar for site administrators, which displays tabs and trays provided by the Toolbar module itself and other modules. For more information, see the <a href=\":toolbar_docs\">online documentation for the Toolbar module</a>.','','none'),(7421,'The Tour module provides users with guided tours of the site interface. Each tour consists of several tips that highlight elements of the user interface, guide the user through a workflow, or explain key concepts of the website. For more information, see the <a href=\':tour\'>online documentation for the Tour module</a>.','','none'),(7422,'Tours can be written as YAML-documents with a text editor, or using the contributed <a href=\':tour_ui\'>Tour UI</a> module. For more information, see <a href=\':doc_url\'>the online documentation for writing tours</a>.','','none'),(7423,'@tour_item of @total','','none'),(7424,'Boolean indicating whether the node is published.','','none'),(7425,'The Unix timestamp when the node was most recently saved or commented on.','','none'),(7426,'The {users}.uid of the node author or commenter.','','none'),(7427,'The Unix timestamp when the user was most recently saved or commented on.','','none'),(7428,'Your server does not support updating modules and themes from this interface. Instead, update modules and themes by uploading the new versions directly to the server, as described in the <a href=\":handbook_url\">handbook</a>.','','none'),(7429,'Your server does not support installing modules and themes from this interface. Instead, install modules and themes by uploading them directly to the server, as described in the <a href=\":handbook_url\">handbook</a>.','','none'),(7430,'Uninstalled modules','','none'),(7431,'Uninstalled themes','','none'),(7432,'You can also install new modules and themes in the same fashion, through the <a href=\":install\">Install page</a>, or by clicking the <em>Install new module/theme</em> links at the top of the <a href=\":modules_page\">Extend page</a> and the <a href=\":themes_page\">Appearance page</a>. In this case, you are prompted to provide either the URL to the download, or to upload a packaged release file from your local computer.','','none'),(7433,'Regularly review and install <a href=\":updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\":update-php\">update script</a> each time a module is updated.','','none'),(7434,'Regularly review <a href=\":updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\":update-php\">update script</a> each time a module is updated.','','none'),(7435,'No update information available. <a href=\":run_cron\">Run cron</a> or <a href=\":check_manually\">check manually</a>.','','none'),(7436,'New release(s) available for @site_name','','none'),(7437,'Your site is currently configured to send these emails when any updates are available. To get notified only for security updates, @url.','','none'),(7438,'Your site is currently configured to send these emails only when security updates are available. To get notified for any available updates, @url.','','none'),(7439,'There was a problem checking <a href=\":update-report\">available updates</a> for Drupal.','','none'),(7440,'There was a problem checking <a href=\":update-report\">available updates</a> for your modules or themes.','','none'),(7441,'Automatic updating of Drupal core is not supported. See the <a href=\":upgrade-guide\">upgrade guide</a> for information on how to update Drupal core manually.','','none'),(7442,'See the <a href=\":available_updates\">available updates</a> page for more information and to install your missing updates.','','none'),(7443,'See the <a href=\":available_updates\">available updates</a> page for more information.','','none'),(7444,'Update Manager settings','','none'),(7445,'Check for updates of uninstalled modules and themes','','none'),(7446,'You can choose to send email only if a security update is available, or to be notified about all newer versions. If there are updates available of Drupal core or any of your installed modules and themes, your site will always print a message on the <a href=\":status_report\">status report</a> page, and will also display an error message on administration pages if there is a security update.','','none'),(7447,'You can find <a href=\":module_url\">modules</a> and <a href=\":theme_url\">themes</a> on <a href=\":drupal_org_url\">drupal.org</a>. The following file extensions are supported: %extensions.','','none'),(7448,'Back up your database and site before you continue. <a href=\":backup_url\">Learn how</a>.','','none'),(7449,'Deprecated: User Name','','none'),(7450,'Deprecated: Use account-name or display-name instead.','','none'),(7451,'The display name of the user account.','','none'),(7452,'Through the <a href=\":people\">People administration page</a> you can add and cancel user accounts and assign users to roles. By editing one particular user you can change their username, email address, password, and information in other fields.','','none'),(7453,'<em>Roles</em> are used to group and classify users; each user can be assigned one or more roles. Typically there are two pre-defined roles: <em>Anonymous user</em> (users that are not logged in), and <em>Authenticated user</em> (users that are registered and logged in). Depending on how your site was set up, an <em>Administrator</em> role may also be available: users with this role will automatically be assigned any new permissions whenever a module is enabled. You can create additional roles on the <a href=\":roles\">Roles administration page</a>.','','none'),(7454,'After creating roles, you can set permissions for each role on the <a href=\":permissions_user\">Permissions page</a>. Granting a permission allows users who have been assigned a particular role to perform an action on the site, such as viewing content, editing or creating  a particular type of content, administering settings for a particular module, or using a particular function of the site (such as search).','','none'),(7455,'The <a href=\":accounts\">Account settings page</a> allows you to manage settings for the displayed name of the Anonymous user role, personal contact forms, user registration settings, and account cancellation settings. On this page you can also manage settings for account personalization, and adapt the text for the email messages that users receive when they register or request a password recovery. You may also set which role is automatically assigned new permissions whenever a module is enabled (the Administrator role).','','none'),(7456,'Permissions let you control what users can do and see on your site. You can define a specific set of permissions for each role. (See the <a href=\":role\">Roles</a> page to create a role.) Any permissions granted to the Authenticated user role will be given to any user who is logged in to your site. From the <a href=\":settings\">Account settings</a> page, you can make any role into an Administrator role for the site, meaning that role will be granted all new permissions automatically. You should be careful to ensure that only trusted users are given this access and level of control of your site.','','none'),(7457,'Make it at least 12 characters','','9.1.3'),(7458,'Configure site-wide settings and behavior for user accounts and registration. This includes account cancellation methods, the content of user emails and fields attached to users.','','none'),(7459,'Manage all user accounts. This includes editing all user information, changes of email addresses and passwords, issuing emails to users and blocking and deleting user accounts.','','none'),(7460,'Required if you want to change the %mail or %pass below. <a href=\":request_new_url\" title=\"Send password reset instructions via email.\">Reset your password</a>.','','none'),(7461,'Users with the %select-cancel-method or %administer-users <a href=\":permissions-url\">permissions</a> can override this default method.','','none'),(7462,'Available variables are: [site:name], [site:url], [user:display-name], [user:account-name], [user:mail], [site:login-url], [site:url-brief], [user:edit-url], [user:one-time-login-url], [user:cancel-url].','','none'),(7463,'Created a new user account for <a href=\":url\">%name</a>. No email has been sent.','','none'),(7464,'The new user <a href=\":url\">%name</a> was created without an email address, so no welcome message was sent.','','none'),(7465,'A welcome message with further instructions has been emailed to the new user <a href=\":url\">%name</a>.','','none'),(7466,'Password reset instructions will be sent to your registered email address.','','none'),(7467,'Send password reset instructions via email.','','none'),(7468,'Also known as:','','9.1.3'),(7469,'@label (@name:@column)','','9.1.3'),(7470,'@label:@column','','none'),(7471,'@label (@name:delta)','','none'),(74