ding a server response. For more information, see the <a href=\":automated_cron-documentation\">online documentation for the Automated Cron module</a>.','','none'),(7520,'Configuring Automated Cron','','none'),(7521,'On the <a href=\":cron-settings\">Cron page</a>, you can set the frequency (time interval) for running cron jobs.','','none'),(7522,'Disabling Automated Cron','','none'),(7523,'To disable automated cron, the recommended method is to uninstall the module, to reduce site overhead. If you only want to disable it temporarily, you can set the frequency to Never on the Cron page, and then change the frequency back when you want to start it up again.','','none'),(7524,'Automated Cron','','none'),(7525,'Provides an automated way to run cron jobs, by executing them at the end of a server response.','','none'),(7526,'Automated cron settings','','none'),(7527,'Ban visits from specific IP addresses.','','none'),(7528,'You can place a new block in a region by selecting <em>Place block</em> on the <a href=\":blocks\">Block layout page</a>. Once a block is placed, it can be moved to a different region by drag-and-drop or by using the <em>Region</em> drop-down list, and then clicking <em>Save blocks</em>.','','none'),(7529,'Block placement is specific to each theme on your site. Changes will not be saved until you click <em>Save blocks</em> at the bottom of the page.','','none'),(7530,'Adding comment types','','none'),(7531,'Additional <em>comment types</em> can be created per entity sub-type and added on the <a href=\":field\">Comment types page</a>. If there are multiple comment types available you can select the appropriate one after adding a <em>Comments field</em>.','','none'),(7532,'Compare the configuration uploaded to your sync directory with the active configuration before completing the import.','','none'),(7533,'Upload a full site configuration archive to the sync directory. It can then be compared and imported on the Synchronize page.','','none'),(7534,'The Database Logging module logs system events in the Drupal database. Monitor your site or debug site problems on this page.','','none'),(7535,'The Internal Dynamic Page Cache module caches pages for all users in the database, handling dynamic content correctly. For more information, see the <a href=\":dynamic_page_cache-documentation\">online documentation for the Internal Dynamic Page Cache module</a>.','','none'),(7536,'The module requires no configuration. Every part of the page contains metadata that allows Internal Dynamic Page Cache to figure this out on its own.','','none'),(7537,'Deprecated. All the functionality has been moved to Core.','','none'),(7538,'All field storage configuration objects re-saved.','','none'),(7539,'Selection handler for entity reference fields have been adjusted.','','none'),(7540,'<strong>Entity Reference</strong> fields allow you to create fields that contain links to other entities (such as content items, taxonomy terms, etc.) within the site. This allows you, for example, to include a link to a user within a content item. For more information, see <a href=\":er_do\">the online documentation for the Entity Reference module</a>.','','none'),(7541,'Enable custom storage','','none'),(7542,'An instance-specific widget type','','none'),(7543,'Widget types @types are used in Drupal 6 field instances: widget type @selected_type applied to the Drupal 8 base field','','none'),(7544,'The Filter module allows administrators to configure text formats. Text formats change how HTML tags and other text will be <em>processed and displayed</em> in the site. They are used to transform text, and also help to defend your web site against potentially damaging input from malicious users. Visual text editors can be associated with text formats by using the <a href=\":editor_help\">Text Editor module</a>. For more information, see the <a href=\":filter_do\">online documentation for the Filter module</a>.','','none'),(7545,'You can define which users will be able to use each text format by selecting roles. To ensure security, anonymous and untrusted users should only have access to text formats that restrict them to either plain text or a safe set of HTML tags. This is because HTML tags can allow embedding malicious links or scripts in text. More trusted registered users may be granted permission to use less restrictive text formats in order to create rich text. <strong>Improper text format configuration is a security risk.</strong>','','none'),(7546,'Each text format uses filters that add, remove, or transform elements within user-entered text. For example, one filter removes unapproved HTML tags, while another transforms URLs into clickable links. Filters are applied in a specific order. They do not change the <em>stored</em> content: they define how it is processed and displayed.','','none'),(7547,'Text formats define how text is filtered for output and how HTML tags and other text is displayed, replaced, or removed. <strong>Improper text format configuration is a security risk.</strong> Learn more on the <a href=\":filter_help\">Filter module help page</a>.','','none'),(7548,'A text format contains filters that change the display of user input; for example, stripping out malicious HTML or making URLs clickable. Filters are executed from top to bottom and the order is important, since one filter may prevent another filter from doing its job. For example, when URLs are converted into links before disallowed HTML tags are removed, all links may be removed. When this happens, the order of filters may need to be rearranged.','','none'),(7549,'Configure how content is filtered when displayed, including which HTML tags are rendered, and enable module-provided filters.','','none'),(7550,'A list of HTML tags that can be used. By default only the <em>lang</em> and <em>dir</em> attributes are allowed for all HTML tags. Each HTML tag may have attributes which are treated as allowed attribute names for that HTML tag. Each attribute may allow all values, or only allow specific values. Attribute names or values may be written as a prefix and wildcard like <em>jump-*</em>. JavaScript event attributes, JavaScript URLs, and CSS are always stripped.','','none'),(7551,'The Inline Form Errors module provides an experimental approach to form errors, placing the error messages next to the elements themselves. For more information, see the <a href=\":inline_form_error\">online documentation for the Inline Form Errors module</a>.','','none'),(7552,'Configure languages for content, interface, and configuration.','','9.1.3'),(7553,'Overriding default English strings','','none'),(7554,'If translation is enabled for English, you can <em>override</em> the default English interface text strings in your site with other English text strings on the <a href=\":translate\">User interface translation</a> page. Translation is off by default for English, but you can turn it on by visiting the <em>Edit language</em> page for <em>English</em> from the <a href=\":languages\">Languages</a> page.','','none'),(7555,'Configure the import of translation files, and add or customize interface translations.','','9.1.3'),(7556,'Manage menus and menu links.','','9.1.3'),(7557,'<q>Log in</q> for anonymous users','','none'),(7558,'Revert to earlier revision of a translation','','none'),(7559,'@langname revisions for %title','','none'),(7560,'Are you sure you want to revert @language translation to the revision from %revision-date?','','none'),(7561,'Revert content shared among translations','','none'),(7562,'Add custom URLs to existing paths.','','9.1.3'),(7563,'Network problem!','','none'),(7564,'- None (original image) -','','none'),(7565,'Checking site status','','none'),(7566,'Enable the <em>Automated Cron</em> module to allow cron execution at the end of a server response.','','none'),(7567,'Public file base URL','','none'),(7568,'The base URL that will be used for public file URLs. This can be changed in settings.php',''