ld.','nl',0),(5406,'Bestanden en beschrijvingen weergeven','nl',0),(5407,'In de veldinstellingen kan ingesteld worden of de gebruiker per bestand mag bepalen of het weergegeven wordt of niet. In de weergaveinstellingen, kan vervolgens gekozen worden voor een van de volgende weergaven: <ul><li><em>Generiek bestand</em> toont een link naar het bestand en voegt een bestandsicoon toe op basis van de bestandsextensie. Als <em>beschrijvingen</em> ingeschakeld en ingevuld zijn, dan wordt de beschrijving weergegeven in plaats van de bestandsnaam.</li><li><em>URL naar bestand</em> geeft het volledige pad naar het bestand weer als platte tekst.</li><li><em>Tabel met bestanden</em> geeft een link naar het bestand en de bestandsgrootte in een tabel weer.</li><li><em>RSS bijlage</em> toont alleen het eerste bestand, in een RSS feed, opgemaakt volgens de RSS 2.0 syntax voor bijlagen.</li></ul> Een bestand kan altijd direct benaderd worden via zijn URI ook al wordt het niet weergegeven.','nl',0),(5408,'Vlag die bepaalt of dit bestand weergegeven wordt bij het bekijken van inhoud.','nl',0),(5409,'Het log-item waar de wijzigingen in deze revisie worden uitgelegd.','nl',0),(5410,'Tenminste een authenticatie-provider moet worden gedefinieerd voor resource @id','nl',0),(5411,'Tenminste een indeling moet worden gedefinieerd voor resource @id','nl',0),(5412,'De snelkoppeling-ID.','nl',0),(5413,'De UUID van de snelkoppeling','nl',0),(5414,'De bundel van snelkoppeling','nl',0),(5415,'Het gewicht van een snelkoppeling binnen de groep snelkoppelingen.','nl',0),(5416,'De taalcode van de snelkoppeling.','nl',0),(5417,'Snelkoppelingslink','nl',0),(5418,'Toegangsrechten opnieuw opbouwen','nl',0),(5419,'Taxonomie term-ID','nl',0),(5420,'Taxonomietermnaam','nl',0),(5421,'Terug naar site-inhoud','nl',0),(5422,'Voorkeurtaalcode van de beheerder','nl',0),(5423,'De voorkeurstaal van de gebruiker voor het ontvangen van e-mails en het bekijken van de website.','nl',0),(5424,'Taalcode-voorkeur','nl',0),(