even','nl',0),(5477,'Tekstopmaak en editors gebruiken','nl',0),(5478,'Links','nl',0),(5479,'Gecentreerd','nl',0),(5480,'Rechts','nl',0),(5481,'%name: mag niet langer zijn dan @max tekens.','nl',0),(5482,'<abbr title=\"Outline Processor Markup Language\">OPML</abbr>-integratie','nl',0),(5483,'Een breakpoint verdeelt de hoogte of breedte van viewports (schermen, printers en andere media) in stappen. Bijvoorbeeld, een breedte-breakpoint van 40em zorgt voor twee stappen: een voor breedte tot 40em en een voor breedte vanaf 40em. Breakpoints kunnen worden gebruikt om de layout aan te passen, om afbeeldingen te schalen en voor andere aanpassingen die verband houden met verandering in hoogte en breedte van de viewport.','nl',0),(5484,'Resolutievermenigvuldiger','nl',0),(5485,'De resolutievermenigvuldigers zijn een maat voor de viewport-resolutie van het apparaat, gedefinieerd als de verhouding tussen de fysieke pixel-afmeting van het apparaat en de <a href=\"http://en.wikipedia.org/wiki/Device_independent_pixel\">apparaat-onafhankelijke pixel</a>-afmeting. De Breakpoint-module definieert vermenigvuldigers van 1, 1.5 en 2. Bij het definiëren van breakpoints kunnen modules en thema\'s bepalen welke vermenigvuldigers voor ieder breakpoint van toepassing zijn.','nl',0),(5486,'Breekpunten en breekpuntgroepen definiëren','nl',0),(5487,'Modules en thema\'s kunnen gebruik maken van de API die is meegeleverd bij de Breakpoint-module om breakpoints en breakpoint-groepen te definiëren en om resolutie-vermenigvuldigers aan breakpoints toe te wijzen.','nl',0),(5488,'Reactie-auteurnaam','nl',0),(5489,'Wijzigen van de tekstopmaak naar %text_format zal inhoud die niet toegestaan is in die opmaak permanent verwijderen.<br><br>Sla uw wijzigingen op voordat u de tekstopmaak omschakelt, om gegevensverlies te voorkomen.','nl',0),(5490,'Tekstopmaak aanpassen?','nl',0),(5491,'Weergeven entiteit','nl',0),(5492,'Beheer en weergave van entiteitreferentie-velden','nl',0),(5493,'Referentietype selecteren','nl',0),(5494,'In de veldinstellingen kan het entiteitstype geselecteerd worden waarnaar een referentie gemaakt wordt.','nl',0),(5495,'Referentievelden filteren en sorteren','nl',0),(5496,'Afhankelijk van het gekozen entiteitstype zijn er meer filter- en sorteeropties beschikbaar in de veldinstellingen voor de lijst met entiteiten. De lijst met gebruikers kan bijvoorbeeld gefilterd worden op rol, en gesorteerd op naam of ID.','nl',0),(5497,'Een referentie weergeven','nl',0),(5498,'Een entiteitsverwijzing kan weergegeven worden als een eenvoudig label, met of zonder link naar de entiteit. Maar een entiteit kan ook weergegeven worden als teaser (of een andere weergavemodus van de entiteit).','nl',0),(5499,'Tekstopmaak beheren','nl',0),(5500,'Rollen toekennen aan tekstopmaken','nl',0),(5501,'Filters selecteren','nl',0),(5502,'Ieder filter kan extra configuratie-opties hebben. Bijvoorbeeld, voor het filter \"Toegestane HTML-elementen beperken\" moet u de lijst HTML-tags definiëren die behouden moeten blijven.','nl',0),(5503,'Tijdens het aanmaken of bewerken van een veld met tekstopmaak kunnen gebruikers de tekstopmaak selecteren in de keuzelijst onder het veld.','nl',0),(5504,'Importeergedrag','nl',0),(5505,'De trefwoorden waarnaar u wilt zoeken.','nl',0),(5506,'Lijstvelden beheren en weergeven','nl',0),(5507,'Sleutels en labels van de opties instellen','nl',0),(5508,'Bij het instellen van de opties kan voor elke optie in de lijst een waarde en een label worden opgegeven. Het label wordt getoond aan de gebruikers, terwijl de waarde opgeslagen wordt in de database.','nl',0),(5509,'Lijstveldtype kiezen','nl',0),(5510,'Er zijn drie types lijstvelden, die verschillende datatypes opslaan: <em>zwevendekommagetal</em>, <em>geheel getal </em> of <em>tekst</em>. Het type <em>zwevendekommagetal</em> is geschikt om decimale getallen op te slaan. Het type <em>geheel getal</em> dient om afgeronde getallen op te slaan zoals jaartallen (bijvoorbeeld 2012) of waardes (bijvoorbeeld