0),(6580,'Weer te gegeven aantal \'best bekeken per dag\'','nl',0),(6581,'Publicatiestatus','nl',0),(6582,'Of de inhoud van een term gepubliceerd is.','nl',0),(6583,'Belangrijke upgradewaarschuwing','nl',0),(6584,'Deze update is een major versie-update wat inhoudt dat deze mogelijk niet achterwaarts compatibel is met uw huidige versie. Het is aanbevolen dat u de opmerkingen bij de uitgifte leest en vervolgt op eigen risico.','nl',0),(6585,'Alleen gebruikers met de geselecteerde toegangsrechten hebben toegang tot deze weergave.','nl',0),(6586,'Alleen de geselecteerde rollen hebben toegang tot deze weergave.','nl',0),(6587,'De opgemaakte tekst van het gebied','nl',0),(6588,'Het corresponderende entiteitveld','nl',0),(6589,'De plugin-ID','nl',0),(6590,'Rij-opties','nl',0),(6591,'Weergave uitbreider-instellingen','nl',0),(6592,'Blok weergeven','nl',0),(6593,'Weergaveinstellingen voor gehele getallen','nl',0),(6594,'Statische menulink-overschrijving','nl',0),(6595,'Er bestaan al entiteiten van het type %entity_type en %bundle_label %bundle. Deze dienen verwijderd te worden voor het importeren.','nl',0),(6596,'Feed-titel','nl',0),(6597,'Er bestaat al een feed met de naam %value. Voer een unike titel in.','nl',0),(6598,'Feed-URL','nl',0),(6599,'Er bestaat al een feed met deze URL %value. Voer een unieke URL in.','nl',0),(6600,'Uitgeschakeld','nl',0),(6601,'De taalcode van de taal waarin de reactie geschreven is.','nl',0),(6602,'De taalcode van het bericht.','nl',0),(6603,'De brontaal van deze vertaling.','nl',0),(6604,'Vertaling is achterhaald','nl',0),(6605,'Auteur van vertaling','nl',0),(6606,'De auteur van deze vertaling.','nl',0),(6607,'Een binaire waarde die aangeeft of de vertaling zichtbaar is voor niet-vertalers.','nl',0),(6608,'Tijd waarop vertaling is aangemaakt','nl',0),(6609,'Het Unix-tijdstip waarop de vertaling is aangemaakt.','nl',0),(6610,'Tijdstip waarop vertaling is veranderd','nl',0),(6611,'Het Unix-tijdstip waarop de vertaling voor het laatst is opgeslagen.','nl',0),(6612,'Alternatieve tekst is verplicht.<br>(Dit zou sporadisch leeg gelaten mogen worden. Om een lege alternatieve tekst te maken, type <code>\"\"</code> — twee dubbele aanhalingstekens zonder inhoud).','nl',0),(6613,'Entiteiten en entiteitstypes','nl',0),(6614,'Entiteit sub-types','nl',0),(6615,'Sommige entiteitstypes zijn gegroepeerd in subtypes (bijvoorbeeld een artikel- en paginatype in de Inhoudstypen, en label- en categoriewoordenlijsten in het Taxonomie-entiteitstype); andere entiteitstypes, zoals gebruikersaccounts, hebben geen subtypes. Programmeurs gebruiken de term <em>bundel</em> voor entiteitsubtypes.','nl',0),(6616,'Velden en veldtypes','nl',0),(6617,'Inhoudsentiteitstypes en subtypes slaan de meeste teksten, bestanden en andere gegevens op in <em>velden</em>. Velden worden gegroepeerd op <em>veldtype</em>. Het veldtype bepaalt wat voor data opgeslagen wordt in het veld, zoals tekst, afbeeldingen of taxonomieverwijzingen.','nl',0),(6618,'Formatters en weergavemodi','nl',0),(6619,'Inhoudsentiteitstypes en subtypes hebben één of meer <em>weergavemodi</em> om de entiteitsitems weer te geven. Een inhoudsitem kan bijvoorbeeld bekeken worden in volledige inhoudsmodus op zijn eigen pagina, teasermodus in een lijst of RSS-modus in een feed. In elke weergavemodus kan elk veld getoond of verborgen worden, en als het getoond wordt kan aangegeven worden welk <em>opmaakhulpmiddel</em> gebruikt wordt. Een langetekstveld kan bijvoorbeeld volledig of ingekort weergegeven worden, en taxonomieterm-verwijzingsvelden kunnen als platte tekst of als link naar de taxonomieterm-pagina weergegeven worden.','nl',0),(6620,'Widget- en formuliermodi','nl',0),(6621,'Inhoudsentiteitstypes en subtypes hebben één of meer <em>formuliermodi</em>, voor bewerken van inhoud. Een inhoudsitem kan bijvoorbeeld bewerkt worden in volledige modus met alle velden bewerkbaar, of in een compacte vorm met slechts enkel bewerkbare velden. In elke formuliermodus kan elk veld getoond of verborgen worden, en als het getoond wordt kan aangegeven worden welke <em>widget</em> gebruikt wordt om het veld te bewerken. Een taxonomieterm-verwijzingsveld kan bijvoorbeeld als een selectielijst, radioknoppen of een automatisch-aanvullenveld bewerkt worden.','nl',0),(6622,'Veldtypes, widgets en opmaakhulpmiddelen inschakelen','nl',0),(6623,'Entiteitveld-handler voor overzicht','nl',0),(6624,'Een veld aanmaken','nl',0),(6625,'Op de <em>Velden beheren</em>-pagina van uw entiteitstype of subtype kunt u velden toevoegen, instellen en verwijderen. Elk veld heeft een <em>systeemnaam</em>, die intern gebruikt wordt om het veld te identificeren, en die uniek moet zijn binnen dat entiteitstype. De systeemnaam kan niet meer gewijzigd worden als een veld eenmaal aangemaakt is. De meeste velden hebben twee soorten instellingen. De instellingen op veldniveau zijn afhankelijk van het veldtype, en beïnvloeden de manier waarop data opgeslagen wordt. Ze kunnen niet meer gewijzigd worden als ze eenmaal ingesteld zijn. Bijvoorbeeld: het aantal waardes dat opgeslagen kan worden, en de locatie waar bestanden opgeslagen worden. De instellingen op subtypeniveau zijn specifiek voor elk entiteitsubtype, en kunnen later nog gewijzigd worden. Bijvoorbeeld: het veldlabel, de hulptekst, de standaardwaarde, en of het veld vereist is of niet. U gaat naar deze instellingen door op <em>Bewerken</em> te klikken achter het gewenste veld op de <em>Velden beheren</em>-pagina.','nl',0),(6626,'Velden hergebruiken','nl',0),(6627,'Als een veld eenmaal gemaakt is, kunt u het hergebruiken in andere subtypes van hetzelfde entiteitstype. Een veld dat gemaakt is voor het inhoudstype Artikel kan ook gebruikt worden op het type Pagina, maar het kan niet gebruikt worden in een aangepast blok of taxonomie. Na het klikken op <em>Veld toevoegen</em> op de pagina <em>Velden beheren</em> worden herbruikbare velden in een lijst weergegeven. Nadat een veld voor hergebruik geselecteerd wordt, kunnen de instellingen op subtypeniveau gewijzigd worden.','nl',0),(6628,'Veldbewerking instellen','nl',0),(6629,'Op de pagina <em>Formulierweergave beheren</em>van het entiteitstype of subtype kan ingesteld worden hoe de velddata standaard bewerkt wordt. Als het entiteitstype meerdere formuliermodi heeft (wat zelden voorkomt), kan bovenaan de pagina gewisseld worden tussen de verschillende formuliermodi. Stel in of de standaardinstellingen gebruikt worden, of kies aangepaste instellingen in de sectie <em>Aangepaste weergaveinstellingen</em>. Voor elk veld kunt u per formuliermodus instellen welke widget gebruikt wordt voor het bewerken van de inhoud. Als een widget meer instellingen heeft, zoals de grootte van een tekstveld, kunnen deze bewerkt worden door op de knop \'Bewerken\' te klikken (het tandwiel). De volgorde van de velden op het formulier kan gewijzigd worden. Een veld kan uitgesloten worden door <em>Verborgen</em> te kiezen in de widgetkeuzelijst, of door het naar de sectie <em>Uitgeschakeld</em> te slepen.','nl',0),(6630,'Veldweergave instellen','nl',0),(6631,'Op de pagina <em>Weergave beheren</em>van het entiteitstype of subtype kan ingesteld worden hoe de velddata standaard weergegeven wordt. Als het entiteitstype meerdere weergavemodi heeft, kan bovenaan de pagina gewisseld worden tussen de verschillende weergavemodi. Stel in of de standaardinstellingen gebruikt worden, of kies aangepaste instellingen in de sectie <em>Aangepaste weergaveinstellingen</em>. Voor elk veld kunt u per weergavemodus instellen of en hoe een veldlabel weergegeven wordt in de <em>Label</em>-selectielijst. Kies ook een weergavehulpmiddel voor het veld. Als een weergavehulpmiddel meer instellingen heeft, kunnen deze bewerkt worden door op de knop \'Bewerken\' te klikken (het tandwiel). De volgorde waarin de velden worden weergegeven kan gewijzigd worden. Een veld kan uitgesloten worden door <em>Verborgen</em> te kiezen in de weergavehulpmiddellijst, of door het naar de sectie <em>Uitgeschakeld</em> te slepen.','nl',0),(6632,'Weergave- en formuliermodi instellen.','nl',0),(6633,'Velden weergeven','nl',0),(6634,'Afbeeldingen moeten exact <strong>@size</strong> pixels zijn.','nl',0),(6635,'Afbeeldingen moeten groter zijn dan <strong>@min</strong> pixels. De afmetingen van afbeeldingen groter dan <strong>@max</strong> pixels worden aangepast.','nl',0),(6636,'Afbeeldingen moeten groter zijn dan <strong>@min</strong> pixels.','nl',0),(6637,'De afmetingen van afbeeldingen groter dan <strong>@max</strong> pixels worden aangepast.','nl',0),(6638,'Definieer hoe tekst wordt verwerkt door filters te combineren in tekstopmaak.','nl',0),(6639,'Forumonderwerp','nl',0),(6640,'De taalcode van de menu-link','nl',0),(6641,'Node geschreven door (uid)','nl',0),(6642,'Revisie geschreven door (uid)','nl',0),(6643,'Rol vereist ofwel de toegangsrechten <em>revisies bekijken</em> en <em>nodes bewerken</em> voor deze nodes, ofwel <em>nodes beheren</em>.','nl',0),(6644,'Rol vereist ofwel de toegangsrechten <em>revisies bekijken</em> en <em>nodes verwijderen</em> voor deze nodes, ofwel <em>nodes beheren</em>.','nl',0),(6645,'De locatie waar deze snelkoppeling naar verwijst.','nl',0),(6646,'Stel de sitenaam, e-mailadres, slogan, standaardvoorpagina en foutpagina\'s in.','nl',0),(6647,'Dit wordt alleen gebruikt wanneer op de pagina Uiterlijk de site is ingesteld om een apart beheerthema te gebruiken.','nl',0),(6648,'Link naar een pagina','nl',0),(6649,'Hiermee kan toegangscontrole worden overgeslagen bij links naar interne paden.','nl',0),(6650,'Geen toegangsrechten om %action op @entity_type_label %entity_label uit te voeren.','nl',0),(6651,'smal','nl',0),(6652,'Het referentieoverzicht %view_name kan niet worden gevonden.','nl',0),(6653,'Ingeschakeld','nl',0),(6654,'Actieve menu-trail','nl',0),(6655,'Configuratie-updates','nl',0),(6656,'De weergegeven configuratie zal worden bijgewerkt.','nl',0),(6657,'Entiteitveld met een wachtwoordwaarde.','nl',0),(6658,'Een automatisch aanvullend tekstveld