lijke manieren om afbeeldingsstijlen te benoemen: of gebaseerd op het effect dat wordt toegepast (bijvoorbeeld: <em>Vierkant 85x85</em>), of gebaseerd op de plek waar het getoond wordt (bijvoorbeeld: <em>Profielfoto</em>).','nl',0),(6673,'Afbeeldingsstijlen instellen','nl',0),(6674,'Een aantal instellingen voor afbeeldingsvelden worden ingesteld als het veld aangemaakt wordt. Deze kunnen daarna niet meer gewijzigd worden. Bijvoorbeeld de keuze voor publieke of private opslag en het aantal afbeeldingen dat een veld kan bevatten. De overige instellingen kunnen later gewijzigd worden. Bijvoorbeeld het veldlabel, helptekst, toegestane bestandsextensies, resolutiebeperkingen, en de map waarin de afbeeldingen opgeslagen worden. De aanpasbare instellingen kunnen verschillende waardes hebben voor de verschillende subentiteiten. Als het veld bijvoorbeeld zowel op het inhoudstype Pagina als op Artikel gebruikt wordt, kunnen de afbeeldingen voor elk inhoudstype in een andere map opgeslagen worden.','nl',0),(6675,'De maximale bestandsgrootte die geüpload kan worden, wordt beperkt door de PHP-instellingen van de server. U kunt deze verder beperken door een <em>Maximale uploadgrootte</em> in te stellen in de veldinstellingen (deze instelling kan later nog aangepast worden). De maximale bestandsgrootte, van de PHP-server-instellingen of van de veld-instellingen, wordt automatisch getoond aan gebruikers in de hulptekst van het afbeeldingsveld.','nl',0),(6676,'Het is mogelijk een standaardafbeelding te gebruiken als het veld geen waarde bevat. Tijdens het aanmaken van het veld kan deze standaardafbeelding voor alle instanties van het veld worden gekozen. Deze instelling kan overschreven worden in elk entiteitssubtype waarin het veld gebruikt wordt.','nl',0),(6677,'Weergaven en formulierweergaven instellen','nl',0),(6678,'Op de pagina <em>Weergave beheren</em> wordt een afbeeldingsweergave gekozen, die bepaalt hoe de afbeelding in de verschillende weergavemodi getoond wordt, en of de