dates beschikbaar zijn voor geïnstalleerde componenten. Hiervoor wordt anonieme informatie over uw website verstuurd naar <a href=\":drupal\">Drupal.org</a>.','nl',0),(7096,'Bestandsoverdracht mislukt, reden: @reason','nl',0),(7097,'Unieke veldbeperking','nl',0),(7098,'Het @entity_type met @field_name %value bestaat al.','nl',0),(7099,'Met de Actions-module kan de website taken uitvoeren zoals het ongedaan maken van publicatie, het versturen van e-mailberichten of het blokkeren van een gebruiker. Andere modules kunnen deze acties starten wanneer bepaalde gebeurtenissen zich voordoen; bijvoorbeeld wanneer nieuwe inhoud is geplaatst of een gebruiker inlogt. Modules kunnen ook aanvullende acties toevoegen. Zie voor informatie de <a href=\":documentation\">online documentatie van de Actions-module</a>.','nl',0),(7100,'<em>Eenvoudige acties</em> hebben geen configuratie nodig en worden, indien beschikbaar, automatisch opgesomd op de <a href=\":actions\">Actiespagina</a>.','nl',0),(7101,'<em>Geavanceerde acties</em> worden door een gebruiker gemaakt en moeten per stuk geconfigureerd worden. Maak een geavanceerde actie aan op de pagina <a href=\":actions\">Acties</a> door een actietype te kiezen uit de keuzelijst. Configureer daarna de actie, bijvoorbeeld door de ontvanger van een geautomatiseerd e-mailbericht in te vullen.','nl',0),(7102,'Het bericht dat verstuurd zal worden. Vervangingspatronen zoals [node:title], [user:account-name], [user:display-name] en [comment:body] kunnen gebruikt worden voor gegevens die per bericht verschillen. Niet alle patronen zijn in alle contexten beschikbaar.','nl',0),(7103,'Het bericht dat aan de gebruiker getoond zal worden. Vervangingspatronen zoals [node:title], [user:account-name], [user:display-name] en [comment:body] kunnen gebruikt worden voor gegevens die per bericht verschillen. Niet alle patronen zijn in alle contexten beschikbaar.','nl',0),(7104,'De Aggregator-module is een syndicator en RSS-lezer die de nieuwste content van online RSS-, RDF- en Atom-feeds verzamelt en weergeeft. Duizenden websites (vooral nieuwssites en blogs) publiceren hun laatste nieuws via feeds en gebruiken daarvoor verschillende gestandaardiseerde XML-formaten. Zie voor meer informatie de <a href=\":aggregator-module\">online documentatie van de Aggregator-module</a>.','nl',0),(7105,'Gebruikers bekijken de feeds in de <a href=\":aggregator\">standaardweergave van de aggregator</a> of via <a href=\":aggregator-sources\">hun bron</a> (meestal met een RSS-lezer). De nieuwste content van een feed kan in een blok worden weergegeven met behulp van de <a href=\":admin-block\">Blok lay-out pagina</a>.','nl',0),(7106,'Beheerders kunnen feeds toevoegen, bewerken en verwijderen, en ook kiezen hoe vaak iedere feed gecontroleerd moet worden op nieuwe inhoud op de <a href=\":feededit\">Feed-aggregatie pagina</a>.','nl',0),(7107,'De weergave van feed-items instellen','nl',0),(7108,'Beheerders kunnen kiezen hoeveel items in de overzichtspagina worden weergegeven, welke HTML-tags in de content van feeds zijn toegestaan en of ze tot een maximum aantal tekens worden ingekort. Ga hiervoor naar de pagina <a href=\":settings\">Feed aggregator-instellingen</a>.','nl',0),(7109,'Oude feed-items weggooien','nl',0),(7110,'Beheerders kunnen feed-items ouder dan een bepaalde tijd laten vervallen op de pagina <a href=\":settings\">Feed aggregator-instellingen</a>. Hiervoor moeten de periodieke cron-taken geconfigureerd zijn (zie hieronder).','nl',0),(7111,'Een <a href=\":aggregator-opml\">OPML-bestand</a> van alle feeds is beschikbaar. OPML is een bestandsformaat gebaseerd op XML en wordt gebruikt om gestructureerde informatie te delen zoals een lijst van RSS-feeds. Feeds kunnen ook <a href=\":import-opml\">geïmporteerd worden via een OPML-bestand</a>.','nl',0),(7112,'Een werkende <a href=\":cron\">cron-onderhoudstaak</a> is vereist voor het automatisch bijwerken van feeds.','nl',0),(7113,'Hieronder staan de actuele feeds. Nieuwe feeds kunnen <a href=\":addfeed\">worden toegevoegd</a>. Per feed kan op de pagina <a href=\":block\">Blokken beheren</a> een blok met <em>recente items</em> worden ingeschakeld.','nl',0),(7114,'Feed aggregator-instellingen','nl',0),(7115,'@title-feed','nl',0),(7116,'Er zijn geen feeds beschikbaar. <a href=\":link\">Voeg een feed toe</a>.','nl',0),(7117,'De beschrijving van de oorspronkelijke website die uit het  @description-element van de feed komt.','nl',0),(7118,'De tijdsduur tussen feed-updates. Hiervoor is een correct ingestelde<a href=\":cron\">cron-onderhoudstaak</a> vereist.','nl',0),(7119,'Hiervoor is een correct ingestelde<a href=\":cron\">cron-onderhoudstaak</a> vereist.','nl',0),(7120,'Met de Ban-module kunnen beheerders bezoekers van de site, op basis van het IP-adres, blokkeren. Zie voor meer informatie de <a href=\":url\">online documentatie voor de Ban-module</a>.','nl',0),(7121,'Beheerders kunnen IP-addressen die gebanned moeten worden i nvoeren op de pagina <a href=\":bans\">Geweigerde IP-addressen</a>.','nl',0),(7122,'De HTTP Basic Authentication-module levert een <a href=\"http://en.wikipedia.org/wiki/Basic_access_authentication\">HTTP Basic authentication</a> provider voor webserviceverzoeken. Deze verificatieprovider gebruikt de HTTP Basic Authentication gebruikersnaam en wachtwoord om verzoeken te verifiëren en is een alternatief voor het  standaard verificatiesysteem van Drupal dat op cookies is gebaseerd. Gebruik deze module alleen wanneer uw website diensten levert waarvoor deze verificatiemethode is ingesteld (bijvoorbeeld de <a href=\":rest_help\">RESTful Web Services-module</a>). Zie voor meer informatie de <a href=\":hba_do\">online documentatie voor de HTTP Basic Authentication-module</a>.','nl',0),(7123,'Met de Blok-module kunt u blokken plaatsen in gebieden en hun instellingen configureren. Lees voor meer informatie <a href=\":blocks-documentation\">de online-documentatie van de Blok-module</a>.','nl',0),(7124,'U kunt zien waar elk gebied in het huidige thema zich bevindt door op de pagina <a href=\":blocks\">Blok-layout</a> te klikken op de link <em>Blokgebieden demonsteren</em>. Elk thema heeft eigen gebieden.','nl',0),(7125,'Gebruik de link <em>Instellen</em> op de pagina <a href=\":blocks\">Blok-layout</a> om de instellingen van een blok te veranderen. Afhankelijk van de bijbehorende module kunnen de opties per blok verschillen. Van alle blokken kunt u de titel aanpassen en al dan niet verbergen.','nl',0),(7126,'Wanneer de <em>Custom Block</em>-module is geïnstalleerd kunnen aangepaste blokken aangemaakt worden. Bekijk voor meer informatie de <a href=\":blockcontent-help\">Custom Block helppagina</a>.','nl',0),(7127,'Blok-instellingen bijgewerkt.','nl',0),(7128,'Aangepast bloktype %label bewerken','nl',0),(7129,'Er zijn nog geen bloktypes aangemaakt. Ga naar de <a href=\":url\">pagina Bloktype aanmaken</a> om een nieuw bloktype toe te voegen.','nl',0),(7130,'Het blok met uuid %uuid bestaat niet. <a href=\":url\">Een blok toevoegen</a>.','nl',0),(7131,'Een <a href=\":url\">aangepast blok</a> toevoegen.','nl',0),(7132,'Met de Boek-module creëer je gestructureerde inhoud bestaande uit meerdere pagina\'s, zoals naslaggidsen, handleidingen en wiki\'s. De inhoud kan worden opgedeeld in hoofdstukken, secties, subsecties of vergelijkbare structuurelementen. Het inschakelen van de module zorgt voor een nieuw inhoudstype, de <em>Boek-pagina</em>. Bekijk voor meer informatie de <a href=\":book\">online documentatie voor de Boek-module</a>.','nl',0),(7133,'U kunt toegangsrechten instellen voor <em>aanmaken van boeken</em> en voor <em>aanmaken</em>, <em>bewerken</em> en <em>verwijderen</em> van boekpagina\'s. Gebruikers met toegangsrecht <em>Boekstructuren beheren</em> kunnen inhoud aan <em>alle</em> soorten boeken toevoegen, door de betreffende boekstructuur te selecteren bij het bewerken van deze inhoud. Zij kunnen ook een lijst van alle boeken bekijken, de sectietitels bewerken en organiseren op de pagina <a href=\":admin-book\">Boekoverzicht</a>.','nl',0),(7134,'Het <em>boekpagina</em> inhoudstype is het oorspronkelijke inhoudstype dat is ingeschakeld voor de boekstructuur. Binnen de <a href=\":admin-settings\"> instellingen van de boekpagina</a> kunt u de inhoudstypen samenstellen die u kunt gebruiken in de boekstructuur.','nl',0),(7135,'Gebruikers met het toegangsrecht <em>Inhoud en sub-pagina\'s aan boeken toevoegen en de hiërarchie beheren.</em> zullen een link zien naar <em>Een onderliggende pagina toevoegen</em> als ze een item bekijken dat onderdeel is van de boekstructuur. Deze link staat toe dat gebruikers nieuwe inhoud aan kunnen maken voor het inhoudstype dat geselecteerd wordt op de pagina <a href=\":admin-settings\">Boekinstellingen</a>. Standaard is dit het inhoudstype <em>Boekpagina</em>.','nl',0),(7136,'Boekpagina\'s hebben standaard een boeknavigatieblok. Dit navigatieblok heeft links die verwijzen naar de vorige en volgende pagina\'s in het boek en naar het niveau boven de huidige pagina in de structuur van het boek. Dit blok kan ingeschakeld worden op de pagina <a href=\':admin-block\'>Blok lay-out</a>. Boekpagina\'s moeten aan een boekstructuur toegevoegd worden om weergegeven te worden in de boeknavigatie.','nl',0),(7137,'Met de structuurfunctie kunnen pagina\'s in de <a href=\":book\">Boekstructuur</a> worden opgenomen of binnen de hiërarchie verplaatst. Tevens kan de structuur van het hele boek worden <a href=\":book-admin\">bewerkt</a>.','nl',0),(7138,'De bovenliggende pagina in het boek. De maximale diepte voor een boek en alle onderliggende pagina\'s is @maxdepth. Sommige pagina\'s in het geselecteerde boek kunnen wellicht geen onderliggende pagina\'s hebben, aangezien ze dan deze limiet zouden overschrijden.','nl',0),(7139,'De Breakpoint-module beheert hoogte, breedte en resolutie-breakpoints waarop een responsive ontwerp dient te veranderen om zich aan te pasen aan de verschillende apparaten waarmee de site wordt bekeken. Deze module heeft geen gebruikersinterface. Zie voor meer informatie de <a href=\":docs\">online documentatie van de Breakpoint-module</a>.','nl',0),(7140,'<a href=\":w3\">Media  queries</a> zijn een formele manier om breakpoints te beschrijven. Bijvoorbeeld een breedte-breakpoint van 40em wordt geschreven al een media query \'(min-width: 40em)\'. Breakpoints zijn media queries met aanvullende meta-data, zoals een naam en een vermenigvuldigingsfactor.','nl',0),(7141,'De CKEditor-module levert een zeer toegankelijke, gebruiksvriendelijke visuele teksteditor en voegt tevens een toolbar toe aan tekstvelden. Gebruikers kunnen met behulp van knoppen teksten voorzien van opmaak en semantisch correcte, geldige HTML genereren. De CKEditor-module gebruikt het framework van de <a href=\":text_editor\">Text Editor-module</a>. Het vereist dat JavaScript is ingeschakeld in de browser. Bekijk voor meer informatie de <a href=\":doc_url\">online documentatie voor de CKEditor-module</a> en de <a href=\":cke_url\">CKEditor website</a>.','nl',0),(7142,'CKEditor dient per Tekstopmaak ingeschakeld en geconfigureerd te worden op de <a href=\":formats\">Tekstopmaak en editors pagina</a> omdat de filterinstellingen voor elke Tekstopmaak kunnen verschillen. Lees voor meer informatie de <a href=\":text_editor\">Tekstopmaak helppagina</a> en <a href=\":filter\">Filter helppagina</a>.','nl',0),(7143,'CKEditor laat gebruikers alleen die inhoud bewerken die overeenkomt met de filterinstelling van het specifieke tekst-format. Als een tekst-format specifieke HTML-tags uitsluit, zullen de corresponderende knoppen niet in de knoppenbalk getoond worden. Zie voor meer informatie de <a href=\":filter\">Filter hulppagina</a>.','nl',0),(7144,'De meegeleverde WYSIWYG editor (CKEditor) heeft een aantal <a href=\":features\">toegankelijkheidsfuncties</a>. CKEditor heeft standaard <a href=\":shortcuts\">toetsenbord-sneltoetsen</a>, die handig zijn voor geavanceerde gebruikers en gebruikers die enkel met toetsenbord (kunnen) werken.','nl',0),(7145,'De Color-module laat gebruikers met de permissie <em>Site-instellingen beheren</em> het kleurenschema (de kleur van links, achtergronden, tekst en andere thema-elementen) wijzigen van thema\'s die deze module ondersteunen. Zie voor meer informatie de <a href=\":color_do\">online documentatie van de Color-module</a>.','nl',0),(7146,'Om de kleurinstellingen te wijzigen, klik op de <em>Instellingen</em>-link bij het thema op de pagina <a href=\":appearance\">Uiterlijk</a>. Als de kleurkiezer niet verschijnt is het thema niet geschikt voor de Color-module.','nl',0),(7147,'De Comment-module stelt gebruikers in staat om te reageren op inhoud van de site, om standaardreacties en toegangsrechten in te stellen en om reacties te modereren. Zie voor meer informatie het <a href=\":comment\">online-handboek van de Comment-module</a>.','nl',0),(7148,'Reageren inschakelen','nl',0),(7149,'Reactiefunctionaliteit kan ingeschakeld worden voor ieder entiteitsubtype (bijvoorbeeld <a href=\":content-type\">Inhoudstypen</a>) door een <em>Reacties</em>-veld toe te voegen op de pagina <em>Velden beheren</em>. Voor het toevoegen of verwijderen van deze functionaliteit met behulp van de gebruikersinterface moet de <a href=\":field_ui\">Field UI-module</a> ingeschakeld zijn (de reactiefunctionaliteit zelf werkt ook zonder deze module). Zie voor meer informatie over velden en entiteiten de hulppagina van de <a href=\":field\">Field-module</a>.','nl',0),(7150,'Reactie-instellingen configureren','nl',0),(7151,'Reactieinstellingen kunnen ingesteld worden bij het <em>Reacties</em>-veld op de pagina <em>Velden beheren</em> van het entiteitstype (mits de <em>Field UI</em>-module ingeschakeld is). De instellingen omvatten het label van het reactieveld, het aantal reacties dat weergegeven wordt en het al dan niet weergeven van de reacties als een vertakte-lijst. Reacties kunnen ingesteld worden als <em>Open</em> zodat nieuwe reacties geplaatst kunnen worden, <em>Gesloten</em> om de bestaande reacties te zien zonder dat er nieuwe reacties toegevoegd kunnen worden of <em>Verborgen</em> om de bestaande reacties te verbergen en geen nieuwe reacties toe te staan. Het wijzigen van deze instelling heeft geen invloed op bestaande reacties.','nl',0),(7152,'Gebruikers met de juiste rechten kunnen de standaard-reactieinstellingen van een entiteittype overschrijven als ze een reactie aan dat type toevoegen.','nl',0),(7153,'Reacties van gebruikers met het toegangsrecht <em>Reactiegoedkeuring overslaan</em> worden direct gepubliceerd. Andere reacties worden in de wachtrij van <a href=\":comment-approval\">niet goedgekeurde reacties</a> geplaatst, totdat een gebruiker met het recht <em>Reacties beheren</em> ze publiceert of verwijdert. Gepubliceerde reacties kunnen en-masse beheerd worden op de pagina <a href=\":admin-comment\">Gepubliceerde reacties</a>. Als een reactie geen antwoorden heeft, blijft hij bewerkbaar door de auteur, mits de auteur het toegangsrecht <em>Eigen reacties bewerken</em> heeft.','nl',0),(7154,'Als antwoord op @parent_title door @parent_username','nl',0),(7155,'Naam voor @anonymous','nl',0),(7156,'<a href=\":login\">Login</a> of <a href=\":register\">registreer</a> om te reageren','nl',0),(7157,'<a href=\":login\">Login</a> om te reageren','nl',0),(7158,'Selecteer het Reactietype dat gebruikt moet worden voor dit Reactieveld. Beheer Reactietypen op de <a href=\":url\">Beheer-overzichtspagina</a>.','nl',0),(7159,'De Configuration Manager-module stelt gebruikers in staat om configuratiewijzigingen te importeren en te exporteren tussen sites op verschillende omgevingen. De configuratie wordt opgeslagen in YAML-formaat. Zie voor meer informatie de online-documentatie van de <a href=\":url\">Configuration Manager-module</a>.','nl',0),(7160,'U kunt een archief van alle website-instellingen in een <em>*.yml</em>-bestand aanmaken en downloaden op de pagina <a href=\":url\">Exporteren</a>.','nl',0),(7161,'U kunt een volledige site-configuratie uploaden door middel van een archief-bestand op de <a href=\":url\">Importeer</a>-pagina. Wanneer data van een andere omgeving geïmporteerd wordt dienen de site en import-bestanden gelijke configuratie-waardes te bevatten voor UUID in het <em>system.site</em> configuratie-item. Dit betekent dat andere omgevingen initieel opgezet moeten worden als duplicaten van de doel-website. Migraties worden niet ondersteund.','nl',0),(7162,'Om onverwachte wijzigingen te voorkomen kunt u, voordat de import afgerond wordt, de verschillen tussen de actieve configuratie en geïmporteerde configuratie controleren op de <a href=\":synchronize\">Synchroniseren</a>-pagina. Deze pagina toont ook de configuratie-items die toegevoegd of verwijderd worden.','nl',0),(7163,'U kunt een enkel configuratie-item exporteren door een <em>Configuratietype</em> en <em>Configuratienaam</em> te selecteren op de pagina <a href=\":single-export\">Enkele export</a>. De configuratie en de bijbehorende <em>*.yml-bestandsnaam</em> worden dan weergegeven zodat u ze kunt kopiëren.','nl',0),(7164,'U kunt een enkel configuratie-item importeren door het in YAML-formaat te plakken in het formulier op de pagina <a href=\":single-import\">Enkele import</a>.','nl',0),(7165,'Exporteer en download de volledige configuratie van deze site als een gzipped tar bestand.','nl',0),(7166,'Kies een configuratie-item om de YAML-structuur weer te geven','nl',0),(7167,'Importeer een enkel configuratie-item door de YAML-structuur hiervan in het tekstveld te plakken.','nl',0),(7168,'Volledig archief','nl',0),(7169,'Enkel item','nl',0),(7170,'Gereed','nl',0),(7171,'De volgende items in uw actieve configuratie zijn sinds de laatste import gewijzigd. Deze wijzigingen kunnen bij een volgende import verloren gaan.','nl',0),(7172,'Configuratie-collectie @collection','nl',0),(7173,'@source_name naar @target_name','nl',0),(7174,'De Configuration Translation-module maakt het mogelijk om configuratietekst te vertalen. Bijvoorbeeld, de site-naam, woordenlijsten, menu\'s, of datumformaten. Samen met de modules <a href=\":language\">Language</a>, <a href=\":content-translation\">Content Translation</a> en <a href=\":locale\">Interface Translation</a>, kunt u meertalige websites maken. Bekijk de <a href=\":doc_url\">online documentatie voor de Configuration Translation-module</a> voor meer informatie.','nl',0),(7175,'Om de instellingen te vertalen, moet de website over tenminste twee <a href=\":url\">talen</a> beschikken.','nl',0),(7176,'Gebruikers met het toegangsrecht <em>Configuratie vertalen</em> kunnen het configuratievertalingsoverzicht benaderen en vertalingen voor specifieke talen beheren. De pagina <a href=\":translation-page\">Configuratievertaling</a> toont een lijst van alle configuratietekst die vertaald kan worden, als individuele items of als lijsten. Nadat u klikt op <em>Vertalen</em> wordt een overzicht van alle talen getoond. U kunt een vertaling voor een specifieke taal <em>toevoegen</em> of <em>bewerken</em>. Gebruikers met specifieke configuratie-toegangsrechten kunnen ook de tekst voor de standaardtaal van de site <em>bewerken</em>. Voor sommige configuratietekst-items (bijvoorbeeld voor de site-informatie), kunnen de specifieke vertalingspagina\'s ook direct via hun configuratiepagina benaderd worden.','nl',0),(7177,'U kunt ervoor kiezen om datumformaten te vertalen op de pagina <a href=\":translation-page\">Configuratievertaling</a>. Dit maakt het niet alleen mogelijk om de labeltekst te vertalen, maar ook om het taalspecifieke <em>PHP-datumformaat</em> in te stellen.','nl',0),(7178,'@label <span class=\"visually-hidden\">(@source_language)</span>','nl',0),(7179,'De module Contact biedt bezoekers de mogelijkheid om geregistreerde gebruikers van de website te benaderen via hun persoonlijke contactformulier. Tevens kunnen algemene contactformulieren worden aangemaakt. Meer informatie vindt u in de <a href=\":contact\">online documentatie van de module Contact</a>.','nl',0),(7180,'Op de pagina <a href=\":contact_admin\">Contactformulieren</a> kunt u de velden en de weergave van het persoonlijke contactformulier instellen en een of meer site-brede contactformulieren instellen. Elk contactformulier heeft een systeemnaam, een label en een of meer ontvangers. Als een bezoeker het formulier verzend worden de ingevulde gegevens verzonden naar deze ontvangers.','nl',0),(7181,'Eén site-breed contactformulier kan aangewezen worden als het standaardcontactformulier. Als u een standaardformulier instelt, zal de <em>Contact</em>-menulink in het <em>Voet</em>-menu hiernaar verwijzen. U kunt de link wijzigen op de <a href=\":menu-settings\">Menu\'s</a>-pagina als de Menu UI-module geïnstalleerd is. U kunt ook links maken naar andere contactformulieren. De URL voor elk formulier dat u gemaakt hebt, heeft het volgende formaat: <em>contact/systeemnaam_van_het_formulier</em>.','nl',0),(7182,'Op de pagina <a href=\":contact_admin\">Contactformulieren</a> kunt u de velden van de formulieren instellen, inclusief labels en hulpteksten. Als u andere inhoud op een contact formulier wilt weergeven (zoals tekst of afbeeldingen), gebruik dan een blok. U kunt blokken toevoegen en bewerken op de <a href=\":blocks\">Blok lay-out</a>-pagina, als de Block-module geïnstalleerd is.','nl',0),(7183,'[@form] @subject','nl',0),(7184,'@sender-name (@sender-url) heeft een bericht gestuurd met het contactformulier op @form-url.','nl',0),(7185,'[@site-name] @subject','nl',0),(7186,'Hallo @recipient-name,','nl',0),(7187,'@sender-name (@sender-url) heeft u een bericht gestuurd via uw contactformulier op @site-name.','nl',0),(7188,'Als u dergelijke e-mails niet wilt ontvangen, pas dan uw instellingen aan op @recipient-edit-url.','nl',0),(7189,'@name (niet geverifieerd)','nl',0),(7190,'Het contactformulier is niet ingesteld. <a href=\":add\">Voeg één of meerdere formulier(en) toe</a> .','nl',0),(7191,'Met de Content Translation-module kunt u inhoud, reacties, aangepaste blokken, taxonomie termen, gebruikers en andere <a href=\":field_help\" title=\"Field-module help, met meer informatie over entiteiten\">entiteiten</a> vertalen. Samen met de modules <a href=\":language\">Language</a>, <a href=\":config-trans\">Configuration Translation</a> en <a href=\":locale\">Interface Translation</a>, maakt dit het bouwen van meertalige websites mogelijk. Zie voor meer informatie de <a href=\":translation-entity\">online documentatie voor de Content Translation-module</a>.','nl',0),(7192,'Om inhoud te kunnen vertalen, moet de website tenminste twee <a href=\":url\">talen</a> hebben. Wanneer dit het geval is, kunt u vertalingen aanzetten voor de gewenste entiteiten op de pagina <a href=\":translation-entity\">Inhoud taal</a>. Wanneer u vertalingen aanzet kunt u de standaard taal voor inhoud kiezen en bepalen of het taalselectieveld op het inhoudbewerkformulier getoond moet worden.','nl',0),(7193,'Voordat u inhoud kunt vertalen, moeten er tenminste twee talen toegevoegd zijn op de <a href=\":url\">Talen</a>-pagina.','nl',0),(7194,'Schakel voor het vertalen van dit veld de <a href=\":language-settings-url\">taalondersteuning</a> voor dit type in.','nl',0),(7195,'<a href=\":settings_url\">Vertaling inschakelen</a> voor <em>inhoudstypes</em>, <em>taxonomiewoordenlijsten</em>, <em>accounts</em>, of een ander element dat u wilt vertalen.','nl',0),(7196,'De Contextual links-module geeft gebruikers met de rechten <em>\r\nContextuele links gebruiken</em> snelle toegang tot taken die gerelateerd zijn aan gebieden of pagina\'s. Een menu in een blok heeft bijvoorbeeld links om het menu te bewerken en het blok in te stellen. Zie voor meer informatie het online-handboek van de <a href=\":contextual\">Contextual links-module</a>.','nl',0),(7197,'Als u met de muis over een gebied op de site zweeft, verschijnt de contextuele links-knop (die er in de meeste thema\'s uitziet als een potlood in de rechter bovenhoek van het gebied). Het icoontje ziet er gewoonlijk zo uit: @picture','nl',0),(7198,'Als de <a href=\":toolbar\">Toolbar</a>-module ingeschakeld is, klikt u op de contextuele links-knop (die eruit ziet als een potlood) in de werkbalk om alle contextuele links op de pagina te tonen. Klik nogmaals om de contextuele links weer te verbergen.','nl',0),(7199,'De DateTime-module biedt een datumveld dat datum- en tijdwaardes opslaat. Het biedt ook de formulierelementen <em>datetime</em> en <em>datelist</em> voor toepassing in andere modules. Zie ook de hulppagina\'s van <a href=\":field\">Field-module</a>en <a href=\":field_ui\">Field UI-module</a> voor algemene informatie over velden en hoe deze aan te maken en te beheren. Zie voor meer informatie de <a href=\":datetime_do\">on-line documenatatie van de DateTime-module</a>.','nl',0),(7200,'De <em>instellingen</em> en de <em>weergave</em> van het datumveld kunnen afzonderlijk ingesteld worden. Zie voor meer informatie over het beheren en weergeven van velden de <a href=\":field_ui\">Field UI-hulp</a>.','nl',0),(7201,'Datums kunnen weergegeven worden in <em>Platte notatie</em> of <em>Standaardnotatie</em>. De <em>Platte notatie</em> toont de datum volgens de <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601</a>-standaard. Bij de <em>Standaardnotatie</em>, kunt u kiezen uit een lijst met voorgedefinieerde notaties die beheerd kunnen worden op de pagina <a href=\":date_format_list\">Datum- en tijdnotaties</a>.','nl',0),(7202,'Datum-onderdeelvolgorde: @order','nl',0),(7203,'Tijdtype: @time_type','nl',0),(7204,'Tijdstappen: @increment','nl',0),(7205,'De module Database Logging registreert systeemgebeurtenissen in de database. Lees voor meer informatie de <a href=\":dblog\">Database logging-module documentatie</a>.','nl',0),(7206,'De module Database Logging laat een logboek zien met <a href=\":dblog\">recente gebeurtenissen</a>. Het logboek is een chronologische lijst van gebeurtenissen, waaronder gebruik- en prestatiegegevens, foutmeldingen, waarschuwingen en operationele informatie. Beheerders doen er goed aan het logboek regelmatig te controleren om er zeker van te zijn dat de website naar behoren werkt.','nl',0),(7207,'In het geval van foutmeldingen of problemen met de site kan de pagina <a href=\":dblog\">Recente logberichten</a> helpen bij het oplossen van de problemen. Op deze pagina vindt u een chronologisch overzicht van recente gebeurtenissen. Logberichten bevatten gebruiksinformatie, waarschuwingen en foutmeldingen.','nl',0),(7208,'Het maximum aantal meldingen om in de databaselog op te slaan. Dit vereist een <a href=\":cron\">cron-onderhoudstaak</a>.','nl',0),(7209,'Pagina\'s die geschikt zijn om te cachen worden gecached zodra ze worden opgevraagd. Daarna wordt de opgeslagen versie geserveerd voor alle aanvragen. Dynamische inhoud wordt automatisch verwerkt zodat zowel cache-correctheid als hit-ratio worden behouden.','nl',0),(7210,'Internal Dynamic Page Cache','nl',0),(7211,'Cachet pagina\'s voor alle gebruikers en houdt rekening met dynamische inhoud.','nl',0),(7212,'De Text Editor-module biedt een raamwerk dat andere modules (zoals de <a href=\":ckeditor\">CKEditor-module</a>) kunnen gebruiken om toolbars en andere functionaliteit te bieden aan gebruikers waarmee zij eenvoudiger tekst kunnen opmaken dan door zelf HTML te typen. Zie voor meer informatie de <a href=\":documentation\">online documentatie van de Text Editor-module</a>.','nl',0),(7213,'De Text Editor-module biedt een raamwerk om teksteditors te beheren. Om het te gebruiken dient een teksteditor ingeschakeld te worden. Dit kan de <a href=\":ckeditor\">CKEditor module</a> zijn (Drupal core), die ingeschakeld kan worden op de pagina <a href=\":extend\">Uitbreidingen</a>, of een uitbreidingsmodule voor elke andere teksteditor. Controleer bij het inschakelen van een uitbreidingsmodule de installatie-instructies, omdat er zeer waarschijnlijk ook een externe bibliotheek gedownload en geïnstalleerd moet worden.','nl',0),(7214,'De <em>instellingen</em> en de <em>weergave</em> van de entiteitsreferentievelden kunnen onafhankelijk ingesteld worden. Zie voor meer informatie over het beheren van velden en hun weergave de online <a href=\":field_ui\">Field UI-hulppagina</a>.','nl',0),(7215,'Geen overzichten gevonden. <a href=\":create\">Voeg een nieuw overzicht toe</a> met een <em>Entiteitsreferentie</em> weergave, of voeg een weergave toe aan een <a href=\":existing\">bestaand overzicht</a>.','nl',0),(7216,'De Field-module maakt het mogelijk om <em>entiteitstypen</em> van aangepaste velden te voorzien  (zie hieronder). De Field-module verzorgt het opslaan, laden, bewerken en weergeven van gegevens uit velden. De meeste gebruikers zullen niet rechtstreeks met de Field-module te maken hebben, maar in plaats daarvan gebruik maken van de gebruikersinterface van de <a href=\":field-ui-help\">Field UI-module</a>. Moduleontwikkelaars kunnen de Field API gebruiken om nieuwe entiteiten geschikt te maken voor het gebruik van velden. Zie voor meer informatie het online handboek van de <a href=\":field\">Field-module</a>.','nl',0),(7217,'De Field-module biedt de infrastructuur voor velden; de veldtypes, opmaakhulpmiddelen en widgets komen uit Drupal-core of aanvullende modules. Enkele modules zijn verplicht; optionele modules kunnen ingeschakeld worden op de <a href=\":modules\">Uitbreiding-beheerpagina</a>. Extra velden, opmaakhulpmiddelen en widgets kunnen door andere modules aangeboden worden. Deze vindt u in de <a href=\":contrib\">modules-sectie op Drupal.org</a>.','nl',0),(7218,'De Field UI-module biedt een gebruikersinterface (UI: user interface) voor het beheren en weergeven van velden. Velden kunnen aan de meeste entiteit-subtypes worden toegevoegd. Verschillende veldtypes, widgets en weergavehulpmiddelen worden door ingeschakelde modules aangeboden en worden beheerd met de Field-module. Zie voor meer informatie en terminologie van velden en entiteiten de <a href=\":field\">Field-module hulppagina</a>. Zie voor meer informatie over de gebruikersinterface de <a href=\":field_ui_docs\">Field UI-module hulppagina</a>.','nl',0),(7219,'U kunt weergavemodi toevoegen, bewerken en verwijderen op de pagina <a href=\":view_modes\">Weergavemodi beheren</a> en u kunt formuliermodi toevoegen, bewerken en verwijderen op de pagina <a href=\":form_modes\">Formuliermodi beheren</a>. Nadat een weergave- of formuliermode voor een entiteitstype gedefinieerd is, zal het beschikbaar zijn op de pagina\'s Weergave beheren of Formulierweergave beheren voor elk subtype van die entiteit.','nl',0),(7220,'Er zijn twee rapporten beschikbaar die de op de website gedefinieërde velden weergeven. Het <a href=\":entity-list\" title=\"Entiteiten veldenlijst-rapportage\">Entiteiten</a> rapport geeft alle velden weer en laat de systeemnamen, types en de entiteitstypes of subtypes van het veld zien waar ze op gebruikt worden. Elke subtype linkt naar de \'Velden beheren\'-pagina. Als de <a href=\":views\">Views</a> en <a href=\":views-ui\">Views UI</a>-module ingeschakeld zijn toont de <a href=\":views-list\" title=\"Gebruikt in overzichten veldenlijst-rapportage\">Gebruikt in overzichten</a>-rapportage elk veld dat is gebruikt in een overzicht, met een link om dat overzicht te bewerken.','nl',0),(7221,'Er zijn nog geen velden toegevoegd. U kunt op de pagina <a href=\":link\">Velden beheren</a> nieuwe velden toevoegen.','nl',0),(7222,'De %display_mode-mode heeft nu aangepaste weergaveinstellingen. U kunt deze <a href=\":url\">wijzigen</a>.','nl',0),(7223,'@size limiet.','nl',0),(7224,'bestand van @field_name','nl',0),(7225,'De File-module maakt bestandsvelden beschikbaar. Zie voor meer informatie over velden en hoe ze beheerd kunnen worden de <a href=\":field\">Field-module hulppagina</a>, de <a href=\":field_ui\">Field UI-hulppagina</a> en de <a href=\":file_documentation\">on-line documentatie van de File-module</a>.','nl',0),(7226,'De <em>instellingen</em> en de <em>weergave</em> van het bestandsveld kunnen onafhankelijk ingesteld worden. Zie voor meer informatie over het beheren en weergeven van velden de <a href=\":field_ui\">Field UI hulppagina</a>.','nl',0),(7227,'Geüploade bestanden kunnen opgeslagen worden als <em>publiek</em> of <em>privaat</em>, afhankelijk van de instellingen van het <a href=\":file-system\">bestandssysteem</a>. Zie voor meer informatie de <a href=\":system-help\">Systeem-module hulppagina</a>.','nl',0),(7228,'Bestanden in het veld @name konden niet worden geüpload.','nl',0),(7229,'Het gekozen bestand in het veld @name mag niet gebruikt worden.','nl',0),(7230,'Het bestand waarnaar in het veld @name wordt verwezen, is niet aanwezig.','nl',0),(7231,'U kunt tekstformaten aanmaken en bewerken op de pagina <a href=\":formats\">Tekstopmaak</a> (als de Teksteditor-module is ingeschakeld, dan heet deze pagina Tekstopmaak en editors). Eén tekstopmaak wordt standaard toegevoegd: Platte tekst (deze verwijderd alle HTML tags). Extra tekstopmaken kunnen worden aangemaakt tijdens de installatie. U kunt een tekstopmaak aanmaken op de pagina <a href=\":add_format\">Tekstopmaak toevoegen</a>.','nl',0),(7232,'Gebruik de tekstopmaak <a href=\":url\">@label</a>','nl',0),(7233,'Zie voor meer informatie de <a href=\":html-specifications\">HTML-specificaties</a> van het W3C of gebruik een zoekmachine om andere sites te vinden die HTML toelichten.','nl',0),(7234,'Probeer bij problemen HTML-karaterentiteiten te gebruiken. Een bekend voorbeeld hiervan is &amp;amp; voor een en-teken. Voor en volledige lijst van entiteiten zie de <a href=\":html-entities\">HTML entiteiten</a>-pagina. Voorbeelden van beschikbare karakters:','nl',0),(7235,'Beperkt de toegelaten HTML-tags en corrigeert foutieve HTML','nl',0),(7236,'De Forum-module voegt een inhoudstype <em>Forumonderwerp</em> toe. Zie voor meer informatie over inhoudstypes de <a href=\":node_help\">Node-module helppagina</a>.','nl',0),(7237,'Zie voor meer informatie <a href=\":forum\">de online documentatie van de Forum-module</a>.','nl',0),(7238,'Bezoek de pagina <a href=\":forums\">Forums</a> om containers en forums aan te maken voor discussieonderwerpen.','nl',0),(7239,'Met de link <a href=\":create-topic\">Forumonderwerp</a> op de pagina <a href=\":content-add\">Inhoud toevoegen</a> wordt het eerste artikel van een nieuwe discussie aangemaakt.','nl',0),(7240,'Het inschakelen van de Forum-module zorgt ervoor dat een standaard menu-item <em>Forums</em> verschijnt in het hulpmiddelenmenu dat linkt naar de pagina <a href=\":forums\">Forums</a>.','nl',0),(7241,'Pas de weergave van de forumonderwerpen aan. Organiseer de forums op de pagina <a href=\":forum-structure\">forumstructuur</a>.','nl',0),(7242,'Voor het deïnstalleren van de Forum-module moeten eerst alle <a href=\":url\">%vocabulary</a> termen worden verwijderd','nl',0),(7243,'Er zijn momenteel geen containers of forums beschikbaar. <a href=\":container\">Container</a> of <a href=\":forum\">forum toevoegen</a>.','nl',0),(7244,'<a href=\":hal_spec\">Hypertext Application Language (HAL)</a> is het formaat dat de benodigde verbinding ondersteund met hypermedia APIs.','nl',0),(7245,'Deze module maakt het mogelijk entiteiten (zoals inhoudsitems, taxonomietermen, enz.) te serialiseren naar de JSON versie van HAL. Zie voor meer informatie de <a href=\":hal_do\">documentatie van de HAL-module</a>.','nl',0),(7246,'<strong>Configureer de website</strong>. Wanneer u bent ingelogd kunt u naar het <a href=\":admin\">beheergedeelte</a> gaan, waar u alle elementen van de site kunt <a href=\":config\">instellen en aanpassen</a>.','nl',0),(7247,'<strong>Functionaliteit toevoegen</strong> Vervolgens gaat u naar de <a href=\":modules\">modulelijst</a> waar u de door u gewenste functionaliteit kunt inschakelen. Uitbreidingsmodules vindt u in de <a href=\":download_modules\">downloadsectie voor Drupal-modules</a>.','nl',0),(7248,'<strong>Vormgeving van de website aanpassen</strong> Ga naar het onderdeel <a href=\":themes\">thema\'s</a> om de vormgeving van de website aan te passen. U kunt kiezen uit de meegeleverde thema\'s, of aanvullende thema\'s downloaden van de <a href=\":download_themes\">Drupal-thema downloadsectie</a>.','nl',0),(7249,'<strong>Begin met toevoegen van inhoud</strong> Tenslotte kunt u <a href=\":content\">inhoud toevoegen</a> aan de website.','nl',0),(7250,'De Help-module biedt <a href=\":help-page\">Helppagina\'s</a>, die u begeleiden bij het instellen en gebruiken van modules, en een Help-blok met hulp op paginaniveau. Deze pagina\'s zijn een startpunt voor de <a href=\":handbook\">online-documentatie op Drupal.org</a> die meer diepgang heeft, actueler is, voorzien is van gebruikerscommentaar en als het uitgangspunt voor alle Drupal-documentatie dient. Zie voor meer informatie de <a href=\":help\">online-documentatie voor de Help-module</a>.','nl',0),(7251,'De Help-module toont uitleg voor elke module die op de <a href=\":help\">Help-overzichtspagina</a> wordt getoond.','nl',0),(7252,'Paginaspecifieke helptekst van modules wordt weergegeven in het helpblok. Dit blok kan ingesteld worden op de <a href=\":blocks\">Blok-layoutpagina</a>.','nl',0),(7253,'De History-module houdt bij welke inhoud een gebruiker gelezen heeft. Het markeert inhoud als <em>nieuw</em> of <em>bijgewerkt</em> afhankelijk van de laatste keer wanneer de gebruiker de inhoud bekeken heeft. Geschiedenis ouder dan een maand wordt verwijderd tijdens het draaien van de cron, wat betekent dat inhoud ouder dan een maand altijd beschouwd wordt als <em>gelezen</em>. De History-module heeft geen gebruikersinterface, maar het stelt een filter beschikbaar op <a href=\":views-help\">Views</a> om nieuwe of bewerkte inhoud te tonen. Zie voor meer informatie de <a href=\":url\">online documentatie van de History-module</a>.','nl',0),(7254,'afbeelding van @field_name','nl',0),(7255,'De Image-module maakt het mogelijk om velden te creëren die afbeeldingen bevatten en om <a href=\":image_styles\"> Afbeeldingsstijlen</a> in te stellen die gebruikt kunnen worden om de weergave van afbeeldingen te manipuleren. Zie de <a href=\":field\">Field-module</a> en de <a href=\":field_ui\">Field UI-module</a> helppagina\'s voor terminologie en generieke informatie over entiteiten, velden en hoe velden gemaakt en beheerd kunnen worden. Zie voor meer informatie de <a href=\":image_documentation\">online documentatie van de Image-module</a>.','nl',0),(7256,'Het concept van afbeeldingsstijlen is dat een enkele geüploade afbeelding op verschillende manieren kan worden weergegeven. Elke variatie in weergave, of <em>afbeeldingsstijl</em>, is het resultaat van het toepassen van één of meerdere <em>effecten</em> op de originele afbeelding. Als voorbeeld is het mogelijk om een hoge-resolutie afbeelding te uploaden met een 4:3 beeldverhouding en deze verkleind, vierkant uitgesneden, of zwart-wit (of elke willekeurige combinatie van deze effecten) weer te geven. De Image-module biedt een manier om dit efficiënt te doen. Nadat een afbeeldingsstijl met de gewenste effecten is ingesteld op de <a href=\":image\">Afbeeldingsstijlen-pagina</a> wordt deze toegepast zodra de afbeelding voor de eerste keer wordt aangeroepen. De gegenereerde afbeelding wordt opgeslagen zodat deze hergebruikt kan worden als het een volgende keer wordt aangeroepen, zonder dat de effecten opnieuw berekend moeten worden. Drupal core biedt verschillende effecten die gebruikt kunnen worden om afbeeldingsstijlen te definiëren. Extra effecten kunnen worden toegevoegd door uitbreidingsmodules.','nl',0),(7257,'Bij het toevoegen van een afbeeldingsveld wordt ingesteld of afbeeldingen in publieke of private mappen opgeslagen worden. Deze zijn ingesteld in het settings.php-bestand en weergegeven op de <a href=\":file-system\">Bestandssysteem-configuratiepagina</a>. Deze instelling kan later niet meer gewijzigd worden. De bestanden kunnen ook in een subdirectory van de publieke of private map opgeslagen worden. Deze instelling kan later wel aangepast worden en kan per subentiteit verschillen. Zie voor meer informatie over bestandsopslag de <a href=\":system-help\">System-module helppagina</a>.','nl',0),(7258,'Er zijn op dit moment geen stijlen beschikbaar. <a href=\":url\">Een nieuwe stijl toevoegen</a>.','nl',0),(7259,'Een waarde voor zowel de hoogte als de breedte moet in het veld @name worden opgegeven.','nl',0),(7260,'De primaire-ID van een afbeeldingsstijl.','nl',0),(7261,'Systeemnaam van de stijl.','nl',0),(7262,'Stijlnaam voor beheerders.','nl',0),(7263,'Voeg talen toe op de pagina <a href=\":language_list\">Talen</a> door op <em>Taal toevoegen</em> te klikken en een taal te kiezen uit de selectielijst. Deze taal wordt dan weergegeven in de lijst met talen, waar hij vervolgens verder ingesteld kan worden. Als de <a href=\":interface\">Interface translation-module</a> ingeschakeld is, en de <em>vertaalserver</em> is ingesteld als vertalingsbron, dan worden interfacevertalingen voor deze taal automatisch gedownload.','nl',0),(7264,'Inhoud wordt aangemaakt in de standaardtaal van de site. Er wordt geen taalkeuze weergegeven op de inhoud toevoegen-pagina. Op de pagina <a href=\":content_language\">Taal van de inhoud</a> kan de taalinstelling voor elk entiteitstype dat vertaling ondersteund ingesteld worden (bijvoorbeeld voor inhoudstypen of menu links). Na het kiezen van een entiteit, kan uit een keuzelijst de standaardtaal gekozen worden en met keuzevakjes de taalkeuze ingesteld worden.','nl',0),(7265,'Wanneer de Block-module ingeschakeld is, kan via  de pagina <a href=\":blocks\">Block-layout</a> een taalwisselblok toegevoegd worden waarmee gebruikers tussen talen kunnen wisselen.','nl',0),(7266,'Wanneer de Block-module ingeschakeld is maakt de Language-module het mogelijk de zichtbaarheid van een blok in te stellen op basis van ingestelde talen op de pagina <a href=\":blocks\">Block-layout</a>.','nl',0),(7267,'De pagina <a href=\":detection\">Detectie en selectie</a> voorziet in verschillende methodes om te bepalen in welke taal de interfacetekst weergegeven wordt. Als een methode een interfacetaal detecteert en selecteert, worden de daaropvolgende methodes in de lijst niet toegepast. Plaats de belangrijkste methode bovenaan de lijst, gevolgd door verschillende alternatieve methodes.','nl',0),(7268,'<em>Browser</em> baseert de interfacetaal op de taalinstelling van de browser. Aangezien browsers verschillende taalcodes gebruiken voor dezelfde taal, is het mogelijk taalcodes toe te voegen en te bewerken zodat de taalcodes van de verschillende browsers verwijzen naar de juiste <a href=\":language_list\">taalcodes</a> van de website.','nl',0),(7269,'Sorteer de beschikbare talen om de volgorde in de taalkeuze en in de lijst met beschikbare talen bij het bewerken van inhoud te bepalen. Deze sortering heeft geen invloed op <a href=\":detection\">detectie en selectie</a>.','nl',0),(7270,'De standaardtaal van de site kan ook ingesteld worden. Het is af te raden de standaardtaal van een werkende website te wijzigen. Stel de <a href=\":language-detection\">Geselecteerde taal</a>-methode op de detectie- en selectiepagina in om een fallback-taal in te stellen voor de taalselectie.','nl',0),(7271,'Stel in hoe bepaald wordt in welke taal paginaelementen getoond worden (voornamelijk teksten van modules, zoals veldlabels en helpteksten). Er worden een aantal detectiemethodes doorlopen; de eerste detectiemethode die een resultaat geeft bepaalt welke taal gebruikt wordt voor dat type tekst. Bedenk dat sommige taaldetectiemethodes onder bepaalde omstandigheden onbetrouwbaar zijn  (bijvoorbeeld browserdetectie als caching van pagina\'s ingeschakeld is en een gebruiker niet ingelogd is). Bepaal de volgorde van taaldetectiemethodes op deze pagina. De standaardtaal kan gewijzigd worden in de <a href=\":admin-change-language\">lijst met talen</a>.','nl',0),(7272,'Browsers gebruiken verschillende codes voor dezelfde talen. Op basis van de code die de browser stuurt wordt zo goed mogelijk de juiste taal bepaald. Wijs zelf aanvullende browser-taalcodes aan <a href=\":configure-languages\">talen</a> toe.','nl',0),(7273,'De eenvoudigste manier om de standaardwerking van de site te wijzigen (bijvoorbeeld bij een leeg URL-voorvoegsel of het standaarddomein), is door hier een taal te selecteren als fallback-taal. Plaats deze methode onderaan de selectie- en detectiemethodes. Het wijzigen van de <a href=\":admin-change-language\">standaardtaal van de site</a>  kan ongewenste effecten hebben.','nl',0),(7274,'Uitleg van de taalopties staat op de pagina <a href=\":languages_list_page\">Talen</a>.','nl',0),(7275,'Standaardtaal van de site (@language)','nl',0),(7276,'Gebruik een van de taalkeuzeblokken om gebruikers de mogelijkheid te geven om tussen talen te wisselen. De blokken zijn in te schakelen via de <a href=\":block-admin\">blokbeheerpagina</a>.','nl',0),(7277,'Gebruik voor uitwisselbaarheid de taalcodes zoals <a href=\":w3ctags\">gedefinieerd door de W3C</a>, <em>bijvoorbeeld: \"en\", \"en-gb\" en \"zh-hant\"</em>.','nl',0),(7278,'%field moet een valide taaltag zijn volgens de <a href=\":url\">definitie van het W3C</a>.','nl',0),(7279,'Het voorvoegsel mag alleen leeg gelaten worden bij de <a href=\":url\">geselecteerde detectie fallback-taal.</a>','nl',0),(7280,'De Link-module maakt het mogelijk velden te maken die interne of externe URLs en optionele linktekst bevatten. Zie voor meer informatie de online documentatie voor de <a href=\":link_documentation\">Link-module</a>. Zie voor meer informatie over het maken en beheren van velden de <a href=\":field\">Field-module helppagina\'s</a> en de <a href=\":field_ui\">Field UI-helppagina\'s</a>.','nl',0),(7281,'De <em>instellingen</em> en <em>weergave</em> van de link kunnen los van elkaar ingesteld worden. Zie voor meer informatie over het beheren en weergeven van velden de <a href=\":field_ui\">Field UI-helppagina\'s</a>.','nl',0),(7282,'Een vertalingsbestand kon niet gecontroleerd worden. Zie <a href=\":url\">de logberichten</a> voor meer informatie.@count vertalingsbestanden konden niet gecontroleerd worden. Zie <a href=\":url\">de logberichten</a> voor meer informatie.','nl',0),(7283,'@message (@percent%).','nl',0),(7284,'Een vertalingsbestand kon niet geïmporteerd worden. Zie <a href=\":url\">de logberichten</a> voor meer informatie.@count vertalingsbestanden konden niet geïmporteerd worden. Zie <a href=\":url\">de logberichten</a> voormeer informatie.','nl',0),(7285,'Eén vertaling bevat ongeldige HTML en is daarom overgeslagen. Zie voor meer informatie de <a href=\":url\">logberichten</a>. @count vertalingen bevatten ongeldige HTML en zijn daarom overgeslagen. Zie voor meer informatie de <a href=\":url\">logberichten</a>.','nl',0),(7286,'De Interface Translation-module maakt het mogelijk om interfacetekst (<em>tekenreeksen</em>) in verschillende talen te vertalen en om er tussen te wisselen voor het weergeven van interfacetekst. Het gebruikt de functionaliteit van de <a href=\":language\">Language-module</a>. Zie voor meer informatie de <a href=\":doc-url\">online documentatie voor de Interface Translation-module</a>.','nl',0),(7287,'Vertalingsbestanden met vertaalde interfacetekst worden automatisch geïmporteerd als talen toegevoegd worden op de pagina <a href=\":languages\">Talen</a>, of als modules of thema\'s ingeschakeld worden. Op de pagina <a href=\":locale-settings\">Instellingen interfacevertaling</a>, kan de <em>Vertalingsbron</em> beperkt worden tot lokale bestanden, of uitgebreid worden met vertalingen van de <a href=\":server\">Drupal vertalingserver</a>. Hoewel modules en thema\'s niet in alle talen volledig vertaald zijn, komen er regelmatig nieuwe vertalingen beschikbaar. Geef aan óf en hoe vaak er gecontroleerd wordt op bijgewerkte vertalingen, en of de bestaande vertalingen overschreven moeten worden op de pagina <a href=\":locale-settings\">Instellingen interfacevertaling</a>. Op de pagina <a href=\":import\">Interfacevertaling importeren</a> kunnen vertalingen handmatig geïmporteerd worden.','nl',0),(7288,'U kunt kijken hoeveel van de interface van de site is vertaald naar welke taal op de pagina <a href=\":languages\">Talen</a>. Op de pagina <a href=\":translation-updates\">Beschikbare vertalingsupdates</a>, kunt u nagaan of er interfacevertalingsupdates beschikbaar zijn op de <a href=\":server\">Drupal vertaalserver</a>.','nl',0),(7289,'Individuele tekenreeksen kunt u rechtstreeks vertalen op de pagina <a href=\":translate\">Gebruikersinterface vertalen</a>, of download het meest recente vertalingsbestand voor een specifieke taal op de pagina <a href=\":export\">Interface vertalen export</a>. Nadat u het vertalingsbestand heeft aangepast, kunt u het opnieuw importeren op de pagina <a href=\":import\">Interface vertalen import</a>.','nl',0),(7290,'Interface-vertalingen worden automatisch geïmporteerd wanneer een taal wordt toegevoegd, of wanneer nieuwe modules of thema\'s worden ingeschakeld. Het rapport <a href=\":update\">Beschikbare vertalingsupdates</a> toont de status. Interface-tekst kan via de pagina <a href=\":translate\">Gebruikersinterface vertalen</a> aangepast worden.','nl',0),(7291,'Op deze pagina kan naar specifieke vertaalde of onvertaalde teksten worden gezocht, en kunnen vertalingen worden toegevoegd of bewerkt. (Opmerking: omdat bij vertalen veel teksten bewerkt worden, is het wellicht gebruiksvriendelijker om de teksten te <a title=\"Gebruikersinterfacevertaling exporteren\" href=\":export\">exporteren</a> en ze offline te bewerken in een vertaalprogramma voor Gettext-bestanden.) Zoekopdrachten kunnen beperkt worden tot teksten in een specifieke taal.','nl',0),(7292,'Vertaalbestanden worden automatisch gedownload en geïmporteerd wanneer <a title=\"Languages\" href=\":language\">talen</a> toegevoegd worden, of wanneer modules of thema\'s ingeschakeld worden','nl',0),(7293,'Op deze pagina kunnen handmatig vertaalde teksten, opgeslagen als Gettext Portable Object (.po), worden geïmporteerd. Handmatige import kan worden gebruikt voor aangepaste vertalingen, of voor de vertaling van eigen modules en thema\'s. Om vertalingen aan te passen kan een bestand worden gedownload van de <a href=\":url\">Drupal vertalingserver</a> of worden <a title=\"Gebruikersinterfacevertaling export\" href=\":export\">geëxporteerd</a> van de site, aangepast met een Gettext vertaalprogramma, en weer geïmporteerd op deze pagina.','nl',0),(7294,'Updates beschikbaar voor: @languages. Zie voor meer informatie de pagina <a href=\":updates\">Beschikbare vertalings-updates</a>.','nl',0),(7295,'Ontbrekende vertalingen voor: @languages. Zie voor meer informatie de pagina <a href=\":updates\">Beschikbare vertalings-updates</a>.','nl',0),(7296,'Geen vertalingsstatus beschikbaar. Zie voor meer informatie de pagina <a href=\":updates\">Beschikbare vertalings-updates</a>.','nl',0),(7297,'Instellingen interface-vertaling','nl',0),(7298,'Interface-vertaling importeren','nl',0),(7299,'Interface-vertaling exporteren','nl',0),(7300,'Selecteer hoe vaak er gecontroleerd moet worden op nieuwe vertalingen voor geïnstalleerde modules en thema\'s. <a href=\":url\">Nu controleren</a>.','nl',0),(7301,'Vertalingsbestanden worden lokaal opgeslagen in de map %path. Dit kan gewijzigd worden op de <a href=\":url\">Bestandssysteem</a>-instellingenpagina.','nl',0),(7302,'Vertalingsbestanden worden niet lokaal opgeslagen. Wijzig de map voor interface-vertalingen op de <a href=\":url\">Bestandssysteem</a>-instellingenpagina.','nl',0),(7303,'De lokale vertalingsbron is geselecteerd, maar er is geen <a href=\":url\">map voor interface-vertalingen</a> ingesteld.','nl',0),(7304,'Er zijn geen vertaalbare talen beschikbaar. <a href=\":add_language\">Voeg eerst een taal toe</a>.','nl',0),(7305,'Vertaalstatus niet beschikbaar. <a href=\":check\">Handmatig controleren</a>.','nl',0),(7306,'Vereist voor de Menu UI-module, die een interface biedt om menu\'s en menulinks te beheren. Zie voor meer informatie de online helppagina voor de <a href=\":menu-help\">Menu UI-module</a> en de <a href=\":drupal-org-help\">Custom Menu Links-module</a>.','nl',0),(7307,'Zie voor meer informatie de online documentatie voor de <a href=\":drupal-org-help\">Custom Menu Links-module</a>. Als de Menu UI-module ingeschakeld wordt, biedt deze een interface om menu\'s en menulinks te beheren.','nl',0),(7308,'De Menu UI-module biedt een interface om menu\'s te beheren. Een menu is een hiërarchische verzameling interne of externe links en wordt gebruikt voor navigatie. Zie voor meer informatie de online documentatie voor de <a href=\":menu\">Menu UI-module</a>.','nl',0),(7309,'Gebruikers met de permissie <em>Menu\'s en menu-items beheren</em> kunnen menu\'s toevoegen, bewerken en verwijderen op de pagina <a href=\":menu\">Menu\'s</a>. Aangepaste menu\'s kunnen sitemenu\'s, menu\'s met externe links, of elke combinatie van interne en externe links bevatten. Er kan een ongelimiteerd aantal menu\'s toegevoegd worden, met elk een eigen blok (als de <a href=\":block_help\">Block-module</a> ingeschakeld is). Klik op <em>Menu bewerken</em>, om links in een menu toe te voegen, te bewerken of te verwijderen. Op de pagina met de lijst met links kan door slepen en neerzetten de volgorde van links en de hiërarchie in het menu bepaald worden.','nl',0),(7310,'Wanneer de Blok-module ingeschakeld is, komt ieder menu dat is aangemaakt beschikbaar in een blok dat te plaatsen en in te stellen is op de <a href=\":blocks\">Blok-layoutpagina</a>. Bij bepaalde <a href=\":themes\">thema\'s</a>, wordt het hoofdmenu en soms een secundair menu automatisch weergegeven; dit is mogelijk uit te schakelen op de <a href=\":themes\">Thema-instellingenpagina</a>.','nl',0),(7311,'Het voor dit menu nieuw aangemaakte blok kunt u aanzetten op de <a href=\":blocks\">Blok-layoutpagina</a>.','nl',0),(7312,'Elk menu heeft een overeenkomstig blok dat beheerd kan worden op de <a href=\":blocks\">Block-layoutpagina</a>.','nl',0),(7313,'Er zijn nog geen menulinks. <a href=\":url\">Link toevoegen</a>.','nl',0),(7314,'De Migrate-module levert een framework om data te migreren, gewoonlijk van een externe bron naar de site. De module biedt geen gebruiksinterface. Zie voor meer informatie de online documentatie van de <a href=\":migrate\">Migrate-module</a>.','nl',0),(7315,'Ongeldige PHP memory_limit @limit, ingesteld op onbeperkt.','nl',0),(7316,'Migratie mislukt met bronplugin-uitzondering: @e','nl',0),(7317,'Geheugengebruik is @usage (@pct% van maximaal @limit), geheugen terugwinnen.','nl',0),(7318,'Geheugengebruik is nu @usage (@pct% van maximaal @limit), niet genoeg teruggewonnen, nieuwe batch wordt gestart.','nl',0),(7319,'Geheugengebruik is nu @usage (@pct% van maximaal @limit), genoeg teruggewonnen, doorgaan.','nl',0),(7320,'De Migrate-module voorziet in een framework gebaseerd op de <a href=\":migrate\">Migrate-module</a> om migraties van een Drupal website (6, 7, of 8) naar uw website te doen. Er is geen gebruikersinterface aanwezig. Zie voor meer informatie de <a href=\":migrate_drupal\">online documentatie voor de Migrate-module</a>.','nl',0),(7321,'De toegangsrechten moeten opnieuw worden opgebouwd. <a href=\":node_access_rebuild\">Toegangsrechten opnieuw samenstellen</a>.','nl',0),(7322,'De Node-module beheert het maken, bewerken, verwijderen, instellen en weergen van de inhoud van de site. Inhoudsitems beheerd door de Node-module worden gewoonlijk weergegeven als pagina\'s in de site, en bestaan uit een titel, metadata (auteur, tijdstip van aanmaak, inhoudstype, enz.) en optionele velden die tekst of andere gegevens bevatten (velden worden beheerd door de <a href=\":field\">Field-module</a>). Zie voor meer informatie de online documentatie voor de <a href=\":node\">Node-module</a>.','nl',0),(7323,'Als nieuwe inhoud wordt toegevoegd, slaat de Node-module basisinformatie over de inhoud op, waaronder de auteur, tijdstip van aanmaak en het <a href=\":content-type\">inhoudstype</a>. De module beheert ook de <em>publicatieopties</em>, die bepalen of inhoud al dan niet gepubliceerd is, op de voorpagina weergegeven wordt, en/of bovenaan lijsten van inhoudsitems geplaatst wordt. Standaardinstellingen kunnen voor elk <a href=\":content-type\">inhoudstype</a> afzonderlijk ingesteld worden.','nl',0),(7324,'De Node-module geeft gebruikers met het toegangsrecht <em>Inhoudstypes beheren</em> de mogelijkheid om <a href=\":content-new\">nieuwe inhoudstypes toe te voegen</a>. Het aanmaken van aangepaste inhoudstypes geeft de flexibiliteit om <a href=\":field\">velden</a> en instellingen zo goed mogelijk af te stemmen op verschillende soorten inhoud.','nl',0),(7325,'De pagina <a href=\":content\">Inhoud</a> bevat een lijst met bestaande inhoud, met de mogelijkheid om deze te filteren, bewerken of verwijderen. Er kunnen bulk-acties op inhoud van deze lijst uitgevoerd worden, en er kan nieuwe inhoud toegevoegd worden.','nl',0),(7326,'De Node-module stelt voor elk inhoudstype een aantal toegangsrechten beschikbaar, die per rol ingesteld kunnen worden op de pagina <a href=\":permissions\">Toegangsrechten</a>.','nl',0),(7327,'Bij problemen met toegangsrechten kan het zinvol zijn de toegangsrechten-cache opnieuw samen te stellen. Hierbij worden alle toegangsrechten op inhoud verwijderd, en vervangen door toegangsrechten gebaseerd op de huidige modules en instellingen. Als er veel inhoud is, of ingewikkelde instellingen voor toegangsrechten zijn, kan het genereren even duren. Hierna zal de inhoud automatisch de nieuwe toegangsrechten gebruiken. <a href=\":rebuild\">Toegangsrechten opnieuw samenstellen</a>','nl',0),(7328,'Beschikbare inhoudstypes en bijbehorende velden behouden.','nl',0),(7329,'Deze tekst wordt weergegeven op de pagina <em>inhoud toevoegen</em>.','nl',0),(7330,'Er zijn geen inhoudstypen aanwezig. <a href=\":link\">Inhoudstype toevoegen</a>.','nl',0),(7331,'Node vanuit URL','nl',0),(7332,'De Options-module maakt het mogelijk de gebruiker te laten kiezen uit een vastgestelde lijst met mogelijkheden. Gewoonlijk wordt de lijst weergegeven als een keuzelijst, als keuzerondjes of als keuzevakjes. Zie voor meer informatie over velden en het beheren ervan de hulppagina\'s voor de <a href=\":field\">Field-module</a> en de <a href=\":field_ui\">Field UI</a>. Zie voor meer informatie over deze module de online documentatie van de <a href=\":options_do\">Options-module</a>.','nl',0),(7333,'De <em>instellingen</em> en de <em>weergave</em> van het lijstveld kunnen afzonderlijk ingesteld worden. Zie voor meer informatie over het beheren en weergeven van velden de <a href=\":field_ui\">Field UI-hulp</a>.','nl',0),(7334,'De Internal Page Cache-module levert caching van pagina\'s voor anonieme gebruikers in de database. Zie voor meer informatie de online documentatie voor de <a href=\":pagecache-documentation\">Internal Page Cache-module</a>.','nl',0),(7335,'Pagina\'s zijn gewoonlijk gelijk voor alle anonieme gebruikers, terwijl ze gepersonaliseerd kunnen worden voor een aangemelde gebruiker. Daarom kunnen voor anonieme gebruikers volledige pagina\'s gecached worden, terwijl ze voor aangemelde gebruikers opnieuw opgebouwd moeten worden.','nl',0),(7336,'Zie om de site sneller te maken voor aangemelde gebruikers de <a href=\":dynamic_page_cache-help\">Dynamic Page Cache-module</a>.','nl',0),(7337,'Op de pagina <a href=\":cache-settings\">Prestatie-instellingen</a>, kan ingesteld worden hoe lang browsers en proxies pagina\'s mogen cachen. Deze instelling wordt ook gebruikt door de Internal Page Cache-module. Er zijn geen andere instellingen.','nl',0),(7338,'Pagina\'s cachen voor anonieme gebruikers. Gebruik deze module als er geen externe pagina-cache beschikbaar is.','nl',0),(7339,'De Path-module maakt het mogelijk voor elk bestaand intern pad een alias, of aangepaste URL, in te stellen. Een alias mag niet verward worden met een URL-doorverwijzing, die een inactieve of gewijzigde URL doorverwijst naar een nieuwe URL. Behalve dat URL\'s beter leesbaar worden door een alias, zorgen ze er ook voor dat zoekmachines de inhoud beter indexeren. Er kunnen meerdere aliassen naar hetzelfde interne systeempad verwijzen. Om het maken van aliassen te automatiseren, kan de uitbreidingsmodule <a href=\":pathauto\">Pathauto</a> geïnstalleerd worden. Zie voor meer informatie de online documentatie voor de <a href=\":path\">Path-module</a>.','nl',0),(7340,'Voeg, bij het aanmaken of bewerken van een taxonomieterm, een alias toe in het veld \'URL-alias\' (bijvoorbeeld <em>muziek/jazz</em>). Voeg, bij het aanmaken of bewerken van inhoud, een alias toe in het onderdeel \'URL-pad instellingen\' in het veld \'URL-alias\' (bijvoorbeeld <em>over-ons/team</em>). Voeg aliassen voor alle andere paden toe op de pagina <a href=\":aliases\">URL-aliassen</a>. Hiervoor moet een gebruiker het toegangsrecht <a href=\":permissions\">\r\nURL-aliassen aanmaken en bewerken</a> hebben.','nl',0),(7341,'De Path-module biedt een manier om een <a href=\":aliases\">lijst van alle aliassen</a> die op de site worden gebruikt te bekijken en te doorzoeken. Vanuit deze lijst kunnen aliassen toegevoegd, bewerkt en verwijderd worden.','nl',0),(7342,'Geen URL-aliassen beschikbaar. <a href=\":link\">URL-alias toevoegen</a>.','nl',0),(7343,'Het interne systeempad.','nl',0),(7344,'De pad-alias.','nl',0),(7345,'De Quick Edit-module stelt gebruikers met de toegangsrechten <a href=\":quickedit_permission\">Toegang tot in-place bewerken</a> en <a href=\":contextual_permission\">Contextuele links gebruiken</a> in staat om de inhoud van velden te bewerken zonder daarvoor een aparte pagina te bezoeken. Zie voor meer informatie de online documentatie voor de <a href=\":handbook_url\">Quick Edit-module</a>.','nl',0),(7346,'Om inhoud in-place te bewerken, moet de Snel bewerken-modus voor een inhoudsitem ingeschakeld worden. Schakel de Snel bewerken-modus in door Snel bewerken te kiezen in de contextuele links van het gebied waarin de inhoud weergegeven wordt. Zie voor meer informatie over het gebruiken van contextuele links de hulppagina voor de <a href=\":contextual\">Contextual Links-module</a>.','nl',0),(7347,'Bij het aanmaken van responsive afbeeldingen dienen de opties gedefinieerd te worden die de browser heeft om te selecteren welke afbeelding getoond dient te worden. In de meeste gevallen betekent dit dat er verschillende afbeeldingsformaten opgegeven worden gebaseerd op de afmeting van de viewport. Klik op <em>Responsive afbeeldingsstijl toevoegen</em> op de <a href=\":responsive_image_style\">Responsive afbeeldingsstijlen</a> pagina om een nieuwe stijl toe te voegen. Kies een label, een afbeeldingsstijl-fallback en een breakpoint groep en klik op Opslaan.','nl',0),(7348,'Onder het veld Afmetingen kunnen meerdere afbeeldingsstijlen gekozen worden, zodat de browser de afmetingen kan kiezen die het best de ruimte opvullen zoals die is opgegeven in het veld Afmetingen. Meestal worden hier afbeeldingsstijlen gebruikt die de afbeelding schalen op een reeks afmetingen die overeenkomen met het kleinst aantal pixels tot het grootst aantal pixels waarop de afbeelding mogelijkerwijs wordt getoond, met een variatie aan breedtes ertussenin. Het is gebruikelijk om afbeeldingsstijlen op te geven die 1,5x tot 2x de beschikbare ruimte van het ontwerp zijn om rekening te houden met hoge-resolutie schermen. Afbeeldingsstijlen kunnen worden gedefinieerd op de <a href=\":image_styles\">Afbeeldingsstijlen pagina</a> die wordt geleverd door de <a href=\":image_help\">Image-module</a>.','nl',0),(7349,'Nadat responsive afbeeldingsstijlen zijn gedefinieerd kunnen deze gebruikt worden in de weergave-instellingen voor velden van het type Afbeelding, zodat de site de responsive afbeeldingen toont middels de HTML5 picture tag. Open de \'Weergave beheren\'-pagina van het type entiteit (inhoudstype, woordenlijst, etc.) waar het veld Afbeelding aan verbonden is. Kies het formaat <em>Responsive afbeelding</em>, klik op het Bewerken icoon, en selecteer één van de aangemaakte responsive afbeeldingsstijlen. Zie de <a href=\":field_ui\">Field UI-module hulppagina</a> voor algemene informatie over hoe velden en hun weergave beheerd kunnen worden. Zie de <a href=\":field_help\">Field-module hulppagina</a> voor achtergrondinformatie over entiteiten en velden.','nl',0),(7350,'Responsive Image-stijlen configureren','nl',0),(7351,'De RESTful Web Services-module biedt een framework voor het beschikbaar maken van REST-resources op de website. Het biedt ondersteuning voor inhoudentiteiten (zie de <a href=\":field\">helppagina van de Field-module</a> voor meer informatie over entiteiten) zoals reacties, gebruikers en taxonomietermen. REST-ondersteuning voor inhoud van de Node-module is standaard beschikbaar. Ondersteuning voor andere soorten inhoud kan worden ingeschakeld. Uitbreidingsmodules kunnen ondersteuning bieden voor andere soorten REST-resources. Zie voor meer informatie de <a href=\":rest\">on-line documentation voor de RESTful Web Services-module</a>.','nl',0),(7352,'Om REST op een website te kunnen gebruiken, dienen modules voor serialisatie en authenticatie ingeschakeld te worden. Hiervoor kunnen de core-modules <a href=\":hal\">HAL</a> voor serialisatie en <a href=\":basic_auth\">HTTP Basic Authentication</a> voor authenticatie worden gebruikt. Er kunnen ook uitbreidingsmodules of maatwerkmodules worden gebruikt.','nl',0),(7353,'REST-ondersteuning voor inhoud van de Node-module is standaard beschikbaar. Ondersteuning voor andere soorten inhoud kan worden ingeschakeld door <a href=\":config\">configuratiebestanden te bewerken</a> of door gebruik te maken van de <a href=\":restui\">Rest UI</a>-uitbreidingsmodule.','nl',0),(7354,'De Search-module maakt het mogelijk zoekpagina\'s te maken met behulp van plugins van andere modules. Drupal-core levert twee zoekpagina-plugins: de Inhoud-plugin biedt zoeken op trefwoord in inhoud beheerd door de Node-module. De Gebruikers-plugin biedt zoeken naar geregistreerde gebruikers. Voeg andere zoekpagina-plugins toe door uitbreidingsmodules te installeren. Zie voor meer informatie de online documentatie voor de <a href=\":search-module\">Search-module</a>.','nl',0),(7355,'Stel zoekpagina\'s in op de pagina <a href=\":search-settings\">Zoekpagina\'s</a>. In het onderdeel Zoekpagina\'s kunnen nieuwe zoekpagina\'s worden toegevoegd, de instellingen van bestaande zoekpagina\'s worden bewerkt, zoekpagina\'s worden in- en uitgeschakeld, en kan de standaard zoekpagina worden gekozen. Elke ingeschakelde zoekpagina heeft een URL-pad dat begint met <em>search</em>, en wordt getoond als een tab of lokale taak-link op de pagina <a href=\":search-url\">Zoeken</a>. De tekst die in de tab getoond wordt kan worden aangepast. Sommige zoekpagina-plugins hebben aanvullende instellingen die voor elke zoekpagina kunnen worden aangepast.','nl',0),(7356,'Sommige zoekpagina-plugins, zoals de Inhoud-zoekpagina in core, maken  gebruik van de zoekindex van Drupal-core, en zullen niet werken tenzij de inhoud geïndexeerd is. Het indexeren gebeurt tijdens de <em>cron-uitvoering</em>, dus er moet een <a href=\":cron\">Cron-onderhoudstaak</a> ingesteld zijn. Instellingen die van invloed zijn op het indexeren, aanpasbaar op de pagina <a href=\":search-settings\">Zoekpagina\'s</a>, zijn onder andere: het aantal items dat per cron-uitvoering moet worden geïndexeerd, de minimale woordlengte, en hoe omgegaan wordt met Chinese-, Japanese-, and Koreaanse tekens.','nl',0),(7357,'… @excerpt … @excerpt …','nl',0),(7358,'Deze module heeft geen gebruikersinterface. De module wordt gebruikt door andere modules om data te serialiseren zoals de <a href=\":rest\">REST-module</a>.','nl',0),(7359,'Met de Shortcut-module kunnen gebruikers sets van <em>snelkoppelingen</em> naar veelgebruikte pagina\'s samenstellen. Snelkoppelingen worden gegroepeerd in <em>snelkoppelingsets</em>. Iedere gebruiker met toegangsrechten <em>Selecteer elke snelkoppelingset</em> kan voor eigen gebruik een snelkoppelingset van een andere gebruiker selecteren. Lees voor meer informatie de online documentatie over de <a href=\":shortcut\">Shortcut-module</a>.','nl',0),(7360,'Gebruikers met toegangsrechten <em>Snelkoppelingen beheren</em> kunnen snelkoppelingsets en snelkoppelingen binnen sets beheren op de pagina <a href=\":shortcuts\">Snelkoppelingenbeheer</a>.','nl',0),(7361,'Geef aan welke snelkoppelingen u gebruikt op de tab <a href=\":shortcut-link\">Snelkoppelingen</a> van uw gebruikerspagina.','nl',0),(7362,'Geen snelkoppelingen beschikbaar. <a href=\":link\">Snelkoppeling toevoegen</a>','nl',0),(7363,'De link voor deze snelkoppeling.','nl',0),(7364,'De titel voor deze snelkoppeling.','nl',0),(7365,'Het gewicht voor deze snelkoppeling.','nl',0),(7366,'De titel van de set.','nl',0),(7367,'Het users.uid van deze set.','nl',0),(7368,'De module bevat een blok <em>Populaire inhoud</em> dat de meest bekeken pagina\'s (van vandaag en van altijd) en de laatst bekeken inhoud weergeeft. Om het blok in te schakelen, kiest u <em>Inhoudsweergaves tellen</em> op de pagina <a href=\":statistics-settings\">Statistieken</a>. Daarna kunt u het blok configureren en inschakelen op de pagina <a href=\":blocks\">Block-layout</a>.','nl',0),(7369,'De Statistics-module bevat een teller voor iedere pagina die wordt opgehoogd wanneer de pagina wordt bekeken. Schakel <em>Tel aantal maal dat de inhoud wordt bekeken<em> in op de pagina <a href=\":statistics-settings\">Statistieken</a> om deze teller te gebruiken en stel de benodigde <a href=\":permissions\">toegangsrechten</a> in (<em>Zien hoe vaak content bekeken is</em>), zodat de teller zichtbaar is voor de gebruikers.','nl',0),(7370,'Versie: @module-version','nl',0),(7371,'Vereist: @module-list','nl',0),(7372,'Vereist door: @module-list','nl',0),(7373,'Dit thema vereist PHP versie @php_required en is niet compatibel met PHP versie @php_version.','nl',0),(7374,'Selecteer het standaardthema voor de website en stel deze in. Er zijn alternatieve <a href=\":themes\">thema\'s</a> beschikbaar.','nl',0),(7375,'Blokken kunnen op de pagina <a href=\":blocks\">Blok-layout</a> voor ieder thema geplaatst worden.','nl',0),(7376,'Download extra <a href=\":modules\">uitbreidingsmodules</a> om de functionaliteit van de website uit te breiden.','nl',0),(7377,'<a href=\":user-edit\">Account-tijdzone</a> instellen.','nl',0),(7378,'De minimaal benodigde versie van Apache om Drupal zonder mod_rewrite te draaien is 2.2.16. Bekijk de pagina <a href=\":link\">gebruiksvriendelijke URL\'s inschakelen</a> voor meer informatie over mod_rewrite.','nl',0),(7379,'Uw server kan gebruiksvriendelijke URLs gebruiken, maar dit is niet ingeschakeld. Omdat dit de gebruikservaring verbetert, raden we aan om <a href=\":link\">gebruiksvriendelijke URLs in te schakelen</a>.','nl',0),(7380,'@phpversion (<a href=\":url\">meer informatie</a>)','nl',0),(7381,'Drupal vereist dat u de PHP-extensies uit de volgende lijst activeert (kijk op de pagina met <a href=\":system_requirements\">systeemvereisten</a> voor meer informatie):','nl',0),(7382,'PHP OPcode caching','nl',0),(7383,'Zie voor meer informatie het online handboek voor <a href=\":memory-limit\">het verhogen van de PHP-geheugenlimiet</a>.','nl',0),(7384,'Zie <a href=\":url\">@url</a> voor meer informatie over het aanbevolen .htaccess-bestand dat moet worden toegevoegd aan de map %directory om bescherming te bieden tegen het uitvoeren van willekeurige code.','nl',0),(7385,'Voor het laatst @time geleden uitgevoerd','nl',0),(7386,'Zie voor meer informatie het online handboek met informatie over het <a href=\":cron-handbook\">configureren van cron taken</a>.','nl',0),(7387,'U kunt <a href=\":cron\">cron handmatig uitvoeren</a>.','nl',0),(7388,'Om cron voor deze website van buitenaf uit te voeren, ga naar <a href=\":url\">@cron</a>.','nl',0),(7389,'Zorg dat u de juiste map instelt op de pagina <a href=\":admin-file-system\">bestandssysteeminstellingen</a> of wijzig de toegangsrechten van de map zodat deze schrijfbaar is.','nl',0),(7390,'Voor enkele modules moet de database worden bijgewerkt. U moet direct het <a href=\":update\">database-updatescript</a> uitvoeren.','nl',0),(7391,'Update-meldingen zijn niet ingeschakeld. Het wordt <strong>sterk aangeraden</strong> dat u de update-manager-module inschakelt vanaf de <a href=\":module\">module-beheerpagina</a> om zo up-to-date te blijven. Bekijk voor meer informatie de <a href=\":update\">Update-status handboek-pagina</a>.','nl',0),(7392,'De Block-module is niet ingeschakeld waardoor branding-elementen die naar een blok zijn omgezet niet meer zichtbaar zijn.','nl',0),(7393,'Omdat aangepaste thema\'s geïnstalleerd zijn op de website is het branding-blok in het inhoudsgedeelte geplaatst. Gelieve handmatig de blokinstellingen te herzien en de variabelen voor de websitenaam, slogan en logo uit de templates te verwijderen.','nl',0),(7394,'De Block-module is niet ingeschakeld. De paginatitel was omgezet naar een blok, maar standaard paginatitelopmaak blijft zichtbaar aan de bovenkant van het hoofdcontentgedeelte.','nl',0),(7395,'Omdat aangepaste thema\'s geïnstalleerd zijn op de website is het titelblok in het inhoudsgedeelte geplaatst. Gelieve handmatig de blokinstellingen te herzien en de variabelen voor de paginatitel uit de pagina-templates te verwijderen.','nl',0),(7396,'De website in <a href=\":url\">onderhoudsmodus</a> zetten.','nl',0),(7397,'Alle fouten zijn <a href=\":url\">gelogd</a>.','nl',0),(7398,'Schermafbeelding voor thema @theme','nl',0),(7399,'Instellingen voor thema @theme','nl',0),(7400,'Thema @theme deïnstalleren','nl',0),(7401,'@theme als standaardthema gebruiken','nl',0),(7402,'@theme-thema installeren','nl',0),(7403,'@theme als standaardthema installeren','nl',0),(7404,'Ga naar <a href=\":cron\">@cron</a> om cron voor deze website van buitenaf uit te voeren.','nl',0),(7405,'Deze versie is niet compatibel met Drupal @core_version en moet worden vervangen.','nl',0),(7406,'Deze module vereist PHP versie @php_required en is incompatibel met PHP versie @php_version.','nl',0),(7407,'Geconfigureerd op de pagina <a href=\":appearance\">Uiterlijk-instellingen</a> of <a href=\":theme\">Thema-instellingen</a>.','nl',0),(7408,'Geconfigureerd op de pagina <a href=\":information\">Website-informatie</a>.','nl',0),(7409,'Gebouwd met <a href=\":poweredby\">Drupal</a>','nl',0),(7410,'Installatietaken','nl',0),(7411,'De Taxonomy-module geeft gebruikers met de rechten om inhoud aan te maken en te wijzigen de mogelijkheid om de inhoud van dat type te categoriseren (labelen). Gebruikers met het <a href=\":permissions\" title=\"Taxonomy-module rechten\">toegangsrecht</a> <em>Woordenlijsten en termen beheren</em> kunnen <em>woordenlijsten</em> toevoegen met een lijst gerelateerde <em>termen</em>. De termen in een woordenlijst kunnen vooraf worden ingesteld door een beheerder, of geleidelijk worden opgebouwd gedurende het toevoegen of wijzigen van inhoud. Termen kunnen indien gewenst hiërarchisch worden georganiseerd.','nl',0),(7412,'Bekijk voor meer informatie de <a href=\":taxonomy\">online documentatie voor de Taxonomy-module</a>.','nl',0),(7413,'Geen woordenlijst beschikbaar. <a href=\":link\">Voeg woordenlijst toe</a>.','nl',0),(7414,'Opmaak van de termbeschrijving.','nl',0),(7415,'Verantwoordelijke module voor de woordenlijst.','nl',0),(7416,'De Telephone-module stelt u in staat velden aan te maken die telefoonnummers bevatten. Zie voor algemene informatie de <a href=\":field\">Field-module help</a> en de <a href=\":field_ui\">Field UI help</a>-pagina\'s over velden en hoe deze aan te maken en te beheren.\r\nZie voor meer informatie de <a href=\":telephone_documentation\">online documentatie van de Telephone-module</a>.','nl',0),(7417,'De <em>instellingen</em> en de <em>weergave-instellingen</em> van het telefoonnummer-veld kunnen apart geconfigureerd worden. Zie voor meer informatie over hoe velden en hun weergave beheerd kunnen worden de pagina <a href=\":field_ui\">Field UI help</a>.','nl',0),(7418,'Als u kiest voor <em>Tekst (plat)</em> of <em>Tekst (plat, lang)</em>, dan beperkt u de invoer tot <em>Platte tekst</em>. Kiest u voor <em>Tekst (opgemaakt)</em>, <em>Tekst (opgemaakt, lang)</em> of <em>Tekst (opgemaakt, lang, met samenvatting)</em>, dan kunnen gebruikers opgemaakte tekst schrijven. Welke opties beschikbaar zijn voor individuele gebruikers hangt af van de instellingen op de pagina <a href=\":formats\">Tekstopmaak en editors</a>.','nl',0),(7419,'Aantal rijen in samenvatting: @rows','nl',0),(7420,'De Toolbar-module biedt een werkbalk voor beheerders. Deze toont tabbladen en bladen van de Toolbar-module en van andere modules. Zie voor meer informatie de <a href=\":toolbar_docs\">online documentatie van de Toolbar-module</a>.','nl',0),(7421,'De Tour-module biedt gebruikers een rondleiding in de websiteinterface. Elke rondleiding bestaat uit diverse tips die elementen van de gebruikersinterface uitlichten, de gebruiker door een workflow leiden, of belangrijke concepten van de website uitleggen. Zie voor meer informatie de <a href=\':tour\'>online documentatie voor de Tour-module</a>','nl',0),(7422,'Rondleidingen kunnen met een teksteditor als YAML-document worden geschreven, of door de <a href=\":tour_ui\">Tour UI</a>-module te gebruiken. Zie voor meer informatie de <a href=\":doc_url\">online documentatie voor het schrijven van rondleidingen</a>.','nl',0),(7423,'@tour_item van @total','nl',0),(7424,'Een binaire waarde die aangeeft of de node is gepubliceerd.','nl',0),(7425,'Het tijdstip waarop voor het laatst de inhoud werd opgeslagen of op de inhoud werd gereageerd.','nl',0),(7426,'De {users}.uid van de node- of reactie-auteur.','nl',0),(7427,'Het tijdstip waarop voor het laatst de gebruiker werd opgeslagen of op de gebruiker werd gereageerd.','nl',0),(7428,'De server ondersteunt het bijwerken van modules en thema\'s via deze interface niet. Werk modules en thema\'s bij door nieuwe versies direct naar de server te uploaden, zoals beschreven in het <a href=\":handbook_url\">handboek</a>.','nl',0),(7429,'De server ondersteunt het installeren van modules en thema\'s via deze interface niet. Installeer modules en thema\'s door deze direct naar de server te uploaden, zoals beschreven in het <a href=\":handbook_url\">handboek</a>.','nl',0),(7430,'Gedeïnstalleerde modules','nl',0),(7431,'Gedeïnstalleerde thema\'s','nl',0),(7432,'Het is mogelijk om op dezelfde wijze nieuwe modules en thema\'s te installeren. Dit kan via de <a href=\":install\">installatiepagina</a>, of via de link <em>Installeer nieuwe module/thema</em> bovenaan de <a href=\":modules_page\">module-</a> en <a href=\":themes_page\">thema-</a>pagina\'s. In dit geval zal gevraagd worden om ofwel de download-URL op te geven, of om een ingepakt releasebestand vanaf uw eigen computer te uploaden.','nl',0),(7433,'Bekijk en installeer regelmatig <a href=\":updates\">beschikbare updates</a> om de website veilig en up-to-date te houden. Voer altijd het <a href=\":update-php\">updatescript</a> uit nadat een nieuwere versie van een module is geïnstalleerd.','nl',0),(7434,'Bekijk regelmatig de <a href=\":updates\">beschikbare updates</a> om de site veilig en actueel te houden. Draai altijd het <a href=\":update-php\">updatescript</a> wanneer een module is geüpdated.','nl',0),(7435,'Geen update-informatie beschikbaar. <a href=\":run_cron\">Voer cron uit</a> of <a href=\":check_manually\">controleer handmatig</a>.','nl',0),(7436,'Nieuwe uitgave(s) beschikbaar voor @site_name','nl',0),(7437,'De website is ingesteld om deze e-mails te versturen wanneer er updates beschikbaar zijn. Om alleen van beveiligingsupdates op de hoogte gesteld te worden, klik hier @url.','nl',0),(7438,'De website is ingesteld om deze e-mails alleen te versturen wanneer er beveiligingsupdates beschikbaar zijn. Om van alle beschikbare updates op de hoogte gesteld te worden, klik hier @url.','nl',0),(7439,'Er is een probleem opgetreden bij het ophalen van <a href=\":update-report\">beschikbare updates</a> voor Drupal.','nl',0),(7440,'Er is een probleem opgetreden bij het ophalen van <a href=\":update-report\">beschikbare updates</a> voor modules of thema\'s.','nl',0),(7441,'Het automatisch updaten van Drupal core wordt niet ondersteund. Kijk in de <a href=\":upgrade-guide\">upgradegids</a> voor informatie hoe u Drupal core handmatig kunt updaten.','nl',0),(7442,'Bekijk de pagina <a href=\":available_updates\">beschikbare updates</a> voor meer informatie en om de ontbrekende updates te installeren.','nl',0),(7443,'Ga naar de pagina <a href=\":available_updates\">beschikbare updates</a> voor meer informatie.','nl',0),(7444,'Instellingen van de Update Manager','nl',0),(7445,'Controleer op updates van niet geïnstalleerde modules en thema\'s','nl',0),(7446,'U kunt er voor kiezen alleen e-mails te versturen als een beveiligingsupdate beschikbaar is, of geïnformeerd te worden over alle nieuwe versies. Als er updates beschikbaar zijn van Drupal core of van de geinstalleerde modules of thema\'s zal de site altijd een bericht weergeven op de pagina <a href=\":status_report\">Statusrapportage</a>. Ook zal een foutbericht getoond worden op de beheerpagina\'s als er een veiligheidsupdate beschikbaar is.','nl',0),(7447,'<a href=\":module_url\">Modules</a> en <a href=\":theme_url\">thema\'s</a> vindt u op <a href=\":drupal_org_url\">drupal.org</a>. De volgende bestandsextensies worden ondersteund: %extensions.','nl',0),(7448,'Maak een backup van de database en website voordat u verder gaat. <a href=\":backup_url\">Leer hoe</a>.','nl',0),(7449,'Uitgefaseerd: Gebruikersnaam','nl',0),(7450,'Verouderd: Gebruik in plaats hiervan accountnaam of weergave-naam','nl',0),(7451,'De weergavenaam van het gebruikersaccount.','nl',0),(7452,'Via de pagina <a href=\":people\">Personen beheren</a> kunt u gebruikeraccounts toevoegen en annuleren en rollen toekennen aan gebruikers. Door een bepaalde gebruiker te bewerken, kunt u de gebruikersnaam, het e-mailadres, het wachtwoord en overige informatie wijzigen.','nl',0),(7453,'<em>Rollen</em> worden gebruikt om gebruikers te groeperen en te classificeren; elke gebruiker kan worden toegewezen aan een of meerdere rollen. Normaliter zijn er twee voorgedefinieerde rollen: <em>Anonieme gebruiker</em> (gebruikers die niet zijn ingelogd), en <em>Geauthenticeerde gebruiker</em> (gebruikers die geregistreerd en ingelogd zijn). \r\nAfhankelijk van de instellingen van de site is er mogelijk ook een rol <em>Beheerder</em>. Gebruikers met deze rol krijgen automatisch alle toegangsrechten telkens als een module geactiveerd wordt. U kunt extra rollen aanmaken op de <a href=\":roles\">Rollen beheerpagina</a>.','nl',0),(7454,'Na het aanmaken van rollen kunt u de toegangsrechten voor elke rol instellen op de pagina <a href=\":permissions_user\">Toegangsrechten</a>. Door het toekennen van rechten kunnen gebruikers met de betreffende rol bepaalde acties op de site uitvoeren, zoals inhoud bekijken, bewerken of aanmaken van een bepaald inhoudstype, instellingen van een bepaalde module beheren of een bepaalde functionaliteit van de site gebruiken (zoals zoeken).','nl',0),(7455,'Op de pagina <a href=\":accounts\">Accountinstellingen</a> kunt u de naam van de anonieme gebruiker, persoonlijk contactformulieren en accountannulering instellen. Ook kunt u hier de instellingen beheren voor het personaliseren van de accounts en kunt u de berichten aanpassen die gebruikers ontvangen tijdens het registratieproces of bij het aanvragen van een nieuw wachtwoord. Verder kunt u instellen aan welke rol automatisch rechten worden toegekend wanneer een module ingeschakeld wordt (de Beheerdersrol).','nl',0),(7456,'Toegangsrechten geven u controle over wat gebruikers kunnen zien en doen op de site. U kan een specifieke set toegangsrechten bepalen voor elke gebruikersrol. (Op de pagina <a href=\":role\">Beheer gebruikersrollen</a> kunt u een gebruikersrol aanmaken.) Alle toegangsrechten die toegekend zijn aan de gebruikersrol \'Geverifieerde gebruiker\' zijn van toepassing voor gebruikers die kunnen inloggen op de site. Op de pagina <a href=\":settings\">Accountinstellingen</a> kunt u van elke gebruikersrol de Beheerdersrol maken, dit betekent dat aan deze gebruikersrol automatisch alle nieuwe toegangsrechten toegekend zullen worden. Let op dat u dit niveau van controle en toegang enkel toekent aan vertrouwde gebruikers.','nl',0),(7457,'Ten minste 12 tekens','nl',0),(7458,'Configureer de sitebreed instellingen en het gedrag voor gebruikersaccounts en -registratie. Dit bevat ook account annuleringsmethoden, de inhoud van e-mails voor gebruikers en velden gekoppeld aan gebruikers.','nl',0),(7459,'Alle gebruikersaccounts beheren. Dit omvat het bewerken van alle gebruikersinformatie, wijzigingen van emailadressen en wachtwoorden, emails versturen naar gebruikers en het blokkeren en verwijderen van accounts.','nl',0),(7460,'Verplicht indien u het %mail of %pass hieronder wilt wijzigen. <a href=\":request_new_url\" title=\"Instructies voor het opnieuw instellen van het wachtwoord via e-mail verzenden.\">Uw wachtwoord opnieuw instellen</a>.','nl',0),(7461,'Gebruikers met de <a href=\":permissions-url\">toegangsrechten</a> %select-cancel-method of %administer-users kunnen deze standaardmethode aanpassen.','nl',0),(7462,'Beschikbare variabelen zijn: [site:name], [site:url], [user:display-name], [user:account-name], [user:mail], [site:login-url], [site:url-brief], [user:edit-url], [user:one-time-login-url], [user:cancel-url].','nl',0),(7463,'Nieuw gebruikersaccount aangemaakt voor <a href=\":url\">%name</a>. Er is geen e-mail verstuurd.','nl',0),(7464,'De nieuwe gebruiker <a href=\":url\">%name</a> is aangemaakt zonder e-mailadres, er is daardoor geen welkomstboodschap verstuurd.','nl',0),(7465,'Een welkomstbericht met verder instructies is verstuurd naar de nieuwe gebruiker <a href=\":url\">%name</a>.','nl',0),(7466,'Instructies voor het resetten van het wachtwoord worden naar uw e-mailadres verstuurd.','nl',0),(7467,'Wachtwoord reset-instructies per e-mail versturen.','nl',0),(7468,'Ook bekend als:','nl',0),(7469,'@label (@name:@column)','nl',0),(7470,'@label:@column','nl',0),(7471,'@label (@name:delta)','nl',0),(7472,'Bekijk de <a href=\":views\">online documentatie van de Views-module</a> voor meer informatie.','nl',0),(7473,'Uitbreidingsprojecten die de Views-module ondersteunen kunnen gevonden worden in de <a href=\":node\">online documentatie voor Views-gerelateerde uitbreidingsmodules</a>.','nl',0),(7474,'Deze link is geleverd door de Views-module. Het pad kan aangepast worden door het bewerken van het overzicht <a href=\":url\">@label</a>','nl',0),(7475,'@type taal is geselecteerd voor pagina','nl',0),(7476,'Zal niet toegankelijk zijn.','nl',0),(7477,'@code (@title)','nl',0),(7478,'De volgende tokens zijn beschikbaar. U kunt de Twig-syntax in dit veld gebruiken.','nl',0),(7479,'Overschrijf de weergave en andere argumenttitels. De Twig-syntax is toegestaan in dit veld.','nl',0),(7480,'De volgende tokens zijn beschikbaar voor dit argument.','nl',0),(7481,'De categorie waarin dit blok zal verschijnen op de <a href=\":href\">blokplaatsingspagina</a>.','nl',0),(7482,'Scheid meerdere klassen met spaties.','nl',0),(7483,'U kunt ook de @settings aanpassen voor de geselecteerde toegangsbeperking.','nl',0),(7484,'U kunt ook de @settings aanpassen voor het geselecteerde cache-mechanisme.','nl',0),(7485,'U kunt ook de @settings aanpassen voor de geselecteerde stijl.','nl',0),(7486,'U kunt ook de @settings aanpassen voor het geselecteerde regeltype.','nl',0),(7487,'De volgende tokens zijn beschikbaar voor deze link. De Twig syntax is toegestaan in dit veld.','nl',0),(7488,'U kunt ook de @settings aanpassen voor de geselecteerde paginering.','nl',0),(7489,'Een offset ten opzicht van de huidige tijd, zoals  \'@example1\' of \'@example2\'','nl',0),(7490,'De Views UI-module biedt een interface voor het beheren van overzichten gemaakt met de <a href=\":views\">Views-module</a>. Bekijk voor meer informatie <a href=\":handbook\">de online documentatie voor de Views UI-module</a>.','nl',0),(7491,'Overzichten kunnen in- en uitgeschakeld worden op de <a href=\":list\">Overzichtspagina</a>. Zoek een overzicht in de lijst \'uitgeschakeld\' en kies \'inschakelen\' om een overzicht in te schakelen. Zoek een overzicht in de lijst \'ingeschakeld\' en kies \'uitschakelen\' om een overzicht uit te schakelen.','nl',0),(7492,'Met de de <a href=\":config\">Configuration Manager-module</a> kunnen overzichten als configuratiebestand geëxporteerd en geïmporteerd worden.','nl',0),(7493,'Geavanceerde overzichtsinstellingen','nl',0),(7494,'@display_title bekijken','nl',0),(7495,'Dupliceren als @type','nl',0),(7496,'@display toevoegen','nl',0),(7497,'Door deze vergrendeling te verbreken, zullen niet-opgeslagen aanpassingen, die door @user zijn gemaakt, verloren gaan.','nl',0),(7498,'[user:display-name],\r\n\r\nEen verzoek om uw gebruikersaccount te annuleren is ingediend bij [site:name].\r\n\r\nU kunt nu uw account annuleren op [site:url-brief] door op onderstaande link te klikken of deze te knippen en plakken in uw browser:\r\n\r\n[user:cancel-url]\r\n\r\nLet op: Het annuleren van uw account kan niet ongedaan worden gemaakt!\r\n\r\nDeze link verloopt binnen één dag. Er gebeurt niets als deze link niet binnen één dag wordt gebruikt.\r\n\r\n--  [site:name] team','nl',0),(7499,'Verzoek om account te annuleren van [user:display-name] op [site:name]','nl',0),(7500,'Vervangende logininformatie voor [user:display-name] op [site:name]','nl',0),(7501,'Accountgegevens voor [user:display-name] op [site:name]','nl',0),(7502,'[user:display-name],\r\n\r\nBedankt dat u zich heeft geregistreerd op [site:name]. De aanvraag voor een account wacht momenteel op goedkeuring. Zodra de aanvraag is goedgekeurd ontvangt u een e-mail met daarin inloginformatie, hoe het wachtwoord kan worden gewijzigd en andere details.\r\n\r\n\r\n--  [site:name] team','nl',0),(7503,'Accountgegevens voor [user:display-name] op [site:name] (wachtend op de goedkeuring van de beheerder)','nl',0),(7504,'[user:display-name] heeft een account aangevraagd.\r\n\r\n[user:edit-url]','nl',0),(7505,'[user:display-name],\r\n\r\nUw account op [site:name] is geactiveerd.\r\n\r\nU kunt nu inloggen door op de onderstaande link te klikken of deze in uw browser te kopiëren:\r\n\r\n[user:one-time-login-url]\r\n\r\nDit is een eenmalige login en u wordt doorgestuurd naar een pagina waar u uw wachtwoord kunt instellen.\r\n\r\nNadat u uw wachtwoord heeft gewijzigd, kunt u in de toekomst inloggen op [site:login-url] met:\r\n\r\ngebruikersnaam: [user:account-name]\r\nwachtwoord: Uw wachtwoord\r\n\r\n--  [site:name] team','nl',0),(7506,'Accountgegevens voor [user:display-name] op [site:name] (goedgekeurd)','nl',0),(7507,'Accountgegevens voor [user:display-name] op [site:name] (geblokkeerd)','nl',0),(7508,'[user:display-name],\r\n\r\nUw account op [site:name] is geannuleerd.\r\n\r\n--  [site:name] team','nl',0),(7509,'Accountgegevens voor [user:display-name] op [site:name] (geannuleerd)','nl',0),(7510,'Kies een taal om door te gaan met de installatie.','nl',0),(7511,'@display \'@id\': Onderdeel \'@name\' is uitgeschakeld omdat zijn instellingen afhankelijk zijn van de verwijderde afhankelijkheden.','nl',0),(7512,'Geen widget beschikbaar voor: %type','nl',0),(7513,'De bundel %target_bundle (entiteittype: %target_entity_type) is verwijderd. Hierdoor heeft het entiteitreferentieveld %field_name  (entiteittype: %entity_type, bundel: %bundle) geen bundel meer om naar te verwijzen. Het veld werk niet goed meer en dient aangepast te worden.','nl',0),(7514,'Meerdere speciale tekens zijn toegestaan, waaronder spatie, punt (.), koppelteken (-), apostrof (\'), onderstrepingsteken (_) en het apenstaartje (@).','nl',0),(7515,'Deze waarde is ongeldig.','nl',0),(7516,'Taken aanmaken die het systeem kan uitvoeren.','nl',0),(7517,'De URL waarnaar de gebruiker moet worden doorverwezen. Dit kan zowel een interne URL zijn zoals /node/1234 als een externe URL zoals @url.','nl',0),(7518,'Voeg feeds toe of importeer een OPML-bestand om externe content te verzamelen. Stel in hoe vaak deze wordt bijgewerkt.','nl',0),(7519,'De Automated Cron-module voert cron-taken uit en gebruikt daarbij normale browser- en paginaverzoeken in plaats van een apart ingestelde cron-taak. De Automated Cron-module controleert na elke server-reactie wanneer cron voor het laatst is uitgevoerd en voert, als dit te lang geleden was, de cron-taak uit na het versturen van de server-reactie. Zie voor informatie de <a href=\":automated_cron-documentation\">online documentatie van de  Automated Cron-module</a>.','nl',0),(7520,'Automated Cron instellen','nl',0),(7521,'Op de pagina <a href=\":cron-settings\">Cron</a> kunt u de frequentie van cron-taken instellen.','nl',0),(7522,'Automated Cron uitschakelen','nl',0),(7523,'Schakelt de Automated Cron-module uit door het deïnstalleren van de module om zo de overhead van de website te verminderen. Als u de cron tijdelijk wilt uitschakelen, kunt u op de Cron-pagina de frequentie instellen op \'Nooit\'. Wanneer cron hervat kan worden, kunt u de frequentie opnieuw op de gewenste interval instellen.','nl',0),(7524,'Geautomatiseerde cron','nl',0),(7525,'Zorgt voor een automatische manier om cron jobs uit te voeren, door deze te laten starten op het einde van de server response.','nl',0),(7526,'Instellingen automatische cron','nl',0),(7527,'Blokkeer bezoeken van specifieke IP-adressen.','nl',0),(7528,'Plaats een nieuw blok in een gebied door <em>Blok plaatsen</em> te selecteren op de pagina <a href=\":blocks\">Blok-layout</a>. Wanneer een blok is geplaatst, kan het verplaatst worden naar een ander gebied met klik-en-sleep of door de keuzelijst van het <em>Gebied</em> te gebruiken. Klik daarna op <em>Blokken oplaan</em>.','nl',0),(7529,'De plaatsing van blokken is specifiek voor elk thema van de website. Aanpassingen worden pas opgeslagen na klikken op <em>Blokken opslaan</em> onderaan de pagina.','nl',0),(7530,'Reactietypes toevoegen','nl',0),(7531,'Meer <em>reactietypes</em> kunnen per entiteitsubtype worden aangemaakt op de pagina <a href=\":field\">Reactietypen</a>. Als er meerdere reactietypen beschikbaar zijn kunt u het geschikte type kiezen nadat u een <em>Reactieveld</em> heeft toegevoegd.','nl',0),(7532,'Vergelijk de configuratie die geüpload is in de synchronisatiemap met de actieve configuratie voordat u de import afrond.','nl',0),(7533,'Upload een volledig siteconfiguratie-archief naar de synchronisatiemap. Daarna kan het vergeleken en geïmporteerd worden op de Synchronisatie-pagina.','nl',0),(7534,'De module Database Logging registreert systeemgebeurtenissen in de database. Monitor de site of debug problemen via deze pagina.','nl',0),(7535,'De Internal Dynamic Page Cache-module cachet pagina\'s voor alle gebruikers in de database, waarbij met dynamische inhoud rekening wordt gehouden. Bekijk de <a href=\":dynamic_page_cache-documentation\">online documentatie voor de Internal Dynamic Page Cache-module</a> voor meer informatie.','nl',0),(7536,'De module heeft geen configuratie nodig. Ieder deel van de pagina bevat metadata die Internal Dynamic Page Cache zelfstandig laat werken.','nl',0),(7537,'Uitgefaseerd. Alle functionaliteit is verplaatst naar Core.','nl',0),(7538,'Alle veldopslag-configuratieobjecten opnieuw opgeslagen.','nl',0),(7539,'Selectie-handlers voor entiteitreferentievelden zijn bijgewerkt.','nl',0),(7540,'<strong>Entiteitsreferentievelden</strong> bevatten links naar andere entiteiten binnen de site (zoals inhoudsitems, taxonomietermen, enz.). Hiermee kunt u bijvoorbeeld een link naar een gebruiker opnemen in een inhoudsitem. Zie voor meer informatie de <a href=\":er_do\">online documentatie van de Entity Reference-module</a>.','nl',0),(7541,'Aangepaste opslag inschakelen','nl',0),(7542,'Een instantie-specifiek widget-type','nl',0),(7543,'Widget-types @types toegepast in Drupal 6 velden: widget-type @selected_type toegepast in Drupal 8 velden','nl',0),(7544,'Met de Filter-module kunnen beheerders tekstopmaken configureren. Tekstopmaken bepalen hoe HTML-tags en andere tekst wordt <em>bewerkt en getoond</em> op de site. Tekstopmaken worden gebruikt om tekst om te zetten en ook om de site te beschermen tegen potentieel schadelijke invoer van kwaadwillende gebruikers. Visuele teksteditors kunnen met tekstopmaken worden gekoppeld met behulp van de <a href=\":editor_help\">Text Editor-module</a>. Bekijk de <a href=\":filter_do\">online documentatie van de Filter-module</a> voor meer informatie.','nl',0),(7545,'U kunt vastleggen welke gebruikers een tekstopmaak kunnen gebruiken door rollen te selecteren. Om de veiligheid te waarborgen moeten anonieme en niet-vertrouwde gebruikers alleen toegang krijgen tot tekstopmaak die platte tekst of een veilige set HTML-tags toestaat. Dit is omdat bepaalde HTML-tags het mogelijk kunnen maken om kwaadaardige links of scripts op te nemen in de tekst. Meer vertrouwde geregistreerde gebruikers kunnen toegang krijgen tot minder beperkte tekstopmaak voor rijker opgemaakte tekst. <strong>Onjuist geconfigureerde tekstopmaak is een veiligheidsrisico.</strong>','nl',0),(7546,'Iedere tekstopmaak gebruikt filters die elementen in ingevoerde tekst toevoegen, verwijderen of veranderen. Er is bijvoorbeeld een filter beschikbaar dat niet-toegestane HTML-tags verwijderd, terwijl een ander URLs omzet naar klikbare links. Filters worden in een specifieke volgorde toegepast. Ze passen niet de <em>opgeslagen</em> inhoud aan, maar ze leggen vast hoe deze wordt verwerkt en getoond.','nl',0),(7547,'Tekstopmaak definieert hoe tekst wordt gefilterd voor uitvoer en hoe HTML-tags en andere tekst wordt getoond, vervangen of verwijderd. <strong>Onjuist geconfigureerde tekstopmaak is een veiligheidsrisico.</strong> Lees meer op de <a href=\":filter_help\">helppagina van de Filter-module.</a>','nl',0),(7548,'Een tekstopmaak bevat filters die de weergave van gebruikersinvoer verandert; bijvoorbeeld het verwijderen van kwaadaardige HTML of URLs klikbaar maken. Filters worden van boven naar beneden uitgevoerd en de volgorde is belangrijk, aangezien het ene filter kan voorkomen dat het andere filter zijn werk kan doen. Als bijvoorbeeld URLs worden omgezet naar links voordat niet-toegestane HTML-tags worden verwijderd, zouden alle links verwijderd kunnen worden. Als dit gebeurt zou het kunnen dat de volgorde van de filters moet worden aangepast.','nl',0),(7549,'Instellen hoe inhoud gefilterd wordt bij weergave, welke HTML-tags weergegeven worden en welke filters zijn ingeschakeld.','nl',0),(7550,'Een lijst van HTML-elementen die gebruikt mogen worden. Standaard zijn alleen de attributen <em>lang</em> en <em>dir</em> toegestaan voor alle HTML-tags. Voor iedere HTML-tag kunnen toegestane attributen worden toegevoegd. Elk attribuut kan alle waardes toestaan, of alleen specifieke waardes. Attribuut-namen of -waardes kunnen geschreven worden als een voorvoegsel met een jokerteken, bijvoorbeeld <em>jump-*</em>. JavaScript event-attributen, JavaScript-URL\'s en CSS-stijlen worden altijd verwijderd.','nl',0),(7551,'De Inline Form Errors-module biedt een experimentele benadering van formulier-foutmeldingen, waarbij de melding direct naast het element geplaatst wordt. Zie voor meer informatie de online documentatie voor de <a href=\":inline_form_error\">Inline Form Errors-module</a>.','nl',0),(7552,'Stel talen in voor inhoud, interface en instellingen.','nl',0),(7553,'Overschrijven van de standaard Engelse tekenreeksen','nl',0),(7554,'Wanneer vertalen is ingeschakeld voor Engels, kunt u de standaard Engelse interface-tekst in de site <em>overschrijven</em> met andere Engelse tekenreeksen op de pagina <a href=\":translate\">Gebruikersinterface vertalen</a>. Vertalen staat standaard uit voor Engels, maar dit kunt u aanzetten door <em>Engels</em> te bewerken via de pagina <a href=\":languages\">Talen</a>.','nl',0),(7555,'Import van vertalingsbestanden instellen, en interface-vertalingen toevoegen of