delijk geblokkeerd. Probeer het later opnieuw of <a href=\":url\">vraag een nieuw wachtwoord aan</a>.','nl',0),(7576,'%name wordt niet herkend als gebruikersnaam of e-mailadres.','nl',0),(7577,'Maximale leeftijd van de cache','nl',0),(7578,'Overzichten aanmaken en beheren','nl',0),(7579,'Overzichten in- en uitschakelen','nl',0),(7580,'Overzichten exporteren en importeren','nl',0),(7581,'Stabiel','nl',0),(7582,'Links gerelateerd aan de actieve gebruikersaccount','nl',0),(7583,'Links voor beheertaken','nl',0),(7584,'Websitegegevens-links','nl',0),(7585,'Sectielinks van de site','nl',0),(7586,'Links voor gebruikshulp, vaak toegevoegd door modules','nl',0),(7587,'[user:display-name],\r\n\r\nOp [site:name] is een verzoek gedaan voor een nieuw wachtwoord van uw account.\r\n\r\nU kunt nu inloggen door op onderstaande link te klikken of deze te kopiëren en te plakken in de adresbalk van uw browser:\r\n\r\n[user:one-time-login-url]\r\n\r\nDeze link kan slechts één keer gebruikt worden en zal u doorverwijzen naar een pagina waar u uw wachtwoord opnieuw kunt instellen. De geldigheid van de link zal na één dag verlopen. Er zal niets gebeuren wanneer de link niet wordt gebruikt.\r\n\r\n--  [site:name] team','nl',0),(7588,'[user:display-name],\r\n\r\nEen beheerder van [site:name] heeft een account voor u aangemaakt. U kunt nu inloggen door op deze link te klikken of door deze te kopieren en te plakken in uw browser:\r\n\r\n[user:one-time-login-url]\r\n\r\nDeze link kan eenmalig gebruikt worden om in te loggen, waarna u uw wachtwoord dient aan te passen.\r\n\r\nNadat u uw wachtwoord heeft gewijzigd kunt u voortaan op [site:login-url] inloggen met behulp van de volgende gegevens:\r\n\r\ngebruikersnaam: [user:name]\r\nwachtwoord: Uw wachtwoord\r\n\r\n--  [site:name] team','nl',0),(7589,'[user:display-name],\r\n\r\nDank u voor het registreren bij [site:name]. U kunt nu inloggen door het volgen van onderstaande link of deze te knippen en plakken in uw browser:\r\n\r\n[user:one-time-login-url]\r\n\r\nDeze link kan éénmalig worden gebruikt en zal u doorverwijzen naar een pagina waar u uw wachtwoord kan instellen.\r\n\r\nNa het instellen van uw wachtwoord kunt u in de toekomst inloggen op [site:login-url] met de volgende gegevens:\r\n\r\ngebruikersnaam: [user:name]\r\nwachtwoord: Uw wachtwoord\r\n\r\n--  [site:name] team','nl',0),(7590,'De taalcode.','nl',0),(7591,'%label verwijderen','nl',0),(7592,'Sta toe dat de gebruiker alle items weergeeft','nl',0),(7593,'Los onderstaande punten op om de installatie verder te kunnen doorlopen.  Raadpleeg het <a href=\"https://www.drupal.org/getting-started/install\">installatiehandboek</a> of contacteer uw hostingprovider voor hulp bij het configureren van uw database.','nl',0),(7594,'Tekst-editors selecteren en instellen, en bepalen hoe de inhoud wordt gefilterd en weergegeven.','nl',0),(7595,'Aggregator RSS feed','nl',0),(7596,'Aggregatorbronnen','nl',0),(7597,'Aangepaste blokken zoeken en beheren','nl',0),(7598,'Recente reacties.','nl',0),(7599,'Bestanden vinden en beheren.','nl',0),(7600,'Talen bewerken','nl',0),(7601,'Alle inhoud, op maand.','nl',0),(7602,'Recente inhoud.','nl',0),(7603,'Alle inhoud die wordt aangeraden op de voorpagina.','nl',0),(7604,'Alle inhoud, op letter.','nl',0),(7605,'Inhoud van een bepaalde taxonomieterm','nl',0),(7606,'Toont een lijst van de nieuwste gebruikersaccounts op de website.','nl',0),(7607,'\'Wie is online\'-blok','nl',0),(7608,'Toont de gebruikersnamen van de meest recente actieve gebruikers, en het totale aantal actieve gebruikers.','nl',0),(7609,'De bewerkpagina bekijken','nl',0),(7610,'Max. 1300x1300','nl',0),(7611,'Max. 2600x2600','nl',0),(7612,'Max. 325x325','nl',0),(7613,'Max. 650x650','nl',0),(7614,'Configuratie-overschrijftest','nl',0),(7615,'Er zijn geen aagepaste blokken beschikbaar. ','nl',0),(7616,'Bestandenoverzicht','nl',0),(7617,'Bestandsgebruikinformatie voor {{ arguments.fid }}','nl',0),(7618,'<p>Deze pagina biedt de mogelijkheid om algemene talen toe te voegen aan de site.</p><p>Als de gewenste taal niet beschikbaar is kunt u een aangepaste taal toevoegen.</p>','nl',0),(7619,'<p>Kies een taal uit de lijst, of kies \'Aangepaste taal...\' aan het eind van de lijst.</p><p>Klik op de knop \'Taal toevoegen\' als u een taal hebt gekozen.</p><p>Als u een aangepaste taal toevoegd, krijg u een extra formulier waar de naam, taalcode en leesinrichting van de taal kunt invullen.</p>','nl',0),(7620,'Wordt vervolgd op','nl',0),(7621,'<p> Deze pagina biedt de mogelijkheid om een taal te bewerken op uw site, inclusief aangepaste talen. </p>','nl',0),(7622,'<p>U kunt de taalcode niet aanpassen op de site omdat deze gebruikt wordt door het systeem om de taal te identificeren.</p>','nl',0),(7623,'<p>De naam van de taal wordt site-breed gebruikt voor alle gebruikers en wordt in het Engels weergegeven. Namen van ingebouwde talen kunnen vertaald worden met de Interface Translation-module en namen van zowel ingebouwde als aangepaste talen kunnen met de Configuration Translation-module vertaald worden.</p>','nl',0),(7624,'<p>Kies of de schrijfrichting van de taal \'links naar rechts\' of \'rechts naar links\' is.</p><p>Merk op dat niet alle thema\'s \'rechts naar links\'-layouts ondersteunen dus test het thema bij het gebruik van \'rechts naar links\".</p>','nl',0),(7625,'<p>De \"Talen\" pagina stelt u in staat talen toe te voegen, te wijzigen, te verwijderen of te rangschikken voor de site.</p>','nl',0),(7626,'<p>Om meer talen aan de site toe te voegen, klikt u op de \"Voeg talen toe\" knop.</p><p>Toegevoegde talen worden in de talenlijst weergegeven en kunnen worden bewerkt of verwijderd.</p>','nl',0),(7627,'Talen herschikken','nl',0),(7628,'<p>Gebruik de sleep-iconen naast de talen om de talen op uw site te rangschikken.</p><p>De volgorde die hier getoond wordt is de weergavevolgorde van talen op de site zoals in de taalkeuze blokken van de Interface Translation-module en de Content Translation-module.</p><p>Als u klaar bent met het rangschikken van de talen klikt u op \"Instellingen opslaan\" om de wijzigingen door te voeren.</p>','nl',0),(7629,'Een taal als standaard instellen','nl',0),(7630,'<p>U kunt de standaardtaal van de site wijzigen door een van de geconfigureerde talen te kiezen als standaard. De site gebruikt de standaardtaal daar waar geen keuze is gemaakt voor een taal maar wel een taal verwacht wordt, bijvoorbeeld de taal van de weergegeven interface.</p>','nl',0),(7631,'Talen aanpassen','nl',0),(7632,'<p>Bewerkingen zijn beschikbaar om talen te wijzigen of te verwijderen.</p><p>U kunt de naam en schrijfrichting van een taal wijzigen.</p><p>Verwijderde talen kunnen later weer toegevoegd worden. Een taal verwijderen zal ook alle interfacevertalingen verwijderen die bij deze taal horen, en inhoud in deze taal wordt \"taal-neutraal\" gezet. De standaardtaal van de site kan niet verwijderd kan worden.</p>','nl',0),(7633,'Kies de taal die u wilt vertalen.','nl',0),(7634,'Geef het specifieke woord of zin op dat u wilt vertalen. U kunt ook alleen een deel van een woord opgeven.','nl',0),(7635,'Zoekresultaten filteren','nl',0),(7636,'U kunt zoeken op onvertaalde tekenreeksen als u iets wilt vertalen dat nog niet is vertaald. Als u een bestaande vertaling wilt aanpassen, dan kunt u ook alleen zoeken op vertaalde tekenreeksen.','nl',0),(7637,'De zoekcriteria toepassen','nl',0),(7638,'Klik op de <em>Filter</em>-knop om de zoekcriteria toe te passen.','nl',0),(7639,'U kunt uw eigen vertaling in de tekstvelden van de rechter kolom schrijven. U kunt het beste proberen te achterhalen in welke context de tekst wordt gebruikt om de meest passende vertaling te geven.','nl',0),(7640,'De vertaling valideren','nl',0),(7641,'Als u klaar bent met de vertaling klikt u op de knop <em>Vertalingen opslaan</em>. U moet de vertaling opslaan voordat u de pagina wisselt of een nieuwe zoekopdracht uitvoert.','nl',0),(7642,'{{ arguments.created_year_month }}','nl',0),(7643,'Inhoud vinden en beheren','nl',0),(764